verse: MRK.007.026
translations:
  kpx-kpx: Keate keu Diue ata holioholinu. Keu Sulovenisia vatamo lohonu. Iale keu
    lohoaleu Iesu namihai avoe, “Ana valive di maemo munanae toela nunuvai.”
  okv-H: Iesu ta utu ta veto gombuto Iesu na iae ta jo ta ahihi sapura avo ohimbaja
    penunu enu,
  tbo-tbo: '@see-verse:MRK.007.025'
  mal-C: അവൾ സുറൊഫൊയ്നീക്യയിൽ ജനിച്ച ഒരു ഗ്രീക്കുകാരി ആയിരുന്നു. തന്റെ മകളിൽനിന്ന്
    ഭൂതത്തെ പുറത്താക്കാൻ അവൾ യേശുവിനോട് അപേക്ഷിച്ചു.
  grc-SR: ⸉ἦν δὲ ἡ γυνὴ⸊ Ἑλληνίς, Συραφοινίκισσα τῷ γένει· καὶ ἠρώτα αὐτὸν ἵνα τὸ
    δαιμόνιον ⸂ἐκβάλῃ⸃ ἐκ τῆς θυγατρὸς αὐτῆς.
  bgc-bgc: वा सुरुफिनिकी परदेस के यूनानी जात की थी। बिरबान्नी नै उसतै बिनती करी के
    मेरी छोरी म्ह तै ओपरी आत्मा लिकाड़ दे।
  khz-khz: Vogare ia Grik garena, Siriafonesia ai ewalato. Ne ia na Iesu enogiato,
    vopalagu rakavana natuna vavinena genana pene gui-atia
  deu-TKW: Die Frau war aber eine Griechin, von Geburt eine Syrophönikerin; und sie
    bat ihn, daß er den Dämon aus ihrer Tochter treibe.
  zsr-NT: Ngul ni cutu nacnu judío, san nababnu bunách Sirofenicia. Gútaꞌyunu lahuëꞌ
    Jesús ubijëꞌ böꞌ xöhuiꞌ naꞌ yuꞌu‑biꞌ biꞌi nguldauꞌ queënu.
  lin-lin: Mwasi yango azalaki moto ya Grese, moto ya Fenisi ya Siri ; asengaki na
    Yesu ete abengana molimo mabe oyo ezali konyokola mwana na ye ya mwasi.
  hns-NT: '@see-verse:MRK.007.025'
  noa-E: Mag ʉʉi deeum durr Sirofenicia anʉm durram ajim anaabá. Ich mag ʉʉirau Jesús
    aar mawia chaigpaimajim anʉm, ich chaai mor eem thõthõrrsöm bën öbeerpʉ̈imkhĩir.
  eng-EMTV: Now the woman was a Greek, a Syro-Phoenician by race, and she was asking
    Him to cast the demon out from her daughter.
  mib-NT: Te ñahan ñuu jicá cúu ña, chi nde Sirofenicia cúu nación ña. Te ni cahān
    ndahú ña jíín yá jeē na quénehen ya tachī ini sēhe sɨ́hɨ́ ña.
  bea-bea: Yaghi tsege Greek tane, Syrophenician ine tsi ihe otsi tazelh; kahchu yachinioonunisit
    hayatoohai gha atsinde metselihi matue zi ta otsi.
  lif-NT2: खे़न् मे़न्‍छुमाःन् सिरिया लाजेॽस्‍मा सुरोफोनिसिया थुम्‍मो सागे़वाःन्‍छिङ्‌मा
    थिम्‍मे़न्‍दङ् सुवाङ्‌स्‍मा वये़॥ खे़ल्‍ले़ आस्‍साः चुक्‍मे़ल्‍लोलाम् फे़न्‍साम्‍हाॽ
    लःत्ताङ् पिराङ्‌ङे़ॽना फाॽआङ् खुने़ॽ पेलि फाक्‍तु॥
  xnj-xnj: Mdala mwenuyo, avi Mgiliki, ndi mkolonjinji wa muji wa Foinike mulima wa
    ku Silia. Hinu akamuyupa Yesu amuwusa mzuka msikana waki.
  mmx-mmx: Mo latkin, neni me Grik ketla diga visix i ro at lenep Siroponisia. La
    neni ga sing ne Iesu dola neni na riki kepe lagas basinge loolik teren.
  cbr-NT: A xanux ca judíosma, Sirofenicia menu 'icë 'iacëxa. Usa 'ixun ca aín tuánua
    isa ñunshin 'atima chiquínun quixun Jesús cacëxa.
  tee-NT: Pus ju anu' chako'ulh ixchivinin ju lhigriego chai amachaka' Sirofenicia
    ixjunita. Pus ju yuchi tapaininilh ju Jesús ni caxcoxtunilh ju lhacaticuru la'ixlacatuna
    ju istsi'.
  eng-LSV: and the woman was a Greek, a Syro-Phoenician by nation—and was asking Him
    that He may cast forth the demon out of her daughter.
  cak-NT: Ri jun ixok ri' man israelita ta. Raja' jun aj-sirofenicia. Pero xoxuquie'
    chech ri Jesús chi xuc'utuj favor che chi tulesaj-e ri itzel espíritu riq'uin
    ri ral.
  pah-NT: '@see-verse:MRK.007.025'
  sja-NT: '@see-verse:MRK.007.025'
  xed-xed: Ka ndəɓu tsi ta dzvu da tsi ŋa ghzligiŋtá tsa duhwala halaway ya ma tsa
    makwani ya. Tsa marakw ya ná, makwa la Grek ma luwa Finusi, ya lu ta haɗika Siri
    ya.
  mks-NT: Ta cúú ñá ñá tóho̱ cuéntá ñundáhyi̱ Sirofenicia. Ta na̱xi̱ca̱ ta̱hví ñá
    nu̱ Jesús ña̱ ná tavá a̱ ínima̱ quini ndáca̱a̱n ini ja̱hyi ñá.
  gfk-S: Iga ianga marmaris tane Jisas be na hasur leise no sana tanuo nong ga sasoh
    tano nuno not no hinasik. Ma ikino haine, paile Iudeia ie. Di ga kaho ie tano
    katano Ponisia tano tamat na katano Siria.
  bmu-bmu: Ambi mi Judaya qahöpmö, Grik keu jiba malök. Iwinamŋan Siria prowinsgö
    Fonisiagöra. Yaŋön böratŋaŋgö uruŋeyök öme közölmapköra ulet waŋgiyök.
  dgz-dgz: Me Diu uoni Gurik noa waini waenewa pa sewa Ponisia at Siria gapan tauen.
    Waen ame Iesu inap noek noek wan airampu orewa potape warup oirenep tau aepen
    menan waiwandin.
  eng-GNV: (And the woman was a Greeke, a Syrophenissian by nation) and she besought
    him that he would cast out the deuill out of her daughter.
  zaa-NT: Lą nna gutta'yúnią ne qui'ni ebèqquie espíritu malo lo losto' ỹi'ni niá.
    Niuláa nna labí uccuą enne' judío sino nu raza lą́ sirofenicia.
  eng-WEBSTER: (The woman was a Greek, a Syrophenician by nation,) and she besought
    him that he would cast forth the demon out of her daughter.
  guh-guh: 'Bajarapova sirofeniciaviriava, apo judíova. Nexata Jesúsjavabelia jumaitsi:
    —Pexaniacuene bitso netoexanare. Taxënatovayo netovecuacapitsapare dovathi, jai
    bajarapova.'
  bon-bon: Ai magebi lui Israela biname lica gwene, tabe Griik meneyame magebi gwene.
    Tabe Poenikiya babo cewe je aplimluji Suriya gawe cabu je. Siige tabe Yeesu ne
    ewejanige niiya cable ne asatame teeme bägrä me trupa cabu ca.
  nhw-BL: Pero nopa sihuatl amo eliyaya se israelita. Yaya camanaltic griego huan
    ejqui se lugar itoca Fenicia ipan tlali Siria. Huan nopa sihuatl hualajqui huan
    chicahuac quitlajtlani Jesús ma quiquixti nopa ajacatl catli quipixtoya isihuapil.
  swh-ONEN: Basi huyo mwanamke alikuwa Myunani, aliyezaliwa Foinike ya Siria. Akamsihi
    Yesu amtoe binti yake huyo pepo mchafu.
  wbi-wbi: Unkijuuva ujuo akisile Muyunani, ghwa kikolo kya Kifoeniki akansuma juue
    adage ilipepo kuhuma mwa mwalive
  bba-bba: Kurɔ wi, u sɑ̃ɑwɑ Gɛrɛki wi bɑ mɑrɑ Fenisiɔ, Sirin tem sɔɔ. U Yesu kɑnɑmɔ
    u nùn win biin wɛrɛku ɡirɑ.
  eng-KJVCPB: the woman was a Greek, a Syrophenician by nation; and she besought him
    that he would cast forth the devil out of her daughter.
  kgk-NT: 'Ha kunha katu onhe''ẽ outro nhe''ẽ-py. Grego nhe''ẽ-py onhe''ẽ. He''ýi
    Sirofenícia pygwa. Ojerure Hesu-pe: —Emosẽ katu imondo-vy xe memby-gwi anháy,
    he''i íxupe.'
  waj-waj: Aa gioonna aavo ari voopinnaa gioonnavai. Ivo yoosinna Surofoonikiaivakidiri
    nnira gioonnavai. Yisuuva ii gioonna ivaa raunnaivaa aakiaivaki mmagia maisaivo
    varuuvaa titano kuaiveera inna yaagueeqama yapara riravai.
  cpy-cpy: 'Kaari Judá-paeni iroka tsinani, Owinteni-jato iroka. Okantapaakiri: “Pinkathari,
    petsiyata-kotakaa-yinawo nishintyo, raahashireta-tziiro peyari.”'
  ekk-PKP: See naine oli kreeklanna, sündinud Sürofoiniikias. Ta palus, et Jeesus
    ajaks tema tütrest kurja vaimu välja.
  mpx-mpx: ge i awanun elana yayaluwa bibikena ni patuna owaowani natuna elana. He
    yova ya nige Yudiya yovana i oola, hi aba labena Ponisiya, Siliya gamwanaa.
  wbp-wbp: '@see-verse:MRK.007.025'
  luo-luo: Dhakoni ne en nyar jo-Yunani monywol Foinike e piny Siria. Nobiro ir Yesu
    mohombe mondo oriemb jachien oa kuom nyare.
  nhe-NT: Pero nopa sihuatl ax eliyaya se israelita. Yajaya camatqui griego huan ehua
    se lugar tlen itoca Fenicia ipan tlali Siria. Huan nopa sihuatl hualajqui huan
    quitlajtlani Jesús ma quiquixti nopa ajacatl tlen quipixtoya isihuapil.
  aii-aii: ܘܗ̇ܝ ܒܲܟ݂ܬܵ‌ܐ ܢܘܼܟ݂ܪܵܝܬܵ‌ܐ ܝܗܘܵܐ، ܡ̣ܢ ܒܢܲܝ̈ ܦܹܘܢܝܼܩܹܐ ܕܣܘܼܪܝܼܵܐ. ܘܦܲܪܦܘܼܠܹܐ
    ܝܗܘܵܐ ܒܝܼܹܗ ܕܦܲܠܸܛ ܗܘܵܐ ܫܹܐܕܵܐ ܡ̣ܢ ܒܪܵܬܘܼܗ̇.
  esk-NT: Aġnaq Jew-ŋuŋitchuq, animapluni Phoenicia-mi Syria-mi ittuami. Taavruma
    iŋiqsruġniġaa irrusiqł̣uk anillaŋniaquplugu paniuraġikkaġmiñiñ.
  msb-msb: Griego idtoʼn babayi pero nabuhay siya sa Fenicia na adto sa Siria. Nakimaluoy
    man siya kan Jesus na pahalion an maraot na espirito na nagsulod sa iya anak.
  cpa-NT: Dsa² griego báh³ hio¹³ héi², dsa² ca¹lø¹chián¹ Sirofenicia. Ca¹mǿh¹ hio¹³
    Jesús chi²júh² dsi¹ Jesús jmi²dsí² hlaih¹³ quin¹² ja³mái¹³dsa.
  dso-dso: ସେ ସୁର ଦେସର୍‌ ପଇନିକିଆ ଜାଗାଇ ଜନମ୍‌ ଅଇ ଜିଉଦି ଜାତିର୍‌ ନ ରଇଲା, ତାର୍‌ ଟକିକେ
    ଡୁମା ଚାଡାଇବାକେ ସେ ଜିସୁକେ ବାବୁଜିଆ କଲା ।
  meu-meu: Ia na hane Helene, Suro-fenise hahinena; bena e noia, lauma dikana na hari
    kekeni ena amo iaese baine lulua oho.
  yva-NT: Akoya mo Yesus anajo indamu Po anawayo kakaije rawatan irati ama kavo raora.
    Weramu wanya somamo vatano Yahudije ma jewena, yara rano no munijo Penisia no
    no Siria.
  dgc-dgc: Nadid, i éya a bébe éy éwan Judeo, da taga Siria siya. Dinumaying siya
    ni Jesus, a ibutan na tu dimonyo to anak na.
  zpm-NT: '@see-verse:MRK.007.025'
  hix-NT: Onà wyaro nkekon hatà, àwya. Worokyamo yoh me manaye, romsàtho txko. Noro
    hyaye towko ha, kekon hatà, Txesusu wya.
  sim-sim: '@see-verse:MRK.007.025'
  npi-ULB: ती स्‍त्री एक ग्रिक र सिरियाको फोनिकेमा जन्मेकी थिइन् । तिनले आफ्नी छोरीबाट
    भूत निकाली दिनलाई उहाँसँग बिन्ती गरिन् ।
  cgc-cgc: Gapakiluoy kanen i na pagwaen Jesus malain ya na ispiritu naan ta iya na
    bata. Kanen i dili-Judio na natao naan ta Fenicia na sakep ta Siria daw iya na
    linggwai Griego.
  tim-tim: '@see-verse:MRK.007.025'
  yor-yor: Giriki ní obìnrin náà, Siro-Fonisia ní orílẹ̀-èdè rẹ̀. Ó bẹ Jesu kí ó bá
    òun lé ẹ̀mí èṣù náà jáde lára ọmọbìnrin òun.
  wos-wos: '@see-verse:MRK.007.025'
  emp-NTPO: Maʌ̃ne bed̶ea djuburiasia Jesuba jaira idji cau cacuad̶ebemada ãyã jʌretamãrẽã.
    Baribʌrʌ wẽrãra judioẽ́ basía. Siropenicia druad̶ebema basía.
  eng-F35: Now the woman was a Greek, a Syro-Phoenecian by birth, and she kept asking
    Him to cast the demon out of her daughter.
  ind-ind: Wanita itu bukan orang Yahudi. Dia berasal dari daerah Fenisia di provinsi
    Siria, dan dia berbahasa Yunani. Dia memohon kepada Yesus untuk mengusir setan
    yang menguasai anaknya.
  pes-OPCB: و التماس کرد که فرزندش را از شرّ آن روح پلید نجات دهد. این زن اهل فینیقیهٔ
    سوریه و غیریهودی بود.
  mpt-mpt: Unang olo Yudababe. O bib mak unangobe. O gongam bibo Sailo Finisia bib
    ye biobe. O Yesuse baabanoa Kobo ne moono hob misiame fotebebotnenale gesoa
  ssx-ssx: Ipikita꞉ Sitia nane hala꞉ da Pinisia wanda꞉ kone hayekepate Kitiki pi lo
    hayekeme. Ipika꞉ wandikina꞉ weleke tukiki pa꞉ta꞉ pitieke hoke temoko Yesuma꞉ tolu
    lina꞉yeke honke leekeme.
  mkl-mkl: Abou í bɛi í jɛ dimi mmu. À buui Fenisi si ilɛi Siri. Ŋɔi wɑ tɔɔ Jesu ku
    leleɑ nŋu inɛi inɔɔkou hɑi si ɑmɑɛu.
  gaq-gaq: ଆତେନ୍‌ ମୁଇଂ ଗ୍ରୀକ୍ ସେଲାମ୍ବୁଏ ଲେଃଗେ । ମେଁ ସିରିଆନେ ଫୈନିକୀୟା ଅରିଆ ଜନମ୍ ଡିଙ୍ଗ୍‌ଲେଃଗେ
    । ମେଁ ମେଁନେ ଉଙ୍ଗ୍‌ଡେବାନ୍ ଗଲିଆ ଆଆଁନ୍ତାର୍ ବିଃନ୍‌ସା ଜିସୁକେ ପାର୍‌ତନା ଡିଂକେ ।
  gof-RNT: Iya Ayhude maccasi gidukku; iya yelettiday Siroofinqe giya biittana. Iya,
    ba na7eeppe tuna ayyaanaa kessana mela Yesuusa woossasu.
  unx-unx: ଇନିଃ ସିରିୟା ଦିଶୁମ୍‌ରାଃ ଫୋନେସିୟାରେନ୍‌ ମିଆଁଦ୍‌ ସାଅଁସାର୍‌ କୁଡ଼ି ତାଇକେନାଏ,
    ଇନିଃ ହନ୍ତେକୁଡ଼ିଏତେ ବଙ୍ଗାକେ ହାର୍‌ଅଡଙ୍ଗ୍‌ତାଇମେ ମେନ୍ତେ ୟୀଶୁକେ ବିନ୍ତିକିୟାଏ ।
  gah-gah: Ámina vená nene Zuta vená negopa hetoka vená minake, Pinisia apá nene Silia
    mikasiuka getamó minatímo eza nene moholámini agikagutí holosi apeleko amisilitive
    loko loká omikago,
  lcm-lcm: Aina ke kapo ainan Elas, na kana rina e palpal Suropoinikis, na kala aikut
    ia si kana lu suai ani ingua ang pelek kana kavulik.
  aer-aer: '@see-verse:MRK.007.025'
  qvc-NT: '@see-verse:MRK.007.025'
  tgl-ULB: Ngayon ang babaing ito ay isang Griego na taga-Sirofenisa, ayon sa lahi.
    Nagmakaawa siya sa kaniya na palayasin ang demonyo sa kaniyang anak na babae.
  cbs-NT: '@see-verse:MRK.007.025'
  xtm-NTPP: Te ña'a ya'a chi masu ña'a judía ma kúu ña chi ña'a ñuu Sirofenicia ma
    kúu ña. Te ni jikan‑ta'vi ña nuu Jesús ma ja na kene'e ya tachi yinee sasi'i ña
    ma.
  nnq-nnq: Munkege jwenio akiba Mgiliki, kabila jakwe Mfoinike ku Silia. Ngannyopa
    Yesu ammoye mwana jwakwe nchepela.
  bao-NT: Cõ pea judío bojoco méé, Sirofenicia macõpʉ niiupo. Ape majopʉ nii pacago,
    Jesús're, “Yʉ macõpʉre wãtĩ ca jãñagʉre cõa wiene bojaya,” cʉ̃re ĩiupo.
  san-ORI: ସ୍ୱକନ୍ୟାତୋ ଭୂତଂ ନିରାକର୍ତ୍ତାଂ ତସ୍ମିନ୍ ୱିନଯଂ କୃତୱତୀ|
  huv-NT: Aaga najtaj quiaj ngome micual iüt Israel, nej nop sirofeniciana. Nej tatün
    xeyay ocueaj Teat Jesús mamb mawün nimeech wüx ombas micual nej.
  otn-NT: Pɛ hi̱ngra̱ judío na̱ ra̱ xisu, porque ra̱ mmɛ̱ngu̱ p'ʉ ja ra̱ häi Sirofenicia.
    Bi 'yäpra̱ ma̱te ra̱ Jesús ngue da̱ 'yøthebi rá̱ t'i̱xu̱ n'youi ra̱ ts'onthi̱.
  nop-nop: Tam u Gilikniŋ, ala yolikweli Fonisiya. Adi waabiŋiŋ Jesudi yabap kelemimbek
    yo buŋa niŋguk.
  obo-NT: Id po-eru-eru sikandin no od polegguangon ni Disas iddos busow nid lasud
    diyot anak din. Na iddon ba-ay, konna Judio, su nominuvu sikandin diyot prubinsya
    to Fenicia woy dos kinohiyan din, Griego.
  cak-ENT: Ri jun ixok ri' man israelita tüj. Rija' jun aj-Sirofenicia. Pero xxuque'
    chuvüch ri Jesús richin xuc'utuj favor chin que trelesaj ri itzel espíritu ri
    tz'amayon ri ral-xtün.
  lif-NT: ᤂᤧᤴ ᤔᤧᤴᤇᤢᤔᤠ᤺ᤴ ᤛᤡᤖᤡᤕᤠ ᤗᤠᤈᤣ᤹ᤛ᤻ᤔᤠ ᤛᤢᤖᤥᤑᤥᤏᤡᤛᤡᤕᤠ ᤌᤢᤶᤔᤥ ᤛᤠᤃᤧᤘᤠ᤺ᤴᤇᤡᤱᤔᤠ ᤌᤡᤶᤔᤧᤴᤍᤱ
    ᤛᤢᤘᤠᤱᤛ᤻ᤔᤠ ᤘᤕᤧ॥ ᤂᤧᤸᤗᤧ ᤀᤠᤛ᤻ᤛᤠ᤺ ᤆᤢᤰᤔᤧᤸᤗᤥᤗᤠᤶ ᤑᤧᤴᤛᤠᤶᤜᤠ᤹ ᤗ᤺ᤳᤋᤠᤱ ᤐᤡᤖᤠᤱᤅᤧ᤹ᤏᤠ ᤑᤠ᤹ᤀᤠᤱ ᤂᤢᤏᤧ᤹
    ᤐᤣᤗᤡ ᤑᤠᤰᤋᤢ॥
  snx-snx: Adu Girik xanggli. Siria kantri xo Ponisia sob maglib nenx nyam pidelxo.
    Adu Yesus mundor hali ido asibi maglib xendeiyax xasi gwarisi inar silxo.
  kql-kql: Katɨk melɨn yetɨk wutakɨwɨ. Wokok goŋguaŋmali fulakɨn Gris galavale lomɨle,
    kape wokok wunu kaweve watɨkɨn Sairofonisia galavale distrikɨle. Wun Jisasɨtɨk
    yiŋɨmevekandi galambalambaneve Jisasɨlɨn wokok alep dundumɨiyeve sulak yakakatɨk
    sañjaŋmaŋga.
  mie-NT: De ñahan incā nación cúu ña, chi Sirofenicia cúu nación ña. De nī ncāhān
    ndāhví ña jíín yā jā ná távā yā tāchī inī sēhe síhí ña.
  san-TIB: སྭཀནྱཱཏོ བྷཱུཏཾ ནིརཱཀརྟྟཱཾ ཏསྨིན྄ ཝིནཡཾ ཀྲྀཏཝཏཱི།
  qve-NT: Chay warmiqa manan Israel nacionniyoqchu karan. Payqa Fenicia llaqtamantan
    karan. Chay llaqtaqa Siria provinciamanmi perteneceran. Paymi Jesusta ruegakuran
    ususinmanta demoniota qarqonanpaq.
  pao-NT: '@see-verse:MRK.007.025'
  cbu-NT: '@see-verse:MRK.007.025'
  usa-usa: 'min-íníkómá íma naaóq-inimibo wemá Pinítia Tírîabake iréna mibáqá wenanóama
    marákáraitana mibáké iréna Îtuqtabama egaa aráiye: “ketiyáámûkoni arupiké kuti-áágómá
    waqtuwaao!” titana Îtuma tiráiye:'
  soy-soy: Unɔ́si uyɛɛ usɑ́nɛ lɛ, úu *Usuifi. Sirii kɛteni-i kɑpi u mɑri. U Fenisii
    ukɔ́ lɛ. Uú nɛ Yeesu téni rɛ ukɛ́ uukpére kuníri lɑkɑsɛ.
  bkx-bkx: '@see-verse:MRK.007.025'
  hui-hui: Wali ogoni ibu Yu wali ndo Siria dindiha ibu dalu Penisia dindini berene.
    Ibugua Yasuhondo lalu, Dama i̱ waneha daraga kago pelo wara tagi habelo hamelo
    ko, lene.
  amf-amf: Edonsa apono Girik apone, adhadhinoar kosa Siropiniqa muldharane. Naan
    konnondara beeronam kinin buloadettsi kiam ko miskade.
  quc-NNT: Ri ixoq ri' man are tä aj Israel, xane ilom u wäch pa Fenicia, ch'äqäp
    re ri Siria. Xub'ochi'j ri Jesús, xuta' toq'ob' che chi käresaj b'i ri itzel espíritu
    che ri ral ali.
  dob-dob: '@see-verse:MRK.007.025'
  wrs-wrs: '@see-verse:MRK.007.025'
  mca-mca: Ke' efu nite' judioki', qe sirofeniciaki'ƚe, qa qi in iyinijetskii ha'
    Jesús qu' nukinik'uifik'i pa' inwo'met in i'nji' pe' ƚasi'.
  tzo-TZC: Pero ti antse, jaꞌ jun jyanlum, liquem tal ta Sirofenicia banomil. Tal
    scꞌanbe vocol ti acꞌo loqꞌuesbatuc ti pucuj ti oy ta stojol ti stsebe.
  mya-mya: သူ​သည်​ရှု​ရိ​ဖိ​နိတ်​ပြည်​သူ​ဂ​ရိ​အ​မျိုး​သ​မီး ဖြစ်​၏။ မိ​မိ​၏​သ​မီး​ထံ​မှ​နတ်​မိစ္ဆာ​ကို​နှင်​ထုတ်
    တော်​မူ​ရန်​ကိုယ်​တော်​အား​တောင်း​ပန်​၏။-
  gng-NT: Upii nnɔ ŋa yé Suf, bi maa' wɔ Siri ya tinfɛnm ya kɛle wà bi wù Fenisi
    nnɔ ni nɛ. U gbáan' *Yesu ki ye wɔ ń ŋɔre usɛnpol wà ŋaake uʼbisɛ nnɔ.
  cbi-NTPO: Tsaaren juntsa shinbu judío chachi jutyumi, ura pañuya, Sirofenicia cha'
    bulu paande shinbumi. Tsejtu juntsa shinbu Jesúsnu u'tandita ji', tsantsaya ya'
    na'manu dyabulu pumu me-e'laade, timi.
  ikk-NT: Okpoho ahụn wụ onyẹ alị ọzọ, ẹlẹ onyẹ Ju; ndị Finishịa mụ a, Siria wụ alị
    wẹ. Ọ nọ rịọ Jesu n'ọ chụpụ eje-mmọn hụ rị imẹ nwa a.
  leu-leu: E a tefin aave a pife Juda, a fufubina sina pe Fonisia pe Siria. E nane
    xo taxa lo fin na Yesus pana vil faroxoiaana lak tefin sina.
  maz-NT: C'e ndixũ je mi menzumü a Fenicia c'ü tsja a Siria. Dya mi menzumü cja c'o
    mi Israel. C'e ndixũ o dyötü e Jesús ro pjongü c'e demonio cja c'ü nu ts'ixunt'i.
  bod-N: བུད་མེད་དེ་ནི་ཕྱི་ཕྱོགས་པ་ཡིན༌ཅིང༌། སིར་ཡཱ་ཡུལ་གྱི་ཕོའོ་ནེ་ཀེ་མི་རིགས་ལ་གཏོགས་པ༌དང༌།
    ཁོ་མོས་སྐྱབས་མགོན་ཡེ་ཤུ་ལ་གདོན་འདྲེ་དེ་ཁོ་མོའི་བུ་མོ་ལས་ཕར་སྐྲོད་པའི་ཕྱིར་ཞུ་བ་ཞུས་པ༌ན།
  tca-NT: Rü yema nge rü to ga nachiü̃ãnecü̱̃ã̱x ga Chiropeníchiucü̱̃ã̱x iyixĩ. Rü
    Ngechuchucèx iyaxũ, rü nüxü̃ icèèxü̃ na ngĩxãcüwa ínatèxüchiãxü̃cèx ga yema ngoxo.
  zpl-NT: La neca unaꞌa quie bene Israel, necanchu bene Sirofenicia. nu uziquienchu
    lu Jesuse para nú huanu benechiquiꞌ arquiꞌ xinchiuꞌcunchu.
  mbc-NT: '@see-verse:MRK.007.025'
  ndg-ndg: Nwawa ayo ai Myunani, likabila la Kifoeniki kun'yopa ni kumpembela ambenge
    nsela ai kumutwe ya kaenza kake.
  wsk-wsk: Imet sumu Greek imet, bare Syria Phoenicia sor te bilangaram. Nu bur memek
    ko nanawus kumik ningi wore Jesus karukko ilak wosengakaso.
  toj-NT: Ti och sc'an yi jitzan pavor ba oj sc'ul mandar ja pucuji ba oj actajuc
    can ja yali. Sirofeñera ja yeni. Griego huax c'umani.
  dwy-dwy: '@see-verse:MRK.007.025'
  kkl-kkl: Yesus sekamogpa, yanag malingkiogti, Yesusag mololamogti, “Namangkelag
    phia yonge wamlaba, yamendi, yaglambalulam,” aro wanaag agha sarikto-sarikto molbaog.
    Molbaog aghana, keleneko nimi sisa Yahudi kel kom. Mog so'o Siria as nhon Penisia
    peram wamogneag agha mangkaek kel wamogpog, Yesus whingag mololaog.
  tbc-tbc: Pein en man Grik, agod distrik tubun ate imado dan Siria provins, agod
    titin ta dugon te tinan igansi an aben ta loŋ siŋiren na yaŋan Fonesia dubol da.
    Aria, Jesus naon na turun isoluwig, Jesus iŋ nanun pein tinin lo ur saiak ikudip
    yau wo ilo muŋanek ru lo isumiani a.
  sna-sna: Mukadzi uyu aiva muGiriki, akaberekerwa muFonishia yomuSiria. Akakumbirisa
    Jesu kuti adzinge dhimoni mumwanasikana wake.
  smk-NT: tan nikidawat yan inganga'do a palakwanen nayay ispiriton duka' konan anak
    na. Bale' siti nin babayi, ambo' yan Judio ta niyanak yadtaw sa lugar nin mangaran
    Sirofenicia.
  grc-TCGNT: ἦν δὲ ἡ γυνὴ Ἑλληνίς, Συραφοινίκισσα τῷ γένει· καὶ ἠρώτα αὐτὸν ἵνα τὸ
    δαιμόνιον ἐκβάλῃ ἐκ τῆς θυγατρὸς αὐτῆς.
  mzz-mzz: '@see-verse:MRK.007.025'
  gof-WFTW: Iya Ayhude maccasi gidukku; iya yelettiday Siroofinqe giya biittana. Iya,
    ba na7eeppe tuna ayyaanaa kessana mela Yesuusa woossasu.
  spa-BLM: La mujer era griega, de raza sirofenicia. Le rogó que expulsara el demonio
    de su hija.
  kyz-NT: 'Najudeu arũi agawewi ẽẽ. Sirufenisi pewara ẽẽ te. Poromũ ''ut oporogytau
    Jejui ''ga upe: —Mama''eukwaawa epe''a jera''yra kyna wi, a''e je tejua enee—
    ''jau ẽẽ ''ga upe.'
  dao-dao: Acuna nghnumi cun Krik nghnumi, Siria khaw Phoinikia hnea hmikia khyanga
    kyaki. Ani naw a canu üngka khawyai Jesuh naw a ksät vaia a nghuinak.
  cya-cya: Lca ne' sca ne' griego nu ncua tyi Sirofenicia, mjñan ne' cha' tsu'hue
    'in ñi si'yana culo ñi cui'in xa'an nu ntsu'hui 'in sñe' ne'.
  beu-beu: '@see-verse:MRK.007.025'
  wrk-wrk: '@see-verse:MRK.007.025'
  nii-nii: Pe amb ei wumb tiłap eipi kin eim Piniisiya konu ełe wumb kin Siriya konu
    ełe mułum. Mułum kin, amb ei Jiisas kin dinga kii sim, “Na ambilan gui kis mołum
    ei, nim kil ngo tor kindii!” pa yi nim.
  ign-NT: Títeca­vanepa esu, suépuyu­mi­rauchapa te mamirahu ema Jesús. Tiyaseu­chavapa
    mayehe ema Jesús eta máimiju­ni­ji­cahini ema éreana suyehe esu suchicha.
  dik-NT: Tiŋ kënë ë ye jam thoŋ Gïrïk, ku ee nyan pan Ponicia. Go bɛ̈n ku lɛ̈ŋ Jethu
    ëlä, “Bɛ̈ny, cɔk a lɔn cï ɣɛn ye tiŋ pandun ke yï bɔ̈ ba jɔŋrac cuɔp wei nyaandiɛ̈
    guɔ̈p.”
  cac-cac: A jun ix chi', griega ix, aj Sirofenicia ix. Ix tevi ix d'a Jesús, yic
    syiq'uel jun enemigo chi' d'a ix yune' ix chi'.
  tzj-E: '@see-verse:MRK.007.025'
  san-BUR: သွကနျာတော ဘူတံ နိရာကရ္တ္တာံ တသ္မိန် ဝိနယံ ကၖတဝတီ၊
  yaa-NT: 'Nã kẽro xoko fetsa Sirofenicia mai anoa ini. Nãskakẽ Jesús ano kani. Kaxõ
    yoikai iskafakĩ: “Ẽfe fake xotofake makinoa niafaka yõshi chaka potaxõfe,” fani.'
  cab-NT: Wǘri tugúya, máma juríu, Síro-Feniciána. Ába tamúriajan lúma Jesúsu lun
    laságaruni espíritu wuríbati le tueí tiraǘ.
  clu-clu: '@see-verse:MRK.007.025'
  swh-ULB: Mwanamke huyo alikuwa Myunani, wa kabila la Kifoeniki. Alimsihi yeye amfukuze
    pepo kutoka kwa binti yake.
  tpt-NT: Ni xanati jantu israelita kaval, va ixchiviniy lhigriego, tsukuchal xalakatꞌun
    Sirofenicia. Yucha tapayninil ni Jesús ni kamaxtunil yu jantu ox espíritu ni istsiꞌi.
  aai-aai: Babin i Greek matuwan, baise ana tufuw an i Fonisia imaim tufuw tafaram
    Syria wanawanan, i Jesu ifefeyan natun biyanamaim afiy kakafin tanun tatit isan.
  sny-sny: Menitani ape lu tewi tere'e ma'e fai. Nihari lo tere'e iyape Saria Fonisia.
    Menitani ape Juda lo yo peri umasi ta'ame. Sosu menitani ape Jisas ma'e apou ei
    toweriye, “Ne sepei luwaru a'i ape eime taune ano, marepi hepene papu irosiya
    ape, au ta'ane sasarisawire!”
  myy-myy: 'Judio masagõ meje ñayijo iso. Sirofenicia gago ñayijo iso. Jesús tʉ ejacõri
    ĩre josayijo: “Yʉ maco iso ya ʉsijʉ rʉ̃mʉ́ sãñagõ ñamo. Ito bajiri iso ya ʉsijʉ
    rʉ̃mʉ́ sãñagʉ̃re bucõaña mʉ”, yiyijo iso Jesure.'
  trc-NT: Dan me se chana̱ sirofenicia aꞌmii xnaꞌánj griego me chana̱ yoꞌ, ne̱ cachíín
    niꞌya̱j noꞌ rihaan Jesucristó se vaa quiri̱i̱ Jesucristó nana̱ chre̱e nimán taꞌníí
    noꞌ a.
  cut-NT: Ta̱hn min ne, ndiyu ta̱hn nación yahn Israel, te ta̱hn ta̱ma nación. A min
    Sirofenicia ya̱n va̱co te. Chica te Dihvo vo che ndetenda̱h ye vaco chihnga̱ che
    quenun ta̱hn dihn yahn te.
  bel-bel: а жанчына тая была язычніца, родам Сірафінікіянка; і прасіла Яго, каб выгнаў
    дэмана зь ейнай дачкі.
  zlm-KSZI: Wanita itu seorang Yunani, dia berasal dari daerah Fenisia di Siria. Dia
    memohon Isa menghalau roh iblis yang merasuk anaknya.
  gdr-gdr: Ajɨ ɨtomb kongga re Grik yɨtam na, ɨ Siropoinikisa kongga na. Sɨ ton ma
    Ju kongga na. Ɨ ket ton Yesund yɨtenawonj negɨr wɨngawɨnga eaukenam tina ngɨmngai
    b'ɨgam pɨlke.
  vmy-NT: ꞌBa chjunbiu bi tseꞌe Israel, nangi xi Sirofenicia ꞌmi kitsin. ꞌBa ꞌetsꞌare
    Jesús nga ngatoꞌoxjejinre isennixtjin xi bi nda kiꞌndire.
  cmn-FEB: 这女人是希腊人，生于叙利斐尼基。他求耶稣把鬼从她女儿身上赶出去。
  gmv-RNT: Macasaya Ayhuda gidonta Girike qaala haasayiza macasashin iza yelettidasoy
    Sirofinqe geetettes. Izakka Yesusi naype tuna ayana kessana mala woossadus.
  ncl-NT: Cataya ilali in sihual in lali Sirofenicia huan lajtuaya griego. Quitemachiaya
    Jesús pa quiquixtilis in ijyecal imuachita.
  wed-wed: '@see-verse:MRK.007.025'
  sua-sua: '@see-verse:MRK.007.025'
  klt-klt: Náráwa wawu ále Fonisia Siria káwak káin tunggafiuk, iná málám wawu hun
    Juda waháranan muná. Watá áwáng iruk wáik ká uriwa ep táená wa isurátá kuik ingga
    Jesu kiling muk.
  are-are: Arrkutja nhanha era Greece-arinya naka, pmara Phoenicia-ala alkngerrakala.
    Phoenicia erataka pmara Syria-ala naka. Arrkutja erantama Jesuurna ingkaka era
    enka korna erinha kwarra ekuranhanga unputjika.
  gai-gai: An meaca mana aemma manmo Ponisiana pitrik waŋa tɨkca mɨrrinan, na Ponisia
    ma Siriana pitrik waŋnan. Na an meaca ma Girikna kam mbuŋ ndoprena, na ma Iesusmo
    ndona mooŋna ŋeroŋ ŋgoreaca moi kecarina moca aemaŋmaŋap madigiat.
  qvm-NT: '@see-verse:MRK.007.025'
  chz-NTPS: Dsaˉmëꜘ heꜘ saꜙ maˊ la̱a̱yˈ judiu, dsaˉ sirofenicia baˊ heꜘ. (Kihꜗ dsaˉ
    judiu, läꜙko̱hꜘ dsaˉ heꜘ la̱a̱yꜗ läꜙko̱o̱ˉ saˊdsɨɨˉ baˊ.) Gaꜙchu̱u̱yꜘ kya̱a̱hˊ
    Jesús heˉ dsaˉlle̱e̱yꜙ jmɨˉlleꜘ hlɨɨhˈ hi̱ˉ maˊ hä̱ä̱ˊ nehꜙ tuhˉdsëꜗ jo̱ˉmɨɨyꜚ.
  kmu-kmu: Isaleli vea omainea alagino Kaliki ke nehuno Fonisia nofi ale. Silia kotega
    alagino munaꞋamona agupi mainea Kefo Avamu* anatitalesie huno aukaꞋya huno havige.
  ood-NT: '@see-verse:MRK.007.025'
  lbm-lbm: या बाई गैरयहूदी होती या सिरीया को फिनीकी म पैदा भयी होती। ओन यीशु सी बिनती
    करी कि मोरी बेटी म सी दुष्ट आत्मा ख निकाल दे।
  ncj-NT: Inon sihuatl den tlali Sirofenicia huan ahmo temasehualicniu in Jesús. Huan
    otetlatlautic maquiquixtililo in ahmo cuali yehyecatl tlen oquipiyaya in ichpocau.
  yuj-yuj: '@see-verse:MRK.007.025'
  kto-kto: 'Uriro magabun la tale kan urie a gar Iudaia. Karuk. Urie, a gar Finisia
    onim na provins Siria. Ga marikieng me ai Iesu ga igama: “Non muranam ila kire
    la ut na poi rung ula magabun. Toaganalie ga akalanang iriro muranama ila kire.”'
  gmv-NT: ማጫሳያ ኣይሁዳ ጊዶንታ ጊሪኬ ቃላ ሃሳዪዛ ማጫሳሺን ኢዛ ዬሌቲዳሶይ ሲሮፊንቄ ጌቴቴስ። ኢዛካ ዬሱሲ ናይፔ ቱና ኣያና
    ኬሳና ማላ ዎሳዱስ።
  por-BLT: A mulher era grega, de nacionalidade siro-fenícia. Ela implorou para que
    Jesus expulsasse da sua filha o demônio.
  stp-NT: Guiꞌ gu ubii cham tuꞌr Israel kam kaꞌ, pur miꞌ kam kaꞌ Peniisia, na Siiria
    bhaan bipioꞌ guiꞌ gu dɨbɨɨr. Baꞌ soiꞌ xi chɨtda, jup tɨtda na sap iam maiꞌ jootsaꞌ
    gu cham kɨɨꞌ iiꞌmdaꞌ bhaiꞌ dhɨr bhaan gu tɨɨyax.
  mgc-mgc: Mbara ne ame'do ha Gïrïgï, o'jo mo mï Siriya-Ponisiya. Mo alenze Yësu zi
    dakyikyi kore mo yaga ta ra wu'jë ënï.
  ame-NT: 'Ñeñt̃ña coyanesharpaʼ ama judioneshayaye, ñapaʼ poʼpoñ acheñ ñeñt̃ sirofenicioʼmarneshaʼ.
    All rromosa Jesús paʼrrp̃ot̃paʼ atet̃ otos: —Nepapare, pequec̈hpatatayeʼchapon
    nechoyor oneñet̃.'
  mgh-2016: Yayo khayaari Ayahudi, nansho aari o nikosho no Ayunani o ilhapo yo Usiriya.
    Nkayanlhepelha Yesu oomolhe nshoka no unanara nammara mwannati aya uyo.
  kvn-NT: Tenal we omedin Judio-tulejul; tule-pid, Sirofenicia-tol. Tenal we ome Jesúsgin
    wilenaigual, ega chiskwagin-nia-maid-onogal.
  gvf-gvf: Abal i Sairopinisia ibal kule nongwa milere, Giriki ka kowa pirungwa. Abalini
    kawan dire iru dungwa, “Na abilan sia den miriin suna milungwa maa si mena ere
    na to.”
  san-ISO: svakanyātō bhūtaṁ nirākarttāṁ tasmin vinayaṁ kr̥tavatī|
  deu-ELBBK: Die Frau aber war eine Griechin, eine Syro-Phönizierin von Geburt; und
    sie bat ihn, dass er den Dämon von ihrer Tochter austreibe.
  mcb-NT: '@see-verse:MRK.007.025'
  yle-yle: Yi pyópu daa Nju pyââ, Taiya wee u kwo pyââ. Yesu ka kwo, Mw꞉ââkó a Lémi.
    Kwo, A tp꞉ee módó ngê kmêna ngmêka kwo. Kwo, U ntââ wanyi ngm꞉ii kwolo.
  swh-1850: Mama huyo alikuwa Mgiriki, mwenyeji wa Sirofoinike. Basi, akamwomba Yesu
    amtoe binti yake pepo mchafu.
  ese-NT: '@see-verse:MRK.007.025'
  jac-NT: Huneꞌ ix ix tuꞌ mach Israelo ix, wal xin yul ismajul txꞌotxꞌ sirofenicia
    ay ix. Iskꞌanni ix tet Comam ta chílo Comam ischejab naj matzwalil ayco yin̈ nichꞌan
    yunin ix.
  cak-CNT: Ri jun ixok ri' man israelita ta c'a. Rija' jun sirofenicia. Pero xoxuque'
    chuvech ri Jesús richin xoruc'utuj utzil chire chi trelesaj ri itzel espíritu
    ri c'o riq'uin ri ral.
  zia-zia: Arata bauno awiya nung Yuda oko. Tawing nuna yazo Sirofonisia. Arare nung
    Yesu eno isa sero nung mani nuna-una iwae tunaise senu
  mal-2015: അവൾ സുറൊഫൊയ്നീക്യ ജാതിയിലുള്ള ഒരു യവനസ്ത്രീ ആയിരുന്നു; തന്റെ മകളിൽ നിന്നു
    ഭൂതത്തെ പുറത്താക്കുവാൻ അവൾ അവനോടു അപേക്ഷിച്ചു.
  tuo-NT: Co ape macãcjõ Sirofeniciacjõ nico niwõ. Beꞌro Jesú tiropʉ eta, wãtĩ co
    macõpʉre nigʉ̃rẽ cõꞌawĩrõdutico niwõ.
  mbl-NT: Yã 'ũn puknõg, yã hãpxexka Xitpenĩy yõg, tu Yeyox tu' xak, puyĩy yãmĩy kummuk
    xut 'ũk-tok hex kopah.
  zpc-NT: Naꞌra lënigula naꞌ binaquëꞌ benꞌ Israel, naquëꞌ benꞌ Sirofenicia. Bidëꞌ
    unabëꞌ chi biyebio Jesús bichi be mala yuꞌu z̃iꞌinëꞌ.
  gul-NT: De ooman ain been a Jew. E been bon een Phoenicia een Syria country. E beg
    Jedus fa dribe de ebil sperit outta e daughta.
  mau-NT: Je² chjon⁴²-ve⁴ tsˀe⁴ cho⁴ta⁴ griega to⁴nca³ Sirofenicia na³nqui³-le⁴. Je²
    chjon⁴²-ve⁴ tsa³cˀe¹tsˀoa³-le⁴ Jesús nca³ cˀoa⁴sje³xin²-le⁴ tso²ti³-le⁴ je² nai⁴²
    xi³ nta³jin³.
  gup-gup: Kaluk ngalmekbe daluk minj ngalka Jewniwirrinj. Ngalka wanjh Greekni, danginj
    kore Phoenicia, kore kubolkkimuk Syria. Wanjh bimarrkdjawam Jesus bu kawe namekbe
    namarnde nawu bihbongkarrmi ngalyaw ngaleng ngarre.
  bss-NT: Ane mmwaád abédɛ́ɛ mmwaád a aloŋ á Grikia awě béchyáá á pɛd e mbwɔ́g
    e Siria echě béchə́gɛɛ́ bán Fonisia. Hɛ́ɛ ácháaʼɛ́ Yesuɛ aá ábíded mwǎn
    échê edəə́dəŋ é mbéb áte.
  met-met: Haingga baguba, xuanoa Grik, ne yabang sibuna Siroponisia, Yuda tela te.
    Xusunga Yesu haringina ba suka xaunga mala sangua nanuhanginoa.
  kpj-NT: Kia heka hãwyy Grego mahãdu rare. Ilahinanire heka Siru Senisia. Tii Jesuisi‑ò
    rỹỹraxire tyytybybina iriòre‑ribi deòdỹỹmy.
  zao-NT: Lee ngota nak thib zha tith zha yez Sirofenicia, ne mnaab ngota lo Jesús,
    tsa koo Jesús mbi fyer kuu nzo leettsoo rtsaap ngot.
  byx-byx: '@see-verse:MRK.007.025'
  ctu-CTI: Ch'oyol ti yambʌ pañimil Sirofenicia bʌ i c'aba'. Ti tyʌli i c'ajtiben
    Jesús cha'an i choc loq'uel jini xiba' am bʌ ti' pusic'al yalobil.
  zos-NT: Yøṉ yomo emøcpø yomote, griego ote chambapø'is, y raza tiyøjquete Sirofenicia.
    Yøṉ yomo'is vya'c Jesuscøsi va'cø yac tzu'ṉay yatzi'ajcuy 'yune'is choco'yomo.
    (Pero como yomo eyapø cumgu'yombø y Israel pø'nis tyuyicotzøcyajpana'ṉ eyapø
    cumgupyøṉ),
  gvs-gvs: Ego vavinayana Totuyoyowo tayamo, tauyana Poinike vavinaina. E ima ikawanoi
    Yeisu yaina idigo kana, ‘Dimoni tayamo natugu ikiinagove go, akawanoi yaim bego
    dimoniyana kuvatapiye isiya.’
  kbm-kbm: Be avie nok ei Juda ti ite, ei nangge Finisia gideb Siria ane. Ei giutani
    Yisu ve ginei nitin ngalau tiate nikwai ei natu avie.
  tew-tew: '@see-verse:MRK.007.025'
  rmc-rmc: Odi džuvľi sas Grekiňa andral e phuv Fenicija andre Sirija. Mangelas les,
    hoj te tradel avri le demonos andral lakri čhajori.
  apr-apr: '@see-verse:MRK.007.025'
  tiy-tiy: Atin nongotén dob Jesuse bé féféraréyé noy saitane tidéw dob kénogo nuwe
    ni. Endob i ni libun, békén Judio. Yamula, tidéw dob ségiyowe ingéd féndawét Fenisia
    dob Siro.
  nlg-nlg: Na vinekama keri te mua Jew. Agaia tara vahua tana buto ni komu i Phoenicia,
    i lokana na bubulo i Syria. Agaia te kurutia Jesus, ge ke ghuruhorua na tidalo
    dika i lokana na dalena.
  dgr-DOGNT: Eyı ts'èko sìı Greece got'ı̨į̀ hǫt'e, kǫ̀ta Syrıan-Phoenıcıa ekǫ dǫ elı̨
    hǫt'e. Zezì ghǫnàdaetì, hadı, “Sets'ǫ̀ K'àowo, setì ı̨nìłı̨ı̨ wets'ǫ̀-èlı̨ı̨ sìı
    xàdı̨ı̨zhı,” yèhdı.
  pes-OPV: و او زن یونانی از اهل فینیقیه صوریه بود. پس از وی استدعا نمود که دیو را
    ازدخترش بیرون کند.
  ron-1924: Фемея ачаста ера о грекоайкэ, де обыршие сиро-феничианэ. Еа Ыл руга сэ
    скоатэ пе дракул дин фийка ей.
  tpz-tpz: E köövo pamëh to hikta teꞌ non pan e köövo va Israël. E sinaneah to vahuh
    voh poan manih pa siꞌ ö muhin va Fonisiaꞌ, a siꞌ ö muhin pamëh to teꞌ non koman
    a muhin va Siriaꞌ. Eꞌ to hin vakis rakah en pan e Ieesuꞌ se veo tavus këh e semoneah
    pa oraꞌ hat pamëh.
  agd-agd: Siriá barafin Fonisiá kaein Kiriki váken béi Yisasin nan be araun aufin
    ma namu aunan bain do siantano van tiamen mino.
  rkb-NT: 'Atatsa Sudeubyitatsa tu Kereko harere nitsasoko. Siropenisia ezektatsa
    niy. Iwaze atatsa hi Sesus pe niy: — O hyrikoso sapybara ty kaste bo pororo mynakara
    tsiksiwyhik ky! Nabo pãoty tsimy — niy.'
  san-THA: สฺวกนฺยาโต ภูตํ นิรากรฺตฺตำ ตสฺมินฺ วินยํ กฺฤตวตีฯ
  iws-iws: Saeya ta wiga nu whɨranka saeya Juda wig rani. Saeya nu sɨm Finisia nu
    komii Siria hɨr nwowɨn mɨ siir hɨranka. Mɨ ta wiga saeya Jisɨs siirɨm srɨinanae
    saiir yɨnisɨm yɨnugiyɨna saiir nwowɨn yɨu biyɨeyɨn siir haiswonɨskigiyam.
  pol-SZ: i błagała, aby uwolnił jej dziecko od demona. Była to Syrofenicjanka, a
    więc należała do pogan, których Żydzi mają w pogardzie.
  ztq-NT: Meñ Sirofenicia nak me, xñee me tiits griego. Lëë me kwey lo Jesús aan lëë
    me kwnab nii kwii xaa kyalbini mal leñ styoo xiñtsyaap me.
  zai-NT: Binni Fenicia gunaa que, cadi judíu laa. Gunaba laabe cuee be binidxaba
    que de xiiñi'.
  upv-upv: Vinnen evi nesevin ne vare san, ko eak renge Ponisia, ngaim nga welili
    ne Siria san. Ko ongoni tevi Iesu nga puoji tweni nem̃in nga m̃isij nen nga m̃isisilvi
    natun nen, pivare lingi.
  aui-aui: '@see-verse:MRK.007.025'
  wap-NT: Wuruꞌu zunaz, Gentile oroo, oshakatan Phoenicia Baara ii Syria iaꞌoraz.
    Tuukiaꞌo idaꞌan opishaan Jesus, oaipan ukodita-kidan oiaꞌo doronai paudani sodi
    zun ai.
  mva-mva: Aine nge Grik kata, be Pinisia anua-lo ka nekiaka ipura. Pinisia nge Siria
    kaba-lo ka ieno. Aine ngae ipura be Iesus iakoroi be mariaba goalaka natu aineka
    ilona-lo isoaki nge ngataoni kana.
  dwr-NT: He mishiratta Ayihuda asa gidukku; A yeletteeddawekka Sooriyaa giyaa gadiyaana;
    A bare naattippe xalahiyaa kessana mala, Yesuusa woossaaddu.
  kfw-kfw: Numeisanu kha Phoenicia Syria ramma innei Zaatlop inkhat alei eii, ama'n
    asanu diang kaom raikhuo kha puutsuok nasik-ah Jisu diang aleiti.
  bfz-bfz: ये यूनानी और सूरूफिनीकी जातिया री थी, तेसे यीशुए ते बिनती कित्ती, “मेरी
    मुन्निया ते दुष्टात्मा निकयाल़ी दे।”
  cuk-09: 'A-omede Judio-dulesulid, Sirofeniciaginedid. A-ome Jesúsgi wilenagusad,
    ega sognagusad: “Nia-an-bunologi-maid anga wis be onoged saye.”'
  ben-OBCV: সেই নারী ছিল জাতিতে গ্রিক, তার জন্ম সাইরো-ফিনিশিয়া অঞ্চলে। সে তার মেয়ের
    ভিতর থেকে ভূত বের করার জন্য যীশুর কাছে মিনতি করল।
  mil-NT: Te ní ngüíta‑aⁿ càháⁿ ndàhú‑aⁿ núú‑gǎ, te xǎhaⁿ‑aⁿ sǎ nǔu vá cúndèe iní‑gá
    queñuhu‑gá espíritú cúndɨ̀hɨ yucu ñávǎha yɨ̀hɨ ñaha xii déhe‑aⁿ. Dico ñá dɨ́ú
    ñàha israél cúú‑áⁿ chi ñaha ñuú Sirofèniciá cúú‑áⁿ te tnúhu grìégú cúú tnǔhu‑aⁿ.
  myu-myu: Grego a'õm kawẽnwẽn'ukat osunuy ayacat. Judeu g̃u osunuy. Sirofenícia eipi
    bewiat osunuy. — O'it axik kug̃ — io'e. — Eg̃ujẽm cuy cebewi — io'e Jesus pe.
  amk-amk: Wiwingfoi mani, wiwing Yunani dine na nu Siro-Fenisia foi. I dutang Yesusi
    paria we data nuaninu kerira foi weru ne arikangfoi.
  fai-fai: Wanang uka Gadík wanang Saidin bakan Filisiya abiw kal kusiwo. Kale uka
    Yesus mun dawtadelaw bom nadule bako, “yak nam mun sinik mafak gei kusa uyo takan
    keimalo!” Ak buduno,
  ura-NT: Nii ene jetaote, Jorio niheichuru Sirofenicia batane cocoaichacuru bene
    ne. Aca jetaote, Jesoso rene turuhin conujue cacunu suujua cuhane nenaa moconajaera
    letono coitucuchuhi sitaane coina.
  mcd-NT: '@see-verse:MRK.007.025'
  urt-urt: Tuwei uku ti Fonisia nal distrik Siria. Ti wate wisilihme Jisas nange ka
    el ginyenme yipihinge pupwa upwaihme lahtuwei ti.
  kiz-kiz: N'dala ojhu ajhele Myunani, ghwa kabila lya kifoeniki. An'sokili muene
    abhosiajhi pepo kuh'omela kwa mwali munu.
  tzo-TZE: Li antse ma'uc jchi'ilcutic ta israelal, ja' tey liquem tal ta Sirofenícia
    banamil. Ac'o me mu ono'ox lecuc chquilcutic li boch'otic muc ja'uc jchi'ilcutic
    ta israelale, pero li antse scotol yo'nton la sc'anbe Jesús ti ac'o loq'uesbatuc
    li pucuj ochem ta yo'nton stsebe.
  lex-lex: 'Patke'' de Yahudi atia''a, mak kwatiawua Fenisia yapatni la''a Siria.
    Nwak la Yesus niwra: “Tungkurg ee, Mtiulan pa Mhuokar doini hegan mak khu''ru
    ralma a a''nu.”'
  dov-dov: Mwanakazi oyu wakali wamusyobo waba Gilikki wakazyalilwa kuSiliya Fonisiya.
    Wakakumbila Jesu kuti atande muuya mubi uzwe mumwana wakwe.
  rgu-rgu: '@see-verse:MRK.007.025'
  toc-NT: '@see-verse:MRK.007.025'
  ulk-1902: Abele kosker Heleni kosker, Surofoiniki osmeda. E Iesui damos ko demoni
    imuda abara neurlam.
  som-som: Naagtii waxay ahayd Gariig, qolo ahaanna Surofoynike. Oo waxay ka bariday
    inuu jinniga gabadheeda ka saaro.
  anh-anh: '@see-verse:MRK.007.025'
  mam-C: '@see-verse:MRK.007.025'
  ndj-ndj: Mdadala ayu aveli mugiliki na awonikili mumbwani ya Silofoiniki. Kamluva
    Yesu amuwushi chinyamkela muhinja waki.
  mbj-NT: '@see-verse:MRK.007.025'
  lat-VUC: Erat enim mulier gentilis, Syrophœnissa genere. Et rogabat eum ut dæmonium
    ejiceret de filia ejus.
  ngp-ngp: Mvele yudya andaga Mgiliki, elekwe mwo mzi wa Silofoinike mwe isi ya Siliya.
    Niyo amwiila Yesu amlave mwanawe zimp'hepo.
  enq-2: (Enda doko baa Giriki pii lenge, Siropinisia tange mende.) Baanya wanenge
    doko-kisa imambu koo palenge doko Jisasame watao pyakamaina lao tee lea.
  eng-ASVBT: Now the woman was a Greek, a Syrophoenician by race. And she besought
    him that he would cast forth the demon out of her daughter.
  mna-mna: '@see-verse:MRK.007.025'
  myw-myw: '@see-verse:MRK.007.025'
  sby-sby: Mutukashi uyu walikuba mu Giliki walasemenwa mu cibela ca Siliya calikukwiweti
    Foinike. Neco walamusenga Yesu tunkanda twingi kwambeti apulishe mushimu mu mwanendi
    mutukashi.
  sll-sll: Al i Pinisia al kul nongwo ha howa al momia, Griki ha dungwi. Ena al iwe,
    aung kwia nigi dongwo yong sina momia, Yisas mongwo bani urere, ya habilai sirere,
    yu ditongwi, “Na auna kwia nigi dongwo yong sina mongure, wiya, ni si doling i
    mena olanba?”
  yaq-NT: Juna'a intok, rieka jamuttukan. Intok senu bwiarapo, Siro peniisa' tea'po
    jometukan. Juna'a jamut intok, tu'isi Jesujtau ujbwana, juka' bebeje'eri ka tu'i
    jiapsi e'erita a' jamut'asoawatat, a' jiapsipo wajiwa aet anemta, pa'akun yeu
    a' bepria i'akai.
  uro-uro: Dä sa qia män bä qit nok pät ma Jisas iva qä qutmäs ama iauska nämät at
    tuimgi inguna iaqyäkt ama ruqi di ama Jentailqi qärakt i qi nae näva ama ngärhäktka
    ma Fonisia qärak i qale qa va ama ngärhäktka ma Siria aa muräkt.
  ita-1885: (or quella donna era Greca, Sirofenice di nazione); e lo pregava che cacciasse
    il demonio fuor della sua figliuola.
  muy-muy: '@see-verse:MRK.007.025'
  kqc-kqc: Ina bi Greek rema, Phoenicia gagani Syria ri vata niyo. Iesu niguba regamo
    mina vima no ini mida rofu meki reyainedi.
  tav-tav: '@see-verse:MRK.007.025'
  eng-ULB: Now the woman was a Greek, a Syrophoenician by descent. She begged him
    to cast out the demon from her daughter.
  spa-VBL: La mujer era griega, nacida en Sirofenicia. Ella le rogó a Jesús que sacara
    ese demonio de su hija.
  fra-_FOB: Cette femme était Grecque, et Syrophénicienne de nation; et elle le pria
    de chasser le démon hors de sa fille.
  hau-ULB: Matar yar kasar Girka ce, kuma asalinta daga Fonishiya take. Ta roke shi
    da ya fitar da mugun ruhun nan daga diyarta.
  mal-mal: അവൾ സുറൊഫൊയ്നീക്യ ജാതിയിലുള്ള ഒരു യവനസ്ത്രീ ആയിരുന്നു; തന്റെ മകളിൽ നിന്നു
    ഭൂതത്തെ പുറത്താക്കുവാൻ അവൾ അവനോട് അപേക്ഷിച്ചു.
  kkc-kkc: '@see-verse:MRK.007.025'
  lit-lit: (O ta moteris buvo graikė, sirofinikiečių tautybės.) Ir ji maldavo jį,
    kad jis išvarytų iš jos dukros velnią.
  urd-GVR: aur us ne Īsā se guzārish kī, “Badrūh ko merī beṭī meṅ se nikāl deṅ.” Lekin
    wuh aurat Yūnānī thī aur Sūrufenīke ke ilāqe meṅ paidā huī thī,
  far-far: '@see-verse:MRK.007.025'
  suz-BL: मेको मीश मुर अर्को रागी ङा, सुरोफोनीसीयामी जरमेशो ङा बाक्‍माक्‍त। मिनु मेको
    जाक्‍शा, येसु आ ङोंइती खुम्‍की पा बाप्‍शा “आं तमी रे वोल ग्रुंइदीने” दे पुना बाक्‍त।
  car-NT: Amy Griek woryiry mo'ko kynakon, amy Syro-Fenisia po oma'po. Irombo Jesus
    'wa iwe'pima'po mo'ko yja'wan akywano momato'me i'wa mo'ko tamyiry wyino.
  amp-amp: Nd mett, rot rmon mrokfo wany juha kantri Siria efkott. Rothu profins Fonisia.
    Rot yimotn Jisasr mnaku ttiwonmotr rothu yon mett fknemo kmi yarhrhu yak thuneft.
  bht-bht: सै जनानी यहूदी नी थी। सै सीरिया ग्रांऐ दे सुरुफिनिकी नाये दे इलाके च जमियो
    थी। कने उना उसला बिनती किती, की मेरिया कुड़िया चे बुरिया आत्मा जो कडी दे।
  eng-NOY: The woman was a Greek, a Syrophoenician by nation; and she besought him
    that he would cast out the demon from her daughter.
  cub-NT: Aru õ nomió judíovacaco ãmenejacod̶a. Sirofenicia ãmicʉrijoborõi põetedejacod̶a
    õ. Jesúre jẽniarejacod̶a, ʉ̃i etavaquiyepe ad̶o abujucʉre õi mácore jocarĩ.
  ita-1927: Quella donna era pagana, di nazione sirofenicia, e lo pregava di cacciare
    il demonio dalla sua figliuola.
  lww-lww: '@see-verse:MRK.007.025'
  ckb-ckb: ژنەکەش یۆنانی بوو، لە ڕەگەزی فینیکیای سوریا بوو، داوای لێکرد ڕۆحە پیسەکە
    لە کچەکەی دەربکات.
  spm-spm: Amighan khav, aŋni inaghamuuŋ Fonisiana aŋanan aŋm mbate. A Sirian distrighɨni
    ikhɨvana aveni iti. A Grighiiŋna akamam mbɨŋgeeghi. A non guiva aphasasirɨ utuman
    maghatɨghan khavɨ avharaghaousua Iesusɨm mbɨŋgɨva aŋga aghori.
  nas-nas: Teninooꞌ Juꞌdeeaing-koonani, Ponisia-nameensiꞌke pontoꞌaruꞌnani, Siiria-nameng-koo.
    Aaꞌnaꞌ baitoaritaaꞌ Jiisuuꞌ keviꞌuuꞌnani baurang-eta maꞌnaang bataꞌkoo.
  uvl-uvl: Ana heingana nena nge Israel ero. Te hoe i nge Poenisia nge Siria. Hele
    lange Iesus ke helope hote uneinei nge tuna heingana nem.
  tpa-tpa: '@see-verse:MRK.007.025'
  eng-BBE: 'Now the woman was a Greek, a Syro-phoenician by birth: and she made a
    request to him that he would send the evil spirit out of her daughter.'
  ixl-CNT: Utz ijaj bꞌaꞌnil u ixoj tu u Jesuus aas satojcha el u tioxhil txꞌiꞌliꞌinaj
    kꞌatz u titzꞌin. Loqꞌ puera aanima; yitꞌ Israeel koj. Aa tenam tu Feniicia tikuenta
    Siiria.
  xsi-xsi: Andeta taine ŋinde ŋandai Juda taine ŋga; i nde Grik taine, aku ipâŋga
    lâ Fonisia lawea ikeno pa Siria tâno kâ. Taine ŋinde ino kaika pa Yesu tu ma isoki
    koroani saka piti lâ i natu taine ilo.
  crx-NTPO: Ndun ts'eke 'uts'iz de haínya 'ink'ez 'en Greekne buk'uyálhduk 'ink'ez
    Phonecia, Syria whuz'ai, 'et whuzdli-un 'unt'oh. 'Et Sizi yughu tédudlih whe yúlhni,
    “Ntsi'-i nudúdeh-i syats'e oots'u hanaíninyoot.”
  kan-OKCV: ಆಕೆ, ಸಿರಿಯದ ಫೊಯಿನಿಕೆಯಲ್ಲಿ ಹುಟ್ಟಿದ ಗ್ರೀಕಳಾಗಿದ್ದಳು. ತನ್ನ ಮಗಳಿಗೆ ಹಿಡಿದಿದ್ದ
    ದೆವ್ವವನ್ನು ಓಡಿಸಬೇಕೆಂದು ಆಕೆ ಯೇಸುವನ್ನು ಬೇಡಿಕೊಂಡಳು.
  bbb-bbb: Ro bara ije fu bara Guriki ro bu aesakae Siriafonisia ijia bietei. Ijadufuo
    bara ijare kekena Jesu nidua ijia augesana soesoe. Fu kuae, E Ireobo a isekie
    ni kavene ise ige kuaga fu kabae none ige arena keke vano kuae.
  blw-blw: '@see-verse:MRK.007.025'
  tam-2017: அந்தப் பெண் சீரோபேனிக்கியா தேசத்தைச் சேர்ந்த கிரேக்கப் பெண்ணாக இருந்தாள்;
    அவள் தன் மகளைப் பிடித்திருந்த பிசாசைத் துரத்திவிடவேண்டும் என்று அவரை வேண்டிக்கொண்டாள்.
  azz-NT: Huan ne sihuat tajtoaya griego masqui yolic itech se pueblo de monotza sirofenicia.
    Huan in sihuatzin moteltatautiaya inahuac Jesús de que ma quicalanquixtili in
    amocuali ejecat de ne isuapil.
  spa-RV-1909: Y la mujer era Griega, Sirofenisa de nación; y le rogaba que echase
    fuera de su hija al demonio.
  csy-csy: Taciang a tanu sung ah doai hawlkhiatsak tu in ngen hi; tua nupi nu sia
    Greek minam hi a, Syrophenician ngammi a hihi.
  mxq-NT: Tadʉ toxytyʉjk kyaj ꞌyisraelítʉty es sirʉfenisyʉ ja̱ꞌa̱y. Yʉꞌʉ ꞌyamdoojʉ
    ja Jesús es ttúnʉt ja mayꞌa̱jtʉn es dyajpʉdsʉ́mʉt ja kaꞌoybyʉ ma̱ ja ñʉʉx.
  tzj-NT: '@see-verse:MRK.007.025'
  tdt-tdt: Senhora nee ema jentiu ida, laos Judeu, nia moris iha rai Fenísia iha provinsia
    Síria. Nia husu fila-fila ba Jesus atu duni sai espiritu aat husi nia oan.
  ron-BTF: Femeia era grecoaică, de națiune siro-feniciană; și l-a implorat să scoată
    dracul din fiica ei.
  eng-WEBP: Now the woman was a Greek, a Syrophoenician by race. She begged him that
    he would cast the demon out of her daughter.
  eng-FBV: The woman was Greek, born in Syrophoenicia. She begged Jesus to drive out
    the demon from her daughter.
  nld-1939: De vrouw was een heiden, van syrofenicische afkomst. Ze bad Hem, den duivel
    uit haar dochter te drijven.
  bwo-bwo: Máátsunwe Sirofinik'e dats ashu wotat Griki noon keewf ashi b tesh, biwere
    bna'ú atsotse fo'erawo b́kishish Iyesusi b́k'oni,
  nch-BL: Pero nopa sihuat amo eliyaya se israelita. Yaya camanaltiyaya griego huan
    ehuayaya se lugar itoca Fenicia ipan tali Siria. Huan nopa sihuat hualajqui huan
    chicahuac quiilhui Jesús ma quiquixti nopa ajacat cati quipixtoya isihuapil.
  quc-TNT: Ri ixok ri' man are tä aj Israel, xane ilom u wäch pa Fenicia, ch'äkäp
    re ri Siria. Xubochi'j ri Jesús, xuta' tok'ob che chi cäresaj bi ri itzel espíritu
    che ri ral ali.
  tfr-NTPO: '@see-verse:MRK.007.025'
  kaq-NT: Jaa haibo ta judiobaan nahua hihpahonishqui, sirofeniciabaan jena. Jahuen
    baque janinhah yoshir picoxonti jaan hihti yocaquin.
  ahr-ahr: ती गैरयहूदी बाई व्हती, सिरियाना फेनीके प्रांतमा तिना जन्म व्हयेल व्हता.
    तिनी येशुले ईनंती करीसन सांगं, मनी पोर माधला दुष्ट आत्मा काढा.
  sgb-sgb: Habaytoy babayi ay alwan Israelita ta hiyay Griego ya taga-Sirofenicia.
    Nakiingalo ya kan Apo Jesus ya ipaplag ya hinumapat ha anak nay babayi.
  vie-1934: Đàn bà ấy là người Gờ-réc, dân Sy-rô-phê-ni-xi. Người xin Ngài đuổi quỉ
    ra khỏi con gái mình.
  kxv-kxv: ଏ଼ ଇୟା ସୁରପୟିନିକି ଜା଼ତିତି ର଼ ଗ୍ରିକ୍‌ ଇୟା ମାଚେ, ତାନି ମା଼ଙ୍ଗାନି ତା଼ଣାଟି ବୂତୁ
    ପିସ୍‌ପି କିହାଲି ଏ଼ଦି ଜୀସୁଇଁ ବାତିମା଼ଲିତେ ।
  cha-cha: Ya y palaoan Griega, gui tano Sirofenisa, y tinayuyut güe na uyute juyong
    gui jagaña y anite.
  amu-NT: Ndoꞌ jom nchii tsꞌaⁿ judío. Jom tsꞌaⁿ sirofenicia. Sꞌaa tyꞌoo nnom Jesús
    na cwjiꞌ tsaⁿꞌñeeⁿ jndyetia naquiiꞌ tsꞌom yuscuchjoo jnaaⁿ.
  hin-CV: वह स्त्री यूनानी थी—सुरोफ़ॉयनिकी जाति की. वह मसीह येशु से विनती करती रही
    कि वह उसकी पुत्री में से दुष्टात्मा को निकाल दें.
  eng-OURB: Now the woman was a Greek, a Syrophoenician by race. She begged him that
    he would cast the demon out of her daughter.
  spa-BES: Ahora la mujer era griega, sirofenicia de nacimiento, y le rogó que le
    echara fuera el espíritu maligno en su hija.
  san-BEN: স্ৱকন্যাতো ভূতং নিরাকর্ত্তাং তস্মিন্ ৱিনযং কৃতৱতী|
  tdx-tdx: Nte Grika i rakembay, Siro-foinika ty famosora’e; nihalalia’e ty handroake
    i kokolampa amy anak’ ampela’eiy;
  naf-naf: Imbi ke Pinisia imbi Silia mkaengatnaŋ zetnaŋ Glik zet manzemtan. Imbi
    keyaŋ nambaŋaŋgat keŋangatnan we bekanaŋ mâpepeyelen Zisasiyet zet giŋgiŋ mge.
  grc-MT: ην δε η γυνη ελληνισ συραφοινικισσα τω γενει και ηρωτα αυτον ινα το δαιμονιον
    εκβαλη εκ τησ θυγατροσ αυτησ
  vid-vid: Mdala nayali Mgilichi yapondigwe Silofoinike kuli isi ya Siliya, nakamlanda
    Yesu yamlavye mwanage chijeni chihile.
  pio-NT: Càmíichúata israelita úái inanáica. Néese Sirofenicia yàasu cáli néeséechúaca
    úa. Yá ùanàaca usutácaténá Jesús íicha wawàsi yúucáanápiná demonio uídu íicha.
  tsn-tsn: mme a mo rapela gore a golole ngwana wa gagwe mo thateng ya taolo ya mowa
    o o maswe. (Mme a bo a le modichaba wa Se-Siria le Se-Fonishia yo o nyaditsweng!)
  amr-NT: Ettoneʼ esoeri o̱ʼe̱po sirofenicia hua̱e̱ʼeri o̱ʼu̱y. “Doʼhued hua̱yo̱butaj
    totoʼ noki̱re̱gtaj yako̱ro̱kaʼ.” Jesústaj onaʼuyate.
  pwg-pwg: Wavinena na Grik wavine, ma Ponisiya dobunai itupuwa, Siriya kamonai. Ma
    ivi nowi Yesu kurina da kanuma berona natuna gwabinai ita kwavini.
  cjv-cjv: Te oparomi Yura opai moikemba Fonisia akai i Siria akai ori suna tei dungua
    kui neinga ena oparomi Yesu “Ne murom niki dongua na aponam miriyomdi ikai tei
    moingua awi mena do!” diro yana di tongoro
  tiw-tiw: '@see-verse:MRK.007.025'
  tha-KJV: ผู้​หญิงนั้นเป็นชาวกรีก ชาติ​ซี​เรียฟีนิ​เซ​ีย และนางทูลอ้อนวอนขอพระองค์​ให้​ขับผีออกจากลูกสาวของตน
  por-BR-2018: Esta mulher era grega, de nacionalidade sirofenícia; e rogava-lhe que
    expulsasse o demônio de sua filha.
  mhl-mhl: Ŋigo oi Judaone matayoŋ, Grik buŋo miku goya. Maŋgo mamaine oi Fonisiare
    Siria prowins oone. Iŋoji oduinere maŋgone gemo yobeiŋgo karieru ojiya.
  klv-klv: Evi atob̃taKris lotopasi len naut a Fonisia a Siria. Eus aYesu hǝn b̃ehut
    natǝmat dan anatvavin.
  bco-bco: Ga a꞉no꞉ Gilig to sa꞉lan, e Fonisia amisa꞉n, Silia hen a꞉na sa꞉la꞉li. Eyo꞉
    mama mogago꞉ ida꞉ amilo꞉ dowo꞉ a꞉no꞉, Ya꞉sumo꞉ o꞉luma꞉ki mada ha꞉nolo sio꞉.
  kdl-NT: Uka vi Kawulawa† ka, kagali ka ne kpam Kasurofiniki ka. U foloi Yesu wutukpa̱
    maku ma ne mi ityoni yi.
  apu-NT: 'Oa sito sãkiretari Kreko sãkire. Ãto uãka oa. Siropenísia tixinikero oa.
    Okapotoreẽkasaakiua Xesosi apisatoõ, oamanaãri Xesosi: —Pomitikenatariko maerekati
    matamatakoti namarite ĩtoã auakari —otxari.'
  roo-roo: Oire uva osaravu raga iava oira, vo sarao vo-ia Finisia oea oisoa Siria
    taere-ia toupaive. Iria Jisas areeva oisore ra tugara kosi piereve oviiva iava.
  miz-NT: Ñadɨ̄ꞌɨ́ san ne, tuku ñuu véꞌxi ña. Ñá te ña Israee ña, tsí ñuú Sirofenicia
    véꞌxi ña. Íkan ña ntāꞌa Jesuu é na nakūnu ña é ña váꞌā san é nuu nima dióko ñā.
  qvz-NT: '@see-verse:MRK.007.025'
  deu-ELO: das Weib aber war eine Griechin, eine Syrophönicierin von Geburt; und sie
    bat ihn, daß er den Dämon von ihrer Tochter austreibe.
  mjc-NT: Ñaha can, ñavin ñaha Israel cuví ña, tyin ñaha ñuu Sirofenicia cuví ña.
    Tsaa̱ ña nu nyií ra Jesús tan caahán ndaahvi ña tsihin ra tyin na tava ra tatyi
    ña vaha yɨhɨ́ tsi sehe ña.
  ktm-ktm: Pedih kuti iy odo Yuda pwi. Iy ti odo Fonisia, ise lok mandra‑an Siria.
    Iy idu purmadan Yesus pe ihndremte puko‑on ipe Yesus ki‑es sinel odo mundren nedun
    pihin.
  caa-caa: Pero e ixic era tari tama e lugar Sirofenicia y cay ucꞌajti taca e Jesús
    tuaꞌ aloqꞌuesna e mabꞌambꞌan mein tama uwijchꞌoc.
  pls-NT: Naníta mé jeha judía, jehe joixin iná nación dinhi Sirofenicia. Pero joinchetsenhe
    ñao Jesús ixin Jesús santsjexin espíritu jianha de ngain xenhe naníta mé.
  eng-WYC-2018: And the woman was (a) heathen, of the generation of Syrophenician.
    And she prayed him, that he would cast out a devil from her daughter, (or And
    she beseeched him, that he would throw a demon out of her daughter).
  bdv-bdv: ସେ ମାୟ୍‌ଜି ସର୍‌ ହଲିର୍‌ ସୁରପଇନିକିଆ ଜାତିର୍‌ ଗ୍ରିକ୍‌ମାୟ୍‌ଜି ରିଲି, ଆର୍‌ ସେ
    ଜିସୁକେ ଗଃଉଆରି କଃରି ମର୍‌ ଜିଇର୍‌ ଲଃଗେହୁଣି ବୁତ୍‌ ଚାଡାଉ ବଃଲି କଃଉତି ରିଲି ।
  otq-NT: Nunar ꞌbe̱hñönu̱ himar me Israel, xki mꞌu̱ har ha̱i Sirofenisia. Ne mi a̱pa
    ar möte ar Hesu nda ꞌye̱mba ar tsꞌondöhi ár tꞌinxu.
  tzo-SA: Li antse maꞌuc jchiꞌilcutic ta israelal, jaꞌ liquem talel ta Sirofenícia
    balumil. Acꞌo mi mu onoꞌox xquilcutic ta lec li buchꞌutic ti maꞌuc jchiꞌilcutic
    ta israelale, pero li antse ta sloqꞌuel yoꞌon la scꞌanbe Jesús ti acꞌo loqꞌuesbatuc
    li pucuj li ochem ta yoꞌon li stseube.
  cuc-NT: I² a³m⁴ hain⁴ lang⁴³ jan³ chie³ sang²³, a³sian³ húa³⁴ sirofenicia. I² jon³
    a⁴mh³i³ Jesús i⁴tyi⁴³i³ m⁴tyi⁴ hlagh³² i⁴quian³ a³jon⁴³i³.
  kpw-kpw: Jisas nɨp neb neb göl gɨ haga, “Pai yad kɨjaki abaŋ alöp u, hag höŋ yu
    araŋ,” a ga. Nɨbi anɨbu nɨpe Juda nɨbi wasö. Nɨpe yag daula ram mɨnöŋ Pönisia,
    bɨ ram mɨnöŋ Siria nɨbö abad mɨdmɨdal u.
  ong-ong: Moto nepe ne piti uf tef nele. Nimou pene nilane ratei Fonisia lato tef
    liti Siria. Ne nirpowo Jisas piti ma laltu riri oli lepe taniene ningio pene.
  tnn-tnn: '@see-verse:MRK.007.025'
  hch-NT: Cüriyecusixi vaniuqui caniniuquieyatücaitüni, Sirupenisiyasie ninuivametücaitüni.
    Vaüriyarica nipitüacaitüni meyenü'anicü cacaüyari 'axa mü'ane, mixünacü niveya.
  crn-NT: '@see-verse:MRK.007.025'
  zpu-NT: Naꞌ noꞌr naꞌ, bi nakeꞌ beꞌnn Israel, nakeꞌ beꞌnn yell ganꞌ nziꞌi Sirofenicia;
    goꞌtyoereꞌ Jesúsenꞌ yebejeꞌ daxiꞌon yoꞌ xhiꞌnneꞌn.
  juy-juy: ତି ଆଇମରନ୍‌ ସୁରିଆ ଡେସାନ୍‌ ପୈନିକିୟାନ୍‌ ଆ ନଗରିବୟ୍‌, ଆରି ଆନିନ୍‌ ଗ୍ରିକ୍‌ବୟ୍‌
    ଡକୋଏନ୍‌ । ଆ ଡାଙ୍ଗଡ଼ିଅନନ୍‌ ଆମଙ୍‌ ସିଲଡ୍‌ ବୁତନ୍‌ ଗଙ୍ଗଙନ୍‌ ଆସନ୍‌ ଆନିନ୍‌ ଜିସୁନ୍‌ ଆମଙ୍‌
    ଇୟ୍‌ଲାୟ୍‌ କାକୁର୍ତିନେ ।
  for-for: '@see-verse:MRK.007.025'
  epo-epo: Kaj la virino estis Grekino, rase Sirofenika. Kaj ŝi petis lin, ke li elpelu
    la demonon el ŝia filino.
  gfk-gfk: Ga ianga marmaris tane Jisas bia na hasur se no sakana tanuo nong ga sasoha
    tano uno nat na hinasik. Ma iakano hahin, pai Iudeia ie. Di ga kahai tano hanuo
    Ponisia tano tamat na hanuo Siria.
  bjz-bjz: Aná evetu aná Grik embóda ariri re. Frovensi Sairofonisia anava siroruturie.
    Aná evetumi furia, taimu unda ariri ijokokodava asugea vitiria-nu, tuvota isaghava
    bubari-du rirota, Iesu dava benunu urie.
  atg-NT: Ọngi iJẹta ọni ọkpotso ọ khi, a bia li shi ekẹ iFonisha ni o la iSiria.
    Ọ lema iJesu ọ khu oni ayẹmhẹ ebe omi ọli egbe a.
  bjv-NT: E dəne kɨ e Jɨpɨ al, ɓe koje e Pənəsi, dɔnangɨ Sɨri tɨ. No̰ kɨ dɔ Jəju tɨ
    kadɨ tuwə ndɨl kɨ majal kɨ ɨsɨ adɨ ko̰ ngonne kɨn kɔ.
  tos-NT: '@see-verse:MRK.007.025'
  rro-rro: Babi'e weiana hanona Iuda babi'ena aha'i, 'a ia hanona Helene babi'ena
    Suro-fenike ai erama. Iesu enoina auba ki'a obona nahuna aonai hauna keu'u ahina.
  mxp-NT: Ojts ja tøꞌøxyøjk wya̱ꞌa̱ñ jøts ja Jesús tyikpɨdsøꞌømt ja mɨkuꞌ midi ja
    kiixyuꞌnk jam wyɨnaty myøøtꞌajtpy, sirofenicyɨt ja̱a̱ꞌy ɨdøꞌøn ja tøꞌøxyøjk pøn
    jam jadeꞌen meen, jøts griego ayuujk ja kyajpxpy.
  aak-aak: —Í Judayɨ́ apɨxímanɨ. Gɨrikɨyɨ́ apɨxírɨnɨ. Pinisiayɨ́ aŋɨ́yo pɨropenɨsɨ́
    Siriayɨ rɨnɨŋe dáŋírɨnɨ. Í Jisasomɨ “Gɨ́ miáímɨ imɨ́ó xɨxéroarɨŋɨ́yɨ́ mɨxɨ́ umáɨnowárénapeɨ.”
    arɨ́kí urayarɨŋagɨ
  chd-NT: Ƚaca'no' a'i judía, qui'huayomma maƚpiya ƚamats' cuftine Sirofenicia. (Lan
    xanuc' judío tetets'innila' iƚniya lun Sirofenicia. Tecui'innila' atsiƚqui.) Ƚaca'no'
    tixahue'e tipa'aƚa' ƚonta'a, tixaƚ'meƚa' ƚi'hua.
  kdc-kdc: Mtwanzi ayo hakalile Muyahudi, kavumbuka kudibuga da Silofoinike mwiisi
    ya Siliya kampula Yesu yamulave mndele wake kinyamkela.
  nhr-nhr: Khóès ẽe sa kò Gerika si i, a sa a kò Sirofonike dim nqõóm koe ábàèa hãa.
    A sa a kò Jeso ba dtcàrà, dxãwa tc'ẽea nem gha cóás koe tcg'òó sa.
  uig-PIN: (ayal Yunanliⱪ bolup, Suriyǝ ɵlkisidiki Fǝnikiy millitidin idi). U uningdin
    ⱪizidin jinni ⱨǝydiwetixni ɵtündi.
  beo-beo: Goe uda da Galigi uda. E da Finisia soge, Silia fifi lai ilia soge ganodini
    lalelegei galu. E da Fio liligi idiwi ea dogoga aligila sa:i, amo fadegale fasima:ne,
    Yesuma ha:giwane edegei.
  acf-NT: Madanm-lan pa té an Jwif. I té fèt an pawès Fènisiya, ki an péyi Siriya.
    I di Jézi, “Mwen ka mandéʼw, souplé, tiwé vyé lèspwi sala an ti fi mwen-an.”
  tpi-OTNT: Dispela meri em i bilong narapela lain. Em i bilong ol lain Fonisia i
    stap long kantri Siria. Em i askim Jisas strong long em i mas rausim spirit nogut
    i stap long pikinini meri bilong en.
  mbt-NT: Ne migpeyid-u-hid-u sikandin ki Hisus ne igpaalew ka busew ne diye te anak
    din. Ka seeye ne malitan kene ne Hudiyu wey diye neetew te Pinisiya ne sakup te
    prubinsya te Sirya.
  hau-SA: Macen kuwa mutuniyar Hellenawa ce, an haife ta a Funisiya a Suriya. Ta roƙi
    Yesu yă fitar da aljani da yake jikin diyarta.
  mam-NT: Pero yaa'n judíaxuj, sino tej tnom Fenicia tej nin tnom Siria, ttxlaj Galilea
    te jawne. Bix ak'xuj cubsal twitzxuj twitz Jesús tu'n tel tlojo'nxin biman ti'
    talxuj.
  udu-udu: A’bom yansan ta’da ’bom gi Paŋ Griḵi mo be, a’di jin dho’thkunu mo e Pam
    P̱inikiyya ma Suriyya mo. Dhala yim doṯki a’di gwo mo mmo/ura ruma ’cesh ka pije/
    ’peni ’bwa/ mo be.
  tvt-tvt: Erah nuh rah hahote angta Phonisia deek Siria hadaang ni tup arah ah. Minuh
    rah ih heh sah sak nawa chiithih laakhah rah dokphan raangtaan ih Jisu lasih ah
    jota.
  bgt-bgt: '@see-verse:MRK.007.025'
  mvn-mvn: Ka vavine‑nana eha me Iudea, kate ayo‑amai me Girisi, ka yai tupua papani
    Siro‑Poenisia nihenina.
  djk-NT: e begi en fu a puu a takuu jeje na a pikin fi en tapu. A uman ya na be wan
    Giiki sama di be meke na a kondee di den e kai Silofenisi.
  uig-LAT: (ayal Yunanliq bolup, Suriye ölkisidiki Fenikiy millitidin idi). U uningdin
    qizidin jinni heydiwétishni ötündi.
  nde-nde: Umfazi lo wayengumGrikhi, owazalelwa eFenikhe yaseSiriya. Wancenga uJesu
    ukuthi akhuphe idimoni endodakazini yakhe.
  ton-ton: 'Ko e Kiliki ʻae fefine ni, mei he puleʻanga ko Sailofinisia: pea naʻa
    ne kole kiate ia, ke ne kapusi kituʻa ʻae tēvolo ʻi heʻene taʻahine.'
  mir-NT: '@see-verse:MRK.007.025'
  cak-YNT: Re jun ixok re' man israelita-ta. Reja' jun aj-sirofenicia. Pero xbexuque'
    chach re Jesús chin xbo'rc'utuj utzil cha che tulisaj re itzel espíritu re c'o
    riq'uin re ral.
  ces-1613: (Byla pak ta žena pohanka, Syrofenitská rodem.) I prosila ho, aby ďábelství
    vyvrhl z její dcery.
  nab-NT: '@see-verse:MRK.007.025'
  eko-eko: Muukha otule aari nkereeka ya siiro-fineesiya aavokoliweewo, khusala anvekela
    Yinsa yoori amwikare sheethwani otule aari mmwiili wa mwanawe.
  qxn-NT: 'Tsay warmiga griegocuna casta Sirofenicia marcachö yurigmi cargan. Tsaynö
    puntanman gongoricuycurmi Señor Jesucristota mañacurgan: “Taytay. Wawalläpita
    supayta gargoycullay.”'
  wol-2010: fekk jigéen ja ci xeetu Gereg la bokkoon, juddoo wàlli Fenisi ci diiwaanu
    Siri. Noonu jigéen ja ñaan ko, mu dàq rab wi ci doomam.
  kqw-kqw: A ino ra, a ino Ponisia tagun a papor Siria, i ausur a ino Juda. I saring
    o Iesu sur in lakro ru a laulau na nion gusun a nutunulik.
  nss-nss: Pihin iye, ara hamou pihi Krik, pe tinan imwalahiy tan iro kol namandran
    hape Ponisiya, ita nondriya kol namandran iya Siriya. Pe yiy irakekeyani Yesu
    para kirasses payit kiya mawen ndrita norun pihin.
  snc-snc: Mo vavine tu Grik vavinena, Siriafonesia ai emaḡurito. Benamo ḡia na Iesu
    enoḡiato, mo iauka rakavana natuna ḡuiatona ḡenana bene lai-vaḡia.
  lgl-lgl: Ma geli fo, geli faasia 'i Fonisia 'i laola iona 'i Siria, ma 'i lia iko
    lou geli Jiu, ma ulao lia aloe 'are ta'a 'e io ala. 'Urifo, ka aniulu fala Jesus
    'ali 'e balia aloe 'are ta'a fo faasia ulao fo lia.
  mmo-mmo: Vêêh-anju yi Glik ti, tangganaan hako neep Pinisia vu Silia-te taaku, ond
    mamu nipaya ti hôôvu vêêh-anju nowaavêêh, om la hato pataav baambu neep voon hôôk
    Yesu vaha be kataangg nambe gatiiy mamu na in nowaavêêh.
  ncu-NT: '@see-verse:MRK.007.025'
  cni-NT: 'Caari oni jorio, oponeaca Shirojenishiaqui. Ocantapaaqueri: —Yatajeaoncaquero
    noshinto camaari, poavisacotajenaro.'
  eng-WMB: Now the woman was a Greek, a Syrophoenician by race. She begged him that
    he would cast the demon out of her daughter.
  zaw-NT: Gunaaga rnii griegw, najcni beṉ Sirofenicia. Gunabni lojni guinibeeni guirii
    beṉdxabga neṉ lastoo xi'nni.
  san-MAL: സ്വകന്യാതോ ഭൂതം നിരാകർത്താം തസ്മിൻ വിനയം കൃതവതീ|
  tam-TCV: அவள் சீரோபேனிக்கியாவைப் பிறப்பிடமாகக் கொண்ட, ஒரு கிரேக்கப் பெண். தனது மகளிடத்திலிருக்கும்
    அந்தப் பிசாசைத் துரத்திவிடும்படி, அவள் இயேசுவைக் கெஞ்சிக் கேட்டாள்.
  mit-NT: '@see-verse:MRK.007.025'
  ceb-ULB: Karon ang babaye usa ka Griyego, nga taga-Fenicia ang kaliwat. Nagpakiluoy
    siya kaniya nga palayason ang demonyo gikan sa iyang anak nga babaye.
  ces-LB: Přišla a prosila ho na kolenou, aby uzdravil její pomatenou dceru.
  mkn-mkn: '@see-verse:MRK.007.025'
  nce-nce: '@see-verse:MRK.007.025'
  pol-UBG: A kobieta ta była Greczynką, rodem z Syrofenicji, i prosiła go, aby wypędził
    demona z jej córki.
  qxh-NT: 'Chay jäpa warmi Sirofenicia marcapita caran. Griego rimayta rimaj. Wamranpaj
    Jesústa mañacapuran: «Supayta jarguy» nir.'
  nwi-nwi: '@see-verse:MRK.007.025'
  kmo-kmo: 'Yirek sii Jisas riina woyasachiyasa woher: “Eeta kapasek spirit eeji yikapwak
    taweyn eena na yeechi rabo.” Diita mima sii akar nosap pochik tar mima. Siin Pinisia
    akama Siria nosapek eeka siin yimowur mima.'
  agr-agr: 'Duka nuwak griega Sirofenicianmaya aajakuí, nunú segau: —Nawantug wakan
    pegkegchau egkemtugbauwa nu jigtugkita, —tusa.'
  kyc-kyc: Enda doko baa enda wakale yuu Siria dokona yuu Pinisia range. Baame Yesu
    lamaiyuo banya wanenge imambu koo raka lanyi nembakapyali lao piso sokondali pyuo
    leya.
  urd-GVU: اور اُس نے عیسیٰ سے گزارش کی، ”بدروح کو میری بیٹی میں سے نکال دیں۔“ لیکن
    وہ عورت یونانی تھی اور سورفینیکے کے علاقے میں پیدا ہوئی تھی،
  yre-NT: -A -nan nɛn e toba -fɔ -yrɛ 'nan, 'e 'yʋ -wlidɩ "pin 'e 'lu -sru. Lɩ 'bɔ
    zɩɛ Zuif lɩ "cɛɛ dɩ, e "sia Siri Fenizi 'lɛglɔn 'ji.
  fuh-BKF: Debbo oon wanaa Alhuudiyanke, wo to Finiki ley leydi Siiriya o rimaa. O
    nyaagii Iisaa itta ginnaaru nduun e ɓiyiiko oon.
  arl-NT: Cuno maajiiri Sirofenicia jiyajinijinio taatu quijia. Jesu secojoseeri samaru
    na tohuataniniuria neyatujiniji.
  dhg-DUWADHA: '@see-verse:MRK.007.025'
  ziw-ziw: Mvyele uyo endaga Mgiliki, mwelekwa ywa mkowa wa Silofoinike si ya Siliya.
    Amwila Yesu aguluse mpepo zi mwa mwanawe.
  grc-TR: ἦν δὲ ἡ γυνὴ Ἑλληνίς, Συροφοίνισσα τῷ γένει· καὶ ἠρώτα αὐτὸν ἵνα τὸ δαιμόνιον
    ἐκβάλλῃ ἐκ τῆς θυγατρὸς αὐτῆς.
  nag-nag: Aru etu mahila Yunani aru Syrophoenicia jaga laga asele, aru tai swali
    pora bhoot ulai dibi koi kene Jisu ke binti korise.
  eng-OEBCW: the woman was a foreigner, from Syrian Phoenicia – and she begged him
    to drive the demon out of her daughter.
  knj-NT: Ja' jun ix ix tu', man Israel oj ix, a Sirofenicia ix. Jix sk'an ix tet
    Jesús tol chi yi' el jun pena espíritu yin ix k'opo tu'.
  deu-1912: (und es war ein griechisches Weib aus Syrophönizien), und sie bat ihn,
    daß er den Teufel von ihrer Tochter austriebe.
  san-PUN: ਸ੍ਵਕਨ੍ਯਾਤੋ ਭੂਤੰ ਨਿਰਾਕਰ੍ੱਤਾਂ ਤਸ੍ਮਿਨ੍ ਵਿਨਯੰ ਕ੍ਰੁʼਤਵਤੀ|
  nob-LB: Hun ba om at han måtte sette jenta fri fra den onde ånden. Denne kvinnen
    var ikke jøde, men kom fra distriktet bortenfor.
  ntj-ntj: '@see-verse:MRK.007.025'
  sxb-NT: Yawanga omukazi omugeni, owaiwulwa mu ekialo ekia Siiria asi aetwa Foeniisia.
    Yasawa Yesu mbwe agie amufumizie ewikeeno ku omwala waae.
  nhu-NT: Kpwoon wvudvu to nu wee Glek, kɛ ɛ̀ to nu wee Juu kɛ. Bó to boke wvú Fonishia
    woŋ wvù Silia le. No wvú gbwe nonɛn, mum lɛkɛ Jisos lɛ wvú ebvuse nceendaa dɛwle
    wvudvu yî waa wen e.
  row-row: '@see-verse:MRK.007.025'
  msy-msy: Amizir kam, an amebam Fonisian Distrighɨn a bate. Sirian danganir ekiamɨn
    aven itir distrigh. Ezɨ a Grighɨn akamɨn mɨgei. A duar kurar an guivim gapazazim
    batoghasa Iesus mɨgɨava a gakaghori.
  agg-agg: Nɨmorehɨ ranai ana ai-poanɨmbo Fonisia sɨrɨhündɨ Grik hoafeimbɨyo. Ranɨyo
    ai Sisasɨmbo ahandɨ nɨmorehɨ nɨmorɨndɨ fi-ambeahɨndɨ moaruwai nendɨ hefoefembohünda
    hütihütimarɨrɨ.
  ptp-ptp: '@see-verse:MRK.007.025'
  nak-nak: Eala moli la tavilele eia kama la tavile Iuda, eia la tavile Grik, eia
    loio la mautu e Ponisia, oio la gale e Siria. Eia goio kaka e Iesus veia eia ge
    kumuli taro la hitu ale kama kokora eia pou te latula.
  lbb-lbb: A hane ning, i a hane Ponisia miting na papar Siria, belsur a hane Juda.
    I nunung e Iesu sur ir kepsen a mot kusun e natnalik.
  kan-2017: ಆ ಹೆಂಗಸು ಸುರೋಪೊಯಿನಿಕ್ಯದಲ್ಲಿ ಹುಟ್ಟಿದ ಗ್ರೀಕಳಾಗಿದ್ದಳು. ಆಕೆಯು ತನ್ನ ಮಗಳಿಗೆ
    ಹಿಡಿದಿದ್ದ ದೆವ್ವವನ್ನು ಬಿಡಿಸಬೇಕೆಂದು ಆತನನ್ನು ಬೇಡಿಕೊಂಡಾಗ,
  cso-NT: Jan² tsá² cú²juú² bíh¹ tsá²mɨ³ hí³, tsá² jmɨ́¹ hɨ́n¹³ tɨ³ Fenicia hué³²
    Siria. Cuan³ tsú² ñí¹con² Jesús hi³ ca³mɨ́³ dí² hi³ chin¹³ tsú² jmɨ́²chí³ hláɨnh¹
    hi³ hún¹ hñu³ tsɨ́³ mɨ́¹ míh¹ jon² dí².
  ena-ena: Iamɨgali agaŋ nɨbu Gɨlikɨ ciaŋ hɨsɨŋ. Nɨbu Fonisia hɨdɨlɨ. Nɨbu Silia fi
    tɨbɨ hɨsɨŋ. Nɨbu sudɨ sɨbɨlɨ nudɨ nadinu dɨ hɨvɨ hɨnimalɨ agadɨ lakulaku saŋ Jisasɨ
    dɨ abacivamalɨ.
  nbq-nbq: Hwa ako en abwa edok erogo Yesus adema yugugu dugwit, “An neyak madis endawima
    nonggagagi andi, nggigilogo wibanogen yiluk, yukisiga,” yugogogi. At hwa ako eyave
    Yakuri menda dek. At Yunani menda ovara, o Penisia, propinsi Siria vaga endaklagagi.
  tgo-tgo: '@see-verse:MRK.007.025'
  yap-yap: Re pin nem e be’ u bang, nni gargelnag u Fonicia ni bay u lan yu Syria.
    Me wenig ngak Jesus ni nge tuluf fare mo’onyan’ nge chuw u fithik’ i dow fak.
  mop-NT: Ma' Israel a nooch'up abe'e. Sirofenicia u c'aba' u caal. U c'aataj ti'i
    a Jesus ca' u joq'ues a c'ac'asba'al a que'en tu yool u yal.
  tet-tet: '@see-verse:MRK.007.025'
  hlt-MCSB: Tahae kah huta tah Syrophoenician kah Greek hoel la om dae a canu kah
    rhaithae te haek sak ham Jesuh a hloep.
  xtd-NT: Te ñadɨꞌɨ jaꞌan tnuꞌu griegu kuu‑ña. Ñatu kuu‑ña ñadɨꞌɨ ñuu Israel, ñadɨꞌɨ
    Sirofenicia kuu‑ña. Te n‑xijan‑ña nuu Jesús xa kineꞌe‑ia tachi uꞌu anu daꞌya dɨꞌɨ‑ña.
  mdy-ETH: ላኣሌላ ሶኦሪያ ዓጪዳ ፖኖቄ ጌይንታ ቤስካ ሾይንቴ ጊሪኬ ዜርፃፓ ማዔያኬ፤ ዒዛ ዒዞኮ ናዔሎይዳፓ ፑርቶ ዓያኖ ዬሱሴ
    ኬሳንዳጉዲ ሺኢቄኔ።
  spl-spl: '@see-verse:MRK.007.025'
  usp-NT: Man anm li ma' rijajl ta' Israel y ji' tipe Sirofenicia, xxucb'a' rib' laj
    rakan Kakaj Jesús. Xtz'onaj tok'ob' re chi tiesaj man etzl laj ranm ric'lal.
  zav-NT: '@see-verse:MRK.007.025'
  sgz-sgz: '@see-verse:MRK.007.025'
  kek-NT: Li ixk a'an ma̱cua' aj judío, a'an aj Sirofenicia. Quixtz'a̱ma chiru li
    Jesús nak ta̱risi li ma̱us aj musik'ej riq'uin lix co'.
  blz-NT: Ia nama'ase' kada' i Yesus mumbuse'i meena men nangalampingi anakna. Wiwine
    iya'a samba Yunani, lipu' Fenisia na Siria.
  poe-NT: Na mé jehe tjan tsíkji̱xi̱n kjín, na mé tsíkji̱xi̱n tjan nó nación Sirofenicia.
    Na ntá jehe tjan a mé kui tjan chrónóe̱he̱ tjan tí chꞌín Jesús kíxin chrókuakitsje
    chꞌán tí ncha̱kuen tí jínahya chónta xje̱en tjan.
  san-TAM: ஸ்வகந்யாதோ பூ⁴தம்ʼ நிராகர்த்தாம்ʼ தஸ்மிந் விநயம்ʼ க்ருʼதவதீ|
  cof-NT: Yari Sirofenecia tinun tobi nechi jominue. Uyan to sona jotonan, Jesube
    rocainue ya sonachi namachibi yucanchi oco pominca mansularisa.
  srm-NT: 'ta begi ën gaanfa seei taa: “Masa, gaantangi, ko jaka wan sondi puu a di
    mujëë mii u mi liba da mi. Biga a ta penëën te na soni.” Ma nöö hën Masa Jesosi
    piki ën taa: “Mujëë o, an fiti fii musu puu bëëë a de mii maun tuwë da dagu mii
    e. Biga dee mii fosu musu njan.” ˻Nöö fa a fan dë, a kë taki taa dee Dju sëmbë
    fëën fosu musu fendi heepi˼ biga wë di mujëë aki sö an dë Dju sëmbë, oto köndë
    sëmbë a dë. De pai ën a Finisia u Silia köndë.'
  qvs-NT: Payka Sirofenisia partimanta kashpa mana judiyu kastachu karkan. Jesuspa
    ñawpakninpi kunkurikushpa sukaman roygarkan shipashninmanta supayta llukshichinanpa.
  zca-NT: No una' re' tlë't men Israel xa', lë' xa' nzë yezh sirofenicia. Dox nguna'b
    una' lo Jesús par ko' Me mbi mal laxto' xmë'd una',
  cbc-NT: Mai, cõ pʉame ape yepa macããcõ sirofenicia na caĩrõ macããcõ ãñupõ. Bairo
    etari, bʉsʉrique tutuaro mena cõ macõpʉ wãtĩ caãcʉ̃rẽ cʉ̃ acure rocawiyojo rotiyupo.
  qxo-NT: 'Nircurnam Jesusta rugacur nirgan: “Wawäpita supayta garguycullay, taytay”
    nir. Tsay warmega cargan Jesus puriycangan Sirofenicia nacionpitam.'
  mox-mox: '@see-verse:MRK.007.025'
  kew-kew: Mogo nogona agiri Siria adaare Fonisia oname madisa. Gore nipu Yesumi mo
    nogo-para pia remo rakepeainalo ogesa.
  dww-dww: Waivi tauna eteni Gurik nama be meagai dosinama Ponitia nopone ya tubuḡana
    Siriama, waivi Yesu yai baḡa da tauna natunama nopone penama sibo ya tavu dobiḡena.
  nif-nif: dɨñgunembi, wembanlok gɨnañ yal kolan kle-ñɨmektok nɨ-gɨñgɨneñguk. Tam
    wɨn endɨ Juda tam nɨm. Endɨ Fonisia nanin, Silia kwelan indañguk,
  twi-ASANTE: Ɔbaa no srɛɛ no sɛ ɔntu saa honhommɔne no mfiri ne ba no mu mma no.
    Na saa ɔbaa yi yɛ Helani a wɔwoo no wɔ Siro-Foinike.
  aoj-aoj: Akoꞌw Finisiaiꞌwi anep itap luꞌupa Siria. Akoꞌw ina Judaiꞌwi, owaꞌ. Kwaꞌi
    diga Griki. Eaꞌ kwahaliꞌ Jisas dindinipa nogatofamaꞌwa ambal aunai nagape nogamaꞌw
    akwaꞌuꞌwii.
  cbv-cbv: Caánt Siria baác Fenicia wʉ̃t jʉmni tʉ́tchidih bóli, Griega wili mit jʉmʉp
    wʉt jĩ. Pánihna, Jesús pebh bódicha caj yoh ñajnit, mi nʉʉmdíh jʉmni nemépdih
    ã bacat tʉ́ʉtat pínahdih mit ʉʉ́bʉ́p wʉt jĩ.
  taw-taw: takaw kɨles tɨmel agɨl agak, Pay yɨp kɨcheki abaŋ lup ak, ge seŋ amnaŋ
    agak. Bin anɨb ak ne Juda mel olap. Nop tɨkɨlak Siliya plopens, taun ne nɨm Ponisiya.
  jic-NT: Griego waytsja quepan, judío tulucj. Sirofenicia mpe 'eseptsja. Pajal la
    tjemyona Jesús lal jupj ca pje'á jas majamas lapanen jupj jucucus jos mpe.
  zap-NT: wnab men lo Ne ne koo Ne menzab lextoo xsaap men. Nakdet men men-Israel,
    sinke le men nak men-Sirofenicia.
  wer-wer: Öng pöp pi maim Siria yangerak Pinisia yangerakaanëp. Pöpök pim koontupökaan
    urmerap waö ë mëëpënëak ke urak mëëa.
  ipi-ipi: '@see-verse:MRK.007.025'
  qul-NT: Chay warmeka waj nacionniyoj carkan, naciska Sirofeniciapi. Rogacorkan wawanmanta
    sajra espirituta katerkonanpaj.
  tnc-tnc: 'Sirofeniciaka''iakako, judíotatamarĩko koimaeka. Toᵽi mae ikuᵽaka kire
    kõrĩka: —Yire mijeyobaabe. Yimako Satanárika ima ña''rĩjãikako koime. I''suᵽaka
    simamaka koᵽuᵽakareka simakoᵽeika miᵽoatarika yiyaᵽayu mae,— kire kõrĩka.'
  ter-NT: Yoko haina jûdeu ne sêno, koati seno sirufinísea.
  bmr-NT: Jaago siicuumiogo griegomɨogou, sirofenicia icano jiinɨjemɨnaagou. Jaago
    Jesujaa asaaugoro diiboco dilluvauhi illefañotɨ ihɨjɨco iinusuqui.
  fuf-fuf: Tawi on debbo ko *Gereekiyankeejo, mo iwdi mun woni Fenisii, ɗun ko e nder
    Sirii. O torii mo raɗanagol mo jinnawii wongii e jiwo makko on ngin.
  mwc-mwc: Kona wai Gentile wasike ba Syria Phoenicia, kupurina kamona i tupuwa. Iesu
    i babai kata kanuma goyona natuna kamona iti kasibauni.
  bhl-bhl: 'bokolewomelu: “Ku nelo dokonemeko, nem mun um dim alakabe aneng matil
    be takala kulu kouma!”, dangsu kale. Waneng bu Isalael kawtiw im deng ka biliw
    kawtiw Silia aneng fian em Fenisia aneng beem waneng ute kale.'
  ons-ons: Ŋerep yewa eŋe tego maneo ŋine, qelaŋ ŋerep, eŋe Yuda wane tegooŋine mida.
    Eŋe Ponisia tegoo ŋine, kepe mat ea wane welaine, eamo Siria kepeo. Eŋe Yesu wano
    ari seleleine qe meŋenka more rake, “Borasone asu qotkoineŋo matalikaki metmaike.
    Ge esopkanom!”
  con-NTPO: Tsa pushesuja griego a'i Sirofenisia andenga isu'cho. Tsa jipa Jesúsma
    iñajan cuintsu tise onque'nge'ye cocoyama joqquitssiañe.
  ghs-ghs: Oonihe atapa noi Dzutaho bahe Siroponikisa haba nenai qaata. Oonita atapa
    noi dzauri hiireqi hee, Songena teei khatata nahoho irita ooraimi oke nii iihaqu
    mae?
  peg-peg: ହେଦେଲ୍‌ ସୁରପୈନିକିୟା ନିପ ରଞ୍ଜେଲ୍‌ ଗ୍ରିକ୍‌ ଗାଡ଼୍‌ଚେ ମାଚାତ୍‌ । ତା ଗାଡ଼୍‌ହି
    ତାକେଣ୍ଡାଂ ପୁଦାଂ ପିିହି କିନି କାଜିଂ ହେଦେଲ୍‌ ତାଙ୍ଗେଙ୍ଗ୍‌ ଗୱାରି କିଦେଙ୍ଗ୍‌ ଲାଗାତାତ୍‌
    ।
  txu-NT: Ne arỳm Jejumã krao a'uw ne kum, —Amrẽ tẽn me karõ punu kute ikra prĩtio
    baja jano gê kum ire, ane.
  eng-WEBU: Now the woman was a Greek, a Syrophoenician by race. She begged him that
    he would cast the demon out of her daughter.
  gnw-NT: Jae co penti sirofenicia griega pe uyemɨngueta vae. Jae uyerure Jesús pe
    umbɨsɨrɨ vaerã aña imembɨ güi.
  mux-mux: '@see-verse:MRK.007.025'
  maj-NT: Tu̱nga najmi ntje̱he̱ xu̱ta̱ judio̱hó tje̱he̱n ra̱ ta̱chjúu̱n, a̱t'aha̱
    a̱nte Sirofenici̱a̱ kitsin. Kui xi j'ainkihi̱ Jesu nga k'o̱nsje nda̱ninda xi tíjñajihi̱n
    ta̱kjíhín.
  bkq-NT: 'Âkelo anano myani mâkâ; Judá donro keba. Feniciadâ egaseyby, âtâ anary
    Síria eynynâ. Enado âzeguhoam itybyem aguely: — Pymâ, iexiry odayba kadopâ nhânkygâ
    — kely.'
  kue-kue: Ambumo i Grik, Yomba Bina, Siria kamun suna Ponisia kugl yeingwa. Ambumo
    i ambuglo mina spirit kinde suna moglkwa, simenda endinambedi pre yanadi Yesus
    tongwa.
  cot-NT: Oraquea manquigarentsi iroguentiquea guiriego, ovoguiquea Shiropenishiaqui.
    Ocantapojaqueri iroguisotoacoventajero orijanite ishaquiacaca ampatsini.
  bnp-bnp: Ra ngatavine iea, i uka ma a Iuda. Ni poda o Siroponesia. I nana torea
    e Isu ge lili vurokia a hanitu i dili ne tuna.
  apn-NT: '@see-verse:MRK.007.025'
  ctp-NT: mjñan chaꞌ tlyu tiꞌ ꞌin yu, chaꞌ kulo yu kwiꞌin kuxi nu nsuꞌwi ꞌin sñiꞌ,
    nka tiye. Chaꞌ ꞌin neꞌ griego nchkwiꞌ nu kunaꞌan kanꞌ, chaꞌ neꞌ xka laꞌa tsuꞌ
    lka, neꞌ sirofenicia.
  bre-BRG: Ar wreg-mañ a oa gresian, ha sirofenikian a bobl; hag e pedas anezhañ da
    gas an diaoul kuit eus he merc'h.
  opm-opm: Ama kuu uh wan ihira. Siria mong Ponisia ihirmur. Meng oh Grik ire meng
    amrapat kuu uh aprisa Jisas ohnong Go nohe kor uhe mongsup oh ga at pat moh go
    ga aper amdam nayah matinmur por kandeingopri.
  bvr-bvr: Nipa jin-gata Ju ngika, wurra nipa Jayrapaníchiya (Syrophoenicia) jin-guyinda
    minypa gu-werranga gu-rrawa. [Minypa Ju yerrcha gala jal aburr-nirrarna burrwa
    gu-werranga gu-rrawa, wurra burrbu-ngurrjinga aburr-workiyana gulukula yerrcha.]
    Wurra nipa jin-gata jina-bona, jiny-nyiwija nula Jesus barra walkwalk a-yerrnyja
    achila mu-lopa acha.
  wal-wal: He mishiriyaa Aihuda gidukku; a yelettidoikka Sirofinqqe giyo biittaana;
    a ba na7eeppe xalahiyaa kessana mala, Yesuusa woossaasu.
  zad-NT: Na' noola' nake' beṉ' griego, na' golje' gana' mbani Sirofeníciana'. Na'
    got'yoile' Jesúza' yibeje' dii x̱iwaa yoo bi' nool c̱he'na'.
  mgh-mgh: Ari nthiyana nsenci, olapo yo Siriya-Fenisiya, ni ananlepela wiira oomole
    ncini wa mwanawe.
  aso-aso: Aꞌmine veneꞌ nene Zuda veneꞌ nevoba Silia misuboꞌmi gahevela Hoinikia alevetingutiꞌ
    sotoꞌ ogo mino nGiliki aleveti monovoꞌnidoꞌ eꞌmeto minineꞌ veneꞌ neꞌmo nene eiꞌ
    aluvoꞌmi luloutiꞌ sikalahuꞌ goloso nene imisele hulilive lo amuzo molo lo-imineꞌ.
  uli-uli: Fefel we ila semal re Gentiles le ye sub mo wol haplom we Phoenicia we
    ye mel wol Syria. Yesa hafaelpechey Jesus bo be hachuya moniyan mo uwol tarfefel
    we lol.
  nin-NT: Ayamba wa a su anu Girrki. A su unichirr mu, na si su anu Yahuda hen. A
    ngri ma nu Fonisiya nggo su na anga ka Sirriya. A nga ni barr Yesu da bi ku han
    izhi ndanda yi glo ku uva ma wa.
  tgk-tgk: Вай зани юнонӣ, зодаи Финиқияи Сурия буд. Ӯ илтимос кард, ки Исо девро
    аз духтараш берун кунад.
  acu-NT: 'Nu nuwaka Sirofenicia nungkanmaya asa judíochu ayayi. Tura Jesúsan seak:
    —Wait aneasam, nawantrunia iwianch jiiktia, —timiayi.'
  cak-WNT: Ri jun ixok ri' ma israelita ta. Riya' jun aj sirofenicia. Pero xoxuque'
    chuwech ri Jesús riche (rixin) chi xoruc'utuj jun utzil chare chi trelesaj el
    ri itzel espíritu ri c'o riq'ui ri ral.
  ebk-ebk: Nan nauy ay fiafiai at naiyanak ad Fenicia ay sakop nan Siria. Nan kalina
    at Griego. Nunpakaasi hiya kan Jesus ta epafoknagna nan anennet as nan anakna.
  spa-PDDPT: La mujer era griega, de nacimiento sirofenicio. Le rogó que echara fuera
    el demonio de su hijita.
  ruf-ruf: Ipinga ayo tsakakala Mgiriki, iyelekighwe mne ghumji ghwa Sirofoinike.
    Kamlomba Yesu amlapfe mwanaghe ichinyamkela.
  gun-gun: Ha'e va'e kunha ma Siro-fenícia pygua, ha'e grego ayvu py ijayvu va'eri
    ojerure oiny imemby gui anha oipe'a aguã.
  agu-BL: Nk'e'tz judiy i', ma na i' jun aj sirofenicia. Yi cwe'n mejlok, nin cu'
    wutz tetz Jesús tan toque'n tan laje'n len yi espíritu cwent Bayba'n twankil yi
    tal.
  isn-isn: uMusungu nuanso ai watulaa Muyunani, nua ndugu a Kifoeniki. Ai umusingilye
    nuanso amuzunse u hing'wi kupuma ku munaanso nuakwe.
  eng-PEV: '@see-verse:MRK.007.025'
  ilo-ULB: Ita, ti babai ket maysa a Griego, nagtaud isuna iti puli a Syrophoenicia.
    Nagpakpakaasi isuna kenni Jesus a paksiatenna ti demonio a limmugan iti anakna
    a babai.
  pir-NT: Ticoro Siria yehpapʉ ijiri yehpa Fenicia wame tiri yehpa cjõno ijiahye.
    —‍Watĩnore cohãrĩña yʉhʉ macore, ni siniahye ticoro Jesure.
  anv-NT: Mendée yina apɔ́ fɔ́ muú Jus alu muú Grek ne ábɔ́ ábyɛ́ ji títí né
    gebagé mewaá Siriya né Sirofɔnishya. Anɛ Jisɔs mmyɛ nnó aféré meló nchyɛ
    yimbɔ né mmyɛ maá wuú.
  sab-NT: '@see-verse:MRK.007.025'
  tmd-tmd: Jisas nugwo yad gögö rön yadöŋa, “Halöu na ragwo ha yuö wöl aku, yad abaŋ
    röu duaŋ,” me röŋa. Mö aku nuŋ Juda mö yöi. Nuŋ yöx pön hem mögörɨb Pönisia, mögörɨb
    Siria nöbö nugwidɨx mɨdmɨdmä.
  acr-NNT: Ekꞌu rixoq na kukꞌil ta ri aj judiꞌabꞌ yey alaxel pa ri luwar re Sirofenicia.
    Xelaj kꞌu che chaꞌ karesaj bꞌi ri itzel uxlabꞌixel che ri ralit.
  kpg-kpg: Mee di ahina tuadimee, ne haanau i Phoenicia i Syria. Gei mee gaa dangi
    gi Jesus gi haga bagia di hagataalunga huaidu gi daha mo dana dama ahina.
  taj-taj: थे म्रिङम्‍हेमे सिरिया य्‍हुल्‍साला फोनिके भिबा नाम्‍सारी न्‍हबा मुबा।
    थे अर्गु य्‍हुलला म्रिङम्‍हेमे मुबा। थेसे “ङाला झामेला ल्‍हुइग्‍यामसे म्‍हङ ताप्‍सी
    पिन्‍गो” भिसी येशूदा बिन्‍ती लजी।
  avt-avt: Mɨte ip hɨre pe Isrel au. Hɨre miye pɨre wina (o winiye) weit provins Sairo
    Finisia. Hɨre witehi Jisas hɨrak kakɨpɨr herwe kaknopɨn kakɨkeipɨn nɨki pɨre.
  cbk-cbk: '@see-verse:MRK.007.025'
  uig-ARA: (ئايال يۇنانلىق بولۇپ، سۇرىيە ئۆلكىسىدىكى فەنىكىي مىللىتىدىن ئىدى). ئۇ
    ئۇنىڭدىن قىزىدىن جىننى ھەيدىۋېتىشنى ئۆتۈندى.
  tuf-tuf: 'Eyta rahcuír Jesús quin wiquír ey ques acor cuscar cut chihrjacro. Cuscar
    cut chihrír Jesús quin wajacro: —As waquíj urá sar bin cuicá uc aywi, conjacro.'
  abx-abx: bisan kon adday to iya Grika nga a'allom sallod si Fenicia nga nagtinagalan-na
    si Siria. Makimalu'oy iya si Jesus pagpapinda si mara'at espirito magbawa-bawa
    si dadi'-na.
  mco-NT: Je töxyjäy hue' anajty ycogájpɨty Sirofenicia (e hue' anajty griegojäy).
    Yɨ töxyjäy may'ajt pɨjctzoy ma Jesús co huen yajpɨdzɨmy je ca'oybɨ ma ypi'cnɨɨx
    yjot yhuinma'ñ.
  kqf-kqf: '@see-verse:MRK.007.025'
  cpb-NT: 'Jiroka tsinane kaari Judá-ite, opoñaawo iroori otsipaki nampitsi oita Sirofenicia.
    Okantapaakeri: “Jesús, petsiyatakotakagainawo nishintyo, raagatziiro peyari.”'
  aon-aon: Okwudok armatok okwok douk kupaiburi waburik, okwok madae Juda uwe. Okwok
    kwanaki abrudok wabur Fonisia, douk bape shokugi nahobig Siria iri. Aria okwok
    douk kweyagwreh Grikin baraen. Douk okwok kwanak aria kwakrip Jisas abom um nihiyahuk
    enyudok yoweinyi sagab douk nyape okwokwik nugawik iri nyutogur nyuruwok.
  hus-NT-2005: Jechéꞌ an mímláb yab u israelita, jajáꞌ Sirofenisia in chabálil. Pakabédhá
    na Jesús kʼal an mímláb abal ka káldhantsat an ti atʼax ejattaláb xi kʼál ti ochadh
    nin tsidhánil.
  mig-NT: Te ña'an‑ún, ña'an griega kúu‑ña. Te onde̱ ñuu̱ Sirofenicia va̱i tata̱‑ña.
    Te ni̱ ka'a̱n nda̱'ú‑ña jíín‑yá ja̱ ná kíñi'in‑ya̱ tachí kíni tá'a̱n se̱sɨ́'ɨ́‑ña‑ún
    ki'i̱n.
  bps-bps: Na libun ani ise Dyu, bay satu to mdà di banwe Fonisya glam di Sirya. Na
    toon fakdo ku Dyisas, fye falwaan i busaw mnè di tingaan.
  mbs-mbs: Kenà sikandin Judiyo, so eg-ikagi te Griego aw timebaw doton te Fenisya
    sakop te probinsya te Sirya. Nemoyò sikandin te ipelowà i Jesus se bosaw lekat
    te batà din.
  tof-tof: Wa Zu kol koke warilürr. Wa Ponisia bwóbdü tómtómólórr, Sirria prrobins
    kugupidü. Yesun we metat yatolórr kolae samu amaniküm tóba óp olomdógab.
  cme-NT: a cãrã-yuɔ wuɔ u donya jĩna daayo‑i u biloŋo-na. Ciɛŋ daa u waa *niɛryiɛŋo.
    U taa u hel Fenisi maŋ dii Siiri mara‑i-na.
  sus-sus: Yuwifi xa mu nu yi ginɛ ra, a nu barixi Siriya Fenisiya nɛ. A naxa Isa
    mayandi, a xa ɲinnɛ keri a xa di ginɛ fɔxɔ ra.
  pon-2006: Ih lihen liki men, e ipwidi Penisia nan wehin Siria. Ih eri peki rehn
    Sises en ketin kausasang ngehn suwedo rehn nah kisin serepeino.
  dad-dad: Kayau anĩ ĩ Grik kayau, ĩ Siria nediwon Fonisia an sina gõ fen. Ĩ, kaa
    sane, ne barai bun tamal iruwauf nigin Jesus nonĩ fiyen.
  zab-NT: Ne gati bniety Israelti laab sino que bniety Sirofenicia laab. Chiy baanlasbɨ
    lo Jesús cuéeny bɨndxabqui láani llindxapeenbɨ.
  jae-jae: Awê tau eŋ Heleno, têna kêkôc eŋ aŋga Suropoinikiaŋa. Eŋ keteŋ Jesu gebe
    êtiŋ ŋalau sec aŋga latuonê êsa êna.
  ksd-ksd: Nam ra vavina a te Elas, ta ra vuna tarai Siropoiniki, i lul ia ba na okole
    vue ra tabaran kan natuna.
  msm-NT: '@see-verse:MRK.007.025'
  myk-myk: Wee cee wu bye Yawutu wɛ, Fenisi shɛn wu bye wii. A wu Yesu ɲɛɛri na wu
    jina wu kɔri yeege wu poro fucɛɛrɛ li ni.
  sbe-sbe: '@see-verse:MRK.007.025'
  mcr-mcr: Apäkä ii Israitqä iquautaŋä ma, qua Siliya-Ponisiya iu imäŋgqe. Ii Iqueä
    yukä iqi qoŋä äuktäuqe, “Nyaqä meqe dŋä quvqä tqäutaŋgi, Si huätä dowatiyä” ätuätä,
    yatŋqä äwikqe.
  cux-NT: N'daata mííⁿ ní nguɛ́ɛ́ yeⁿ'ē ndaata yeⁿ'e 'iiⁿ'yāⁿ Israel naati yeⁿ'e ndaataá
    yeⁿ'e 'iiⁿ'yāⁿ yeⁿ'e yáⁿ'āa Sirofenicia. Ndaā tá ní chiica tá Jesús miiⁿ chí tun'dáa
    yā espíritu yeⁿ'e yááⁿn'guiinūuⁿ yeⁿ'ē n'daataá 'lííⁿ daiya tá.
  tur-YTC: Yahudi olmayan bu kadın Yunanlı olup Suriye-Fenike ırkındandı. İblisi kızından
    kovması için yalvardı.
  san-ITR: svakanyAto bhUtaM nirAkarttAM tasmin vinayaM kR^itavatI|
  bel-N: А жанчына гэтая была Грэчанка, родам Сірафінікіянка; і прасіла яна Яго, каб
    выгнаў дэмана з дачкі ейнай.
  sch-sch: Ma nuvengtenu hah Jentail mi ania, Syria rama Phoenikia ramhuol sûnga
    suok ania. Amanu han a nâinupang sûnga ramkhori rujûlpai pe rangin Jisua kôm
    a ngênna.
  mic-MIQNT: Ula e'pit, mo Lesui'pewi'sgw. Etli ugs'tqamuis Ponisiae'gati. Na gutanji'j
    eteg Silia. E'pit etawaqtmuatl Se'susal getaqqatesgmuan mn'tu'l ugtusl.
  huu-NT: '@see-verse:MRK.007.025'
  jiv-NT: Nu nuwa̱ Israer-shuarcha, Serupinísianmaya̱uyayi. Túmaitiat, nawantru enentáiya̱
    iwianchin ji̱i̱rturkitia tusa Jesusan seamiayi.
  otm-NT: '@see-verse:MRK.007.025'
  dah-dah: Yeŋbe Yuda mar bere moŋ. Siria naŋare niŋ Fonisia taunde gor kawaŋ hiriŋ.
    Be, bere gore waŋ wiriŋ uŋgura ketal urtiŋ miŋyaŋ goyen Yesu beleŋ uŋgura takira
    tiyyeŋ yeŋ eseŋ mere iryiŋ.
  tnk-tnk: '@see-verse:MRK.007.025'
  kpr-kpr: '@see-verse:MRK.007.025'
  san-IAS: svakanyāto bhūtaṁ nirākarttāṁ tasmin vinayaṁ kṛtavatī|
  nho-nho: Te ffine naa seai se Jew, a ia ni haanau i te matakaaina Fonisia iloto
    Syria. A ia ni tani ake ki Jesus ki hanaa te tipua i tana tamariki ffine.
  gym-NT: '@see-verse:MRK.007.025'
  azg-NT: Majoꞌ tachi tsꞌan judíohin, jñonꞌndaa griego itsinin tsanscuꞌñeen, tuihin
    tsjan nnꞌan ndyuaa Sirofenicia. Ndoꞌ vi na jndë tyjeeꞌ juu na mꞌaan Jesús, tcan
    juu na cüjiꞌ jon juu jndyetyiaꞌñeen.
  bhd-bhd: त तै कुआन्श गैर कौमरी थी ते सुरूफिनिकी इलाकेरी थी। तैसां यीशु सेइं मिन्नत
    की कि, “मेरी कुईए पुड़ेरां भूतेरो सायो केड्डी देथ।”
  too-NT: Lā' huan puscāt tū' israelita ixuanī't; xla' sirofenicia ixuanī't. Lā' lej
    ī'squi'ni' talakalhu'mān que camāxtuni'lh ixtzu'ma'jāt huan tlajana'.
  ind-AYT: Wanita itu adalah orang Yunani, lahir di Siro-Fenisia. Dia memohon kepada
    Yesus untuk mengusir keluar setan itu dari anaknya.
  cjo-NT: 'Kaari joriiyo, opoñaaka Shirojeniishiyaki. Okantapaakiri: —Ikyaantakawo
    nishintyo kamaari, petsiyatakoteenawo.'
  nsn-nsn: Doh inggonor kuahono ahik paha Ju, a peng Ponisia tar pang uana uleik i
    Siria. Inggono ke dangata uapopokoho tun tang Iesu tar geil liu tar liouana uasa
    tar tunon.
  san-DEV: स्वकन्यातो भूतं निराकर्त्तां तस्मिन् विनयं कृतवती।
  tna-NT: 'Tueda epuna da judío mahue pia yahua jenetia puina. Beju epuna ja Jesús
    uja bajatana: —Jusiacuinaque einid''u madhada quema ebaquepuna peje jenetia.'
  lid-lid: Badih dah kandriyen tan badu Grik, arile iy badu Siroponisiya, eme iy lelen
    Jises katikahei malawin ndra-in udu la-u nadun badih keme len.
  wim-wim: Nil wanch inana, Jew yaꞌa, nil aak Phoenicia angan aak-ngeey, aak Syria
    angan.
  zga-M: Udala uywa ale Myunani, uva khevumbuho kya Kifoniki. Akhansima ukhuta anchisweme
    imepo imbivi ukhuhuma khu mwaleve.
  yom-yom: Nketo beni wuba muisi Ngelese, wubutukila ku Fenisi didi mu tsi Sili. Wuleba
    Yesu muingi katotula pheve yimbimbi yiba mu muanꞌandi wunketo.
  eng-NNA: '@see-verse:MRK.007.025'
  san-SIN: ස්වකන්‍යාතෝ භූතං නිරාකර්ත්තාං තස්මින් විනයං කෘතවතී|
  yut-yut: Uŋun mɨŋat Israel mɨŋat kɨnda dɨma, uŋun Grik mɨŋat kɨnda Ponisia tetgɨn
    Siria mɨktɨmon altagɨt. Yesu da gwi dakon koŋ yol ɨmjak do bɨsit tebai iyɨgɨt.
  grc-BYZ: ἡ δὲ γυνὴ ἦν Ἑλληνίς, Συροφοινίκισσα τῷ γένει· καὶ ἠρώτα αὐτὸν ἵνα τὸ δαιμόνιον
    ἐκβάλῃ ἐκ τῆς θυγατρὸς αὐτῆς.
  cpc-NT: 'Kaari Judá-mirinka jiroka tsinani, opoñaatya iroori pashiniki nampitsi
    oita Sirofenicia. Okantapaakiri: “Jesús, poshinchagainawo nishinto, opiyarishiritatzi”.'
  nhg-NT: Inu sohuatl oyeya griega hua chajchönteya ipa inu nación de Sirofenicia.
    Tietlötlajtiöya ma quequextelicö demunio ichpuch.
  nya-nya: Mayiyu anali Mhelene, wobadwira ku Fonisia wa ku Siriya. Anamupempha Yesu
    kuti atulutse chiwanda mwa mwana wake.
  ngu-NT: On sihuatl ohualeu ne Sirofenicia niman tlajtohuaya griego. Oquiajmancatlajtlanilij
    Jesús para ma quixtili on xcuajli espíritu yejhuan nemiya ijtic ichpoch.
  kup-kup: '@see-verse:MRK.007.025'
  jid-jid: To, iwa ana ndi u Helleni, u l'me Surofinishan. A bre wu to ju brjia rju
    ni vrenwa ma.
  wmw-wmw: Mwanamuka ire aáwere Yahudi, kwawo kúkiwa Sirufoinike. Akilebela atuwisiwe
    jini mwanawe ire.
  gmv-GGM: Macashaya Ayhude gidonta Girike qaala hasa7iza macashi shin izi yeleta
    gadey Sirofinqe getetes. Izakka yesusay izi nayeppe tuna ayna kesana mala wosadus.
  ssg-ssg: Tel hehin ien i kumahe Ju, i hehin Grik, i takah Penisia taon ti Siria.
    Pahan wanen Jises xaxaweniwa spirit lialun ti leili tel natun.
  zpo-NT: Me ne nanakt tub ngwnaa me sawlazh nu, lee me nak tub me yizhyo Sirofenicia.
    Ngunaab me jabor lo Jesús zee koo Jesús mbi mal lextoo xchap me.
  poy-poy: Mdala ayu kaweriti Mgiriki, mwenikaya gwa Silofainiki. Su kamluwa Yesu
    kamlavii muhinga gwakuwi shamshera kadoda.
  qwh-NT: Y Jesusta rogacorqan wawanpita supëta qarqurinanpaq. Tse warmeqa Grecia
    nasionpitam carqan, Sirofenicia marcacho yuricoq.
  gaw-gaw: Ah amu nug am Grik ah. Nug Panisia wan, Siria gumap̱ig ele amup̱a dayom.
    Nug Jesus gumiṯa uḵa, Jesus Nug heeb, ouḏi nau nug aḏeg beḏup̱a dayom amu uuidḵunu
    ii daye daye oḏ meṯom.
  nca-nca: '@see-verse:MRK.007.025'
  zpz-NTPP: Biñ mñaa zeꞌ walab mbecy guledz tees nac mi mbecy sirofenicia. Orzeꞌ mnishbaam
    lo Jesuuz nu co chum nuras nu bicy ni iꞌñ mi zeꞌ.
  mkj-mkj: Lihn likin men ih, ih noaisikdi Phoenicia nehn wein Syria. Ih ken poaki
    ipen Jesus en kaujjang ngen jausso ipen nah jerpeinno.
  zac-NT: Naꞌa ni na mënë sirofenicia; dizë́ shtëll na griego. Bë́ꞌnëll ruëguë lu
    Jesús guëgú më mëdzabë laꞌni lduꞌu shtsáꞌpëll.
  kyg-kyg: '@see-verse:MRK.007.025'
  kmk-kmk: Satuwa babai bokona Judio ta kaganakan di iFenicia un osa’n ili’d Siria
    ot Griego dit bagbaga na. Impakaasi na un addagon Jesus dit dimunyu’t dit anak
    na.
  cao-NT: Jabi carayana naa yoxa ini quiha, naa Sirofenicia maí conish cato. Mënixo
    tsi quiha Jesu ja bënarianiquë jahuë jahi ó ca yoshi natsëcati.
  bbr-bbr: Kiro asir Juda asir wa. Ko Grik asir, kon mena Fonisia, Siria provins pakan.
    Kos Jisas keser sakau auruwon, “Osou aru isan asinakun wou uru rau, nas oi kur.”
  inb-inb: 'Chi warmi mana karka Israel­manda. Sirofenisia suti alpa­manda karka.
    Kungu­rispa, Jesusta mañarka: —Nuka­pa wam­bra­manda kuku wairata llugsi­chi­puai.'
  hrv-hrv: A žena bijaše Grkinja, Sirofeničanka rodom. I moljaše ga da joj iz kćeri
    istjera zloduha.
  box-NT: ò o fìora a Yeesu le o ɲa a cĩ́ná lén mí hĩ́nló yi. O hã́a mu yínɔń
    zúifù, o ló ho Siiro-Fenisii kɔ̃hṹ yi.
  ote-NT: Nura ꞌbɛhña̱ꞌa̱ himrá me Israel ngueꞌa̱ mrá me Sirofenicia. Nuꞌá̱ bi ba̱ntebi
    ra Jesu pa da ꞌyɛmba ra tsꞌonda̱hi núꞌa̱ mi pɛꞌtsa rá tꞌixu.
  wnu-wnu: Yamangar eng Yuda yurau ue, Grik yamangar wonou ginam qenen eng Ponisia.
    Eng wo Yisast diab ai yamangar wau waramor eng wot musi qamb qamarei.
  zam-NT: Xa'gota ngòc thìb xa'got tith. Ngòc xa'gota mèn nación Sirofenis. Mbi'th
    xa'got loo Jesús. Nalyat mde'b ro xa'gota. Mna'b xa'got di's loo Jesús par ante
    nii Jesús ryo xpii ye'rsin'a loo mza', rsap xa'got.
  zyp-NT: Ma canuno cawh Siria pai Fonisia raang letei a pipaw, Grik cawngsaw a cang.
    A sawcanu chung letei khachia papia pah pawtah Zisu cawh a naw.
  sey-NT: Ja̱o cato Sirofenicia pa̱io pacoꞌë, yequë yeja aco.
  nvm-nvm: Regavo bara iji fu bara Grik rega bu fu ar Siriafonisia ijia nafen. Bara
    iji fu keko ato same Jesu soisoime kua, Ni kaven ise igi kuaga fu kabainun igi
    areme keko vakne kuain.
  mps-mps: Te we aga te Juda hani isąwai we da, aga te Fonisia hani we, te Siria
    moni tǫde elalubo bulu da. Agai te Jisasba i weyu, te agai wegide elalubo dwai
    haubo noma bidi sela sąyao wai.
  seh-seh: Nkazi akhali wa dzindza ya agerego, wa ku dziko ya Siro Finisya. Akaphemba
    kuna Yezu kuti aubuluse nzimu wa kuipa ukhali na mwana wace.
  pab-NT: Hatyo ohiro atyo hakoakitiyolo, sirofenícia yolo atyo. Hoka axene, kasani
    isekohaliti iniyalahare axikaheta ityani nonitata aoka ihiye.
  llg-llg: '@see-verse:MRK.007.025'
  kyf-kyf: '@see-verse:MRK.007.025'
  tpi-tpi: Dispela meri em i bilong narapela lain. Em i bilong ol lain Fonisia i stap
    long kantri Siria. Em i askim Jisas strong long em i mas rausim spirit nogut i
    stap long pikinini meri bilong en.
  mih-NT: Ta ñaha cuan i cacu ña ñuu Sirofenicia. Ta yɨvɨ ñiyɨvɨ hebreo cuu ña. Ta
    i sica ña tumañi iñi sii ra Jesús sa tava ra tatyi cuihna sa ñoho sii zehe ña.
  qvh-NT: '@see-verse:MRK.007.025'
  kms-kms: Nyumbueg te ni Grik wand wund kin. Di ni kumo te Juda segi, ni wute tit
    Ponisia puq munduw ye te kin, ni Siria ris ye. Di ni tende wuraq wundi. Ni Jisas
    simbe wundig ei ni ququ brequ kuwonyumbu nde yenu kin te puaq naind no.
  agn-agn: Ang babay ang na pinangana ong Fenicia ang sakep tang Siria, ig ang bitala
    na Grigo. Belag tanandia ta Judio. Piro nagpakiloy pa ka enged ong ni Jesus ang
    palayasen na kay tang dimoniong siminled ong ana na.
  nhi-NT: Nin siuatzintli amo judía, yeh opouia itich in tlalmeh Sirofenicia. Yeh
    omotlatlautaya inauac Jesús macquixti in amocuali ehecatl tlen ocpiaya nichpocau.
  ttc-NT: Te alon, tetz jun aj nya'tx tijajil Israel b'ix tzajnaq tuq tuj te amaq'
    Siropenesy. Ntons oqet twitz twitz te Jesus tzan tjatz tin te malspirit tuj tanim
    te tal.
  dan-1931: (men Kvinden var græsk*, af Herkomst en Syrofønikerinde), og hun bad ham
    om, at han vilde uddrive den onde Ånd af hendes Datter. { [*d. e. hedensk.] }
  kwj-kwj: “Ai che ga dau himamwale kapwa ma rani ma humbwe.” Ka humwe Girik pe humwe,
    Siriya mapwa ki dau, Finisiya ko tiki tini raro.
  vie-OVCB: van xin Ngài đuổi quỷ cho con gái mình. Bà là người Hy Lạp gốc Sy-rô Phê-ni-xi,
  kze-kze: kwemá íma Yútaa-inimba póna Síriyaa-marava'a Vínísiyaa-naopaken-ininko
    Ísunopa'a iyéna mara'á kumbaéna asiramái séna kesiyáámúnko arumpinkémbá taraváá-kwámbá
    mayauwaaó súwana
  mpj-mpj: Wanti jiinga Juwuparni nyinapayi Panijiyamartaji. Parna Jiriyamartaji Juwukajaluya
    kulira wajalpayi, “Panijiyamartajiya jarntuyuru nyininpa, martu puta, mirtaya
    Mamamili wangka kulira nyinani.” Palunyakura yurntalpa ngarripayi ngarnta maju.
  lbk-lbk: ay nangiseg-ang ta pakaanena nan anito ay inomchan isnan anakna. Nan chey
    ay fafai et Gentil ay Griego nan kalina ya nalpo id Fenisia ay esa'y ili id Siria.
  mto-NT: Ax kaꞌa tseꞌe je̱ ta̱ꞌa̱xta̱jk yꞌisraeejlitjáyuva, sirofeníciait jayu je̱ꞌe̱
    veꞌe. Je̱ꞌe̱ tseꞌe je̱ Jesús du̱munooꞌkxtk je̱tseꞌe je̱ ko̱ꞌo̱yjáyuvap du̱yakpítsumu̱t
    je̱m je̱ ña̱a̱x jyaꞌvin ka̱jxm.
  bzh-bzh: Avëh sënë og avëh yu ngwë, ata Grik avëh beḳo yi vu Ponisia vu distrik
    Suria benedo, lob ya ketaġ vu Yesu bë getii memö geto mena in nalu.
  guj-2017: તે સ્ત્રી ગ્રીક હતી અને સિરિયાનાં ફિનીકિયા કુળની હતી. તેણે પોતાની દીકરીમાંથી
    દુષ્ટાત્માને કાઢવાને તેમને વિનંતી કરી.
  jvn-NT: '@see-verse:MRK.007.025'
  byr-byr: Aꞌmwe saꞌ Gɨrikɨyagaala dadeꞌ Kwaaka Sɨrɨya mwaalya Pɨnɨzɨyaraavɨreꞌ aꞌmwe
    saꞌ naanga yɨwaaraꞌna “Nyɨraavaangavɨre munyɨkɨ yɨmakerɨ duthasaawadeigɨ daaka?”
  ian-ian: Wat taagwa kapma ngepma lagwat. Lɨla angwa ngepma Siria Finisia. Glik walɨnja
    kwundimba wala taagwat. Lɨla tagwa nyamba tavila waagangat savɨlɨndangat Jisas
    kat walɨ.
  hun-hun: Ez az asszony pedig pogány volt, sziroföníciai származású, és kérte őt,
    hogy űzze ki a leányából az ördögöt.
  mcf-NT: 'Isadaidpembon chido nidaid Sidopenisia caid yacnocquid niondash. Aidi Esus
    tauebudash: —Con champi mayan icsa dapuduedaid dapudueme, tsusio, —quepondash
    comapenen chiec.'
  kjs-kjs: Mogo nogona agiri Siria adare Fonisia ename madisa. Gore nipu Yesumi mo
    nogo-para pia remo rakepeainalo kogelisa.
  mni-mni: Nupi adu Syria-gi Phoenicia-da pokpa Greek ningolni. Mahakki machanupidagi
    lai phattaba adu tanthokpinaba nupi aduna Ibungoda haijarammi.
  yad-NT: 'Jiñu̱y vaturu̱y vicha̱da ma̱tyoda, Siruvenísiyamusiñu̱y. Nadayasanta̱dani̱:
    “Ya̱jatyani̱ bayantu radyetuvavichi̱.”'
  mxb-NT: Ta kúúán iin ñáꞌa̱ káꞌa̱n to̱ꞌon griego, chi̱ iin ñoo nákaa̱ chí kuendá
    Sirofenicia diꞌa kúú ñooa̱n. Dá ni̱ seí ndaꞌí ña̱ noo̱ Jesús ña̱ ná taó ná espíritu
    kini nákaa̱ ini de̱ꞌe diꞌáa̱n.
  pon-2006A: Ih lihen liki men, e ipwidi Penisia nan wehin Siria. Ih eri peki rehn
    Sises en ketin kausasang ngehn suwedo rehn nah kisin serepeino.
  maq-NT: Na vëhë jan ne, xutaxin na, na ladu tsëhë distritu Sirofenisia, hacuiin
    na xuta tjë rë Israel. Hane cafehya na cojo Jesús xi cuaxë me xitsehen xi jiya
    cahntsua xahasen rë na quihndi rë na.
  hto-hto: Afengo judío ingóñede; jɨáɨzie ingo. Afengo énɨe mámecɨ Sirofenicia. Afengo
    jízamo ite fɨénide jóriaɨ óllena Jesumo jɨcade.
  por-BRBSL: Agora a mulher era uma grega, uma sírio-fenícia por raça. Ela implorou-lhe
    que ele expulsasse o demônio de sua filha.
  ces-NKB: (ta žena byla Řekyně, rodem Syrofeničanka) a prosila ho, aby z její dcery
    vyhnal démona.
  cui-cui: 'Barapowa penanapaincha poponaewayo pecueicueijeixae griegojume. Jopa judiomonae
    jitowayiyo. Bapowa sirofeniciamonaewayo naexana penaexanaexae Fenicia tomaratha
    xua Siria nacuatha. Barapowa Jesús wʉcatsi jeye: —Taxantiyo inta taitawere cauri,
    jei barapowa.'
  boj-2014: Uŋa di a Grik qaji. A Juda uŋa sai. A Siria sawaq di ŋambabej. A Fonisia
    qure qaji. A Yesus aqa areq di siŋga pulutosiq a waiŋyoqnsiqa minjoqnej, “Ni na
    mondor uge di wiyimqa a ijo aŋgro uratosim ulaŋqas.”
  eng-OEBUS: the woman was a foreigner, from Syrian Phoenicia – and she begged him
    to drive the demon out of her daughter.
  eri-eri: Aita waha no ha mata eteha. Aita waha no Fonisiaha, kantri Siria langa
    inyina. No mago hauri inyaba so fuwei nomo bona beele danga bagu Yesus isoki tuwai.
  aly-aly: '@see-verse:MRK.007.025'
  wiu-wiu: Einatoapa Geriki yatene atoa Sairoponisia take opianeya. Nitane atoame
    Yesu kowitikome okome anu konoke awitane ipono neme takoa wetekakoa ta-kale
  swe-swe: Det var en grekisk kvinna [hedning, icke-jude] av syrisk-fenicisk härkomst
    [hon var från nuvarande Libanon]. Hon bad (gång på gång) att Jesus skulle driva
    ut den onde anden ur hennes dotter.
  cth-cth: Ahni teh Jentel napui Syrophoenician kho ka khe e doeh.
  mti-mti: Me at Griisu vesinawa, at Siria Penisia apa yaine. Me Iesu gumbe nun wane
    airapu kukaeba gwaitawa gumbe dauwag aitan oya.
  pad-NT: '@see-verse:MRK.007.025'
  twi-twi: Ɔbea no srɛɛ no sɛ ontu saa honhommɔne no mfi ne ba no mu mma no. Na saa
    ɔbea yi yɛ Helani a wɔwoo no wɔ Siro-Foinike.
  hlt-hlt: Tahae kah huta tah Syrophoenician kah Greek hoel la om dae a canu kah rhaithae
    te haek sak ham Jesuh a hloep.
  tbz-SIM: Dɛ kóo nitipòkù do í tú Sifubɛ kó kubotí kou bɛ̀ do ò pɛitɛ́ Siirii nwe
    Fenisii kó dihɛì miɛkɛ. Kòo bɑ́ntɛ̀ Yesu kɛ dɔ̀ wèe dennɛ dibɔɔ̀ dìì tɑ o sɑpùmbirɛ.
  san-GUJ: સ્વકન્યાતો ભૂતં નિરાકર્ત્તાં તસ્મિન્ વિનયં કૃતવતી|
  amx-amx: '@see-verse:MRK.007.025'
  ake-NT: Pʉse rɨ uri'san esi'pʉ ka'kʉran pe, tʉron nɨ pata winon, iyentusa' Poni'siya,
    Siriya yawon yau, mɨrɨpan uya Sises pawana'tɨ'pʉ ɨri a'kwarʉ enpa'kato' pe iya
    tʉmʉre yapai.
  qvn-NT: “Tayta, wawäpitanar lutan espirituta gargolay” nir.
  tku-NT: Puscāt jā israelita ixuanī't; xla' sirofenicia ixuanī't. Ī'squi'ni' talakalhu'mān
    camāxtuni'lh ixtzu'ma'jāt jā tzeya ū'ni'.
  bjk-bjk: Ina une na, ine a Grik (kawaim bara ine a Judeia). Toxo kip ine ri Ponisia
    i kis kö xönö raxin Siria. Ixo tenge maris urungan te Jisas sua irewe a tano saban
    kalik balik lik kine.
  msy-2020: Amizir kam, an amebam Fonisian Distrighɨn a bate. A Sirian danganir ekiamɨn
    aven itir distrik. Egha a Grighɨn akam mɨgei. A duar kurar an guivim gapazazim
    batoghasa Iesus mɨgɨava a gakaghori.
  bpr-bpr: Na ise Dyu i libun ayé du ise ku Israél i gumdàan, bay di banwe dnagit
    Fonisya glam di Sirya. Na fakdo kenen di ku Dyisas fye falwàan i busaw di ngàan
    ayé.
  cle-NT: Griega ba² na³lɨ́y⁴ mɨ́³ ja̱³, há⁴hí̱³ israelita. Vó⁴ sirofenicia ba² gá⁴sa̱y³.
    Mɨ²ja̱³ gá⁴ŋɨɨ́³ jmɨ²heé¹ chiáh² Jesús ja̱³ hi³ hu̱² hí⁴dxɨy³ hi³há⁴dxúy⁴ hi³
    heey³² ja̱á̱²mɨɨ¹ ja̱³.
  txq-txq: '@see-verse:MRK.007.025'
  aaz-aaz: '@see-verse:MRK.007.025'
  qup-NT: '@see-verse:MRK.007.025'
  dop-dop: Alʋ ɩnɩ ɩ kɛ́ piitim lɛmpɩ tʋ kɛ́. Pɑ lʋlɑ-ɩ Fenisii kɛ Silii tɛtʋ tɑɑ.
    Ḿpʋ́ɣʋ́ ɑlʋ ɩnɩ ɩ tɔmɑ Yesu sɩ ɩ́ tɔɣɔnɩ ɩ pɛɛliyɑ ŋkɛ kɑ ɩlɔɣɔʋ.
  azb-azb: Bu qadın Suriya Finikiyasında doğulmuş bir Yunan idi. O, İsaya yalvardı
    ki, qızından cini çıxartsın.
  eng-DBY: (and the woman was a Greek, Syrophenician by race), and asked him that
    he would cast the demon out of her daughter.
  guo-NT: '@see-verse:MRK.007.025'
  hla-hla: A tahol teka a toun Pinisia tara provins i Siria, a pal barebana i tanen
    te halhal ria turu Jiu. Ba nonei e ranga hatatagi-torina tere Iesu te go tsuga
    ba menien a mate a omi tara tsi pien tahol i tanen.
  mav-NT: Kat pote tomẽpyt piit piat ahiag putsit hamo toikat Iesui. Mi'i hary­poria
    so yt Iesui ywania i ra'yn. Wẽtup setama pywiat mekewat yi Siru­we­nisia pywiat.
    Mi'i ti wẽtup ta'yn ipusu Kereku ehay puo ra'yn ihay. Mi'i hawyi toipuẽti Iesui
    hawyi tuwe­pỹ­'ã­tutuk howa kape hawyi to'e — Mimi e etihep o ten ahiag uimẽpyt
    piit piat e haty wo.
  kpf-kpf: Ambân zo Grik ambân Siro-Poinika gokŋâ. Zâk bâratŋaŋgât umŋan wâke zo molibapkât
    dukuip.
  ppo-ppo: A̧ta Juda fake mei, Krik so a̧ hamané Siria haemó tȩne be Fonisiamó dealepó.
    Ai so Yesu daale ao̧mó fió mulu duraalu, “Ya̧lo senaale tua̧mó betere dowi kepe
    naao ho̧konaasepé,” du betalepó.
  hin-2017: यह यूनानी और सुरूफ‍िनीकी जाति की थी; और उसने उससे विनती की, कि मेरी बेटी
    में से दुष्टात्मा निकाल दे।
  bef-bef: 'Ana aꞌmo Giliki ka nolina to Silia metogati Fonisia nagaꞌi nohina aꞌi
    yabe. Ai Yesutoga lipito minoto, amuya moloto ma luto loka hoba hoba huto minoꞌehina:
    Oho. Paꞌnimofihi komopaꞌagu foipa fele tito nohina kai leꞌmo heꞌmi etobo.'
  amm-amm: Nonani nukonu mo asi siya nukonu na, Fonisiya nukonu. Fonisiya mo Siliya
    nokoni asifa na. Isisoso na imalo tumoki, “Yani alu woi, na pofasisomono. Popuwa
    na pamiyaikiyowaiso.”
  zaj-zaj: Mtwanzi ija kakala Mmhazi, yaleligwe ng'ambu ya Foinike muisi ya Silia.
    Kaiyalala yomulongela Yesu yamuwinge ikinyamkela yam'vamhile mndele wake.
  chq-NT: '''In tsamɨ́² lo galiseein²¹ Sirofenicia, jon'' tsagoo¹ tsá² seein²¹ Israel.
    Pe gajó² jamɨɨ¹ɨ tyani Jesús wa''a tyii²in ''ido ''in ''lɨɨi''³ ''yuui alma tya''
    jóon¹on.'
  swp-swp: 'Sine wa Heleni sinena, boga Penesia Suria: ia ie riba gadogadora ia arinai,
    ia demoni natuna siu ne arinai bena i aiduiei.'
  bjr-bjr: Mi anaaseefa Siria maqa maaqakiqari Fooeenisia maqusaki kambiqarafa aanaamuru
    anaasee marufa anireenoo Yisunara qini qiraamuna aunduraki mari qooqeenaa faafasaaqa
    aqiqainanoo rafudamaki fuani fee qufanoo Yisufa qimaminoo qinau.
  aby-aby: I awekae Du aweka me, dawae Guriki orofa aweka. Danu goiye Sairofonisia.
    I awekama faraada ifoma kodudu yanaike eenu wei, i seidaninu merama imumu nanu
    arumanakunu imuka ubarenaro ibinua we beraa wei.
  eng-YLT: and the woman was a Greek, a Syro-Phenician by nation — and was asking
    him, that the demon he may cast forth out of her daughter.
  jni-jni: Eni me u Bahiliniya mani maze ageme u Finikiya a Yome a Yeh Yemo Mayega
    masuri maha maka tirame tari masusome abergeme avaname.
  kne-kne: et nanpakpakaasi ta pakaanena din anito ay kinmapet sin anak na. Din babai
    ay nay et naianak ed Fenicia ay sinakop di Syria et Griego di kali na.
  tgj-tgj: Nyimvmvvga angv Jentail go, Sairia gv Poenesia mooku lo bvngnam go. Nw
    Jisunyi koodwkkrwkla kooto ninyigv kuunyijar lo alvmanv dow a charkak jilabv vla
    minto.
  wat-wat: '@see-verse:MRK.007.025'
  gui-NT: Jae co metei sirofenicia griega pe imiari vae. Jae oyerure Jesús pe omondo
    vaera aña imembɨ güi.
  quc-TT: Ri ixoq aj Fenicia rech ri tinimit Siria xuta toqꞌobꞌ che ri Jesús rech
    kakunax ri ral.
  heg-NTPO: '@see-verse:MRK.007.025'
  ptu-ptu: '@see-verse:MRK.007.025'
  bzd-NTPO: 'Alaköl e'' kë̀ dör judiowak, e'' dör ká̱ kiè Sirofenicia e'' wak. Eta̱
    ikköché ie'' wöa̱: —Aknama tso'' ye'' alà busi a̱ e'' trë''ú̱shkar.'
  kwf-kwf: Ma na kini neꞋeri, nia neꞋe kini kwaita faꞋasia Ꞌi Fonisia saena tuaꞋa
    Ꞌi Siria, ma nia noaꞋa laꞋu kini Jiu, ma na sariꞋi nia na ano Ꞌi ru taꞋa nia ruꞋufia.
    ꞋUnaꞋeri, nia ka amasia sa Jesus fasi Ꞌiri ke ifulani na ano Ꞌi ru taꞋa neꞋeri
    faꞋasia na sariꞋi nia.
  eng-WYC-2017: And the woman was heathen, of the generation of Syrophenician. And
    she prayed him, that he would cast out a devil from her daughter.
  eng-WMBB: Now the woman was a Greek, a Syrophoenician by race. She begged him that
    he would cast the demon out of her daughter.
  zat-NTPS: Nu'ula nigá quebe naque̱' nu'ula judío. Naque̱' nu'ula chee̱ tu xe̱zre
    nababa xe̱zr la xu Sirofenicia. Bzrine̱' lau Jesús, na' gunabe̱' Le̱' xebéaje̱'
    be' xriwe̱' da xu'u zrí'ine̱' nu'ula.
  spp-spp: '@see-verse:MRK.007.025'
  zty-NTPS: No'len' bi nake' benne' judío, san nbabe' benách Sirofenisia ka'. Góta'yoele'
    Jesusen' yebeje' be' x̱iwen' yo'o x̱kwide' no'le chien'.
  mek-mek: Egaꞌina papiega auga Grik papiega, Siria, Fenisia agogai emauni. Isa Iesu
    egoi penia gauga papiega alogai tiapolo gapapealaisa eoma.
  aey-aey: Caja eu Juda qee, uqa anag Finisia hatu ono basen. Siria age Finisia cofdoin.
    Odimei uqa Jisas buga me qee ateg deweg bilen eu ititacdocnu ninidon.
  urd-GVH: और उसने ईसा से गुज़ारिश की, “बदरूह को मेरी बेटी में से निकाल दें।” लेकिन
    वह औरत यूनानी थी और सूरुफ़ेनीके के इलाक़े में पैदा हुई थी,
  ycn-ycn: '@see-verse:MRK.007.025'
  djr-djr: '@see-verse:MRK.007.025'
  kvg-kvg: Ngunuk sævam, bawan vini-ák. Glik sævám. Finisia taon-té guqán, Silia
    plovins-te ndøgo. Yaq ndugu Yesu āv gumbøe-viám nqǽgo, “Nogu yu, ambá nqova
    soqa qombo-ngeatamín?”
  rug-rug: Sa barikaleqe hie si na tie Quriki d, ba na podona tu pa kali pinaqaha
    Ponisia pa popoa Siria, meke tepa ia sa se Zisu pude hipuru pania sa tomate kaleana
    koasa tuna vineki, gua.
  hop-NT: I’ hak wuhti pep tutskwat ep sínonik̇aṅw, Greek‐sinmuy lavayiyamuy yuaata;
    nihqe as pam put tiyat aṅqw nukpanhikwsit hóroknaniqat okiw aw nāwakna.
  san-URD: سْوَکَنْیاتو بھُوتَں نِراکَرْتّاں تَسْمِنْ وِنَیَں کرِتَوَتِی۔
  heb-LB: והתחננה לפניו שיגרש את השד מבתה (היא הייתה אישה יוונית שנולדה בפניקיה הסורית).
  caf-NT: Ndun ts'eke nts'iz de haínya 'ink'ez 'en Greek buk'una'a yalhtuk 'ink'ez
    Phonecia, Syria whuz'ai, 'et whuzdli 'int'ah. 'En Sizi yughu tédudlih hoh ndi
    yúlhni, “Ntsi' nudúdeh, 'i suyats'e buts'u hanaínonyoot.”
  mio-NT: Inga tucu ñivi cuu ña, vati iti ñuhun sirofenisa ni cacu ña. Chica ñacan
    iin tu manini chi ra Jesuu, vati na cua tava ra tati cuihna ñuhun anima sehe ña,
  srq-NT: Sirofenisia jenda que ae ra. Judío eã tuchɨ que ae ra. Griego cheẽ ño ngue
    echeẽ nde. —Aba checuayã ɨcuã ejea rã seriirĩ sɨ, ɨ tuchɨ que Jesús je ra.
  kje-NT: '@see-verse:MRK.007.025'
  bmk-bmk: '@see-verse:MRK.007.025'
  gaz-gaz: Dubartittiinis nama Giriik, kan biyya Sooriyaa keessatti Finiiqeetti dhalatee
    dha. Isheen akka inni intala ishee keessaa hafuura hamaa sana baasuuf Yesuusin
    kadhatte.
  kud-kud: '@see-verse:MRK.007.025'
  urb-NT: '@see-verse:MRK.007.025'
  fra-LSG: 'Cette femme était grecque, syro-phénicienne d’origine. Elle le pria de
    chasser le démon hors de sa fille. Jésus lui dit:'
  san-HK: svakanyAto bhUtaM nirAkarttAM tasmin vinayaM kRtavatI|
  cak-SNT: Ri jun ixok reꞌ man israelita ta. Jajaꞌ jun aj-Sirofenicia. Pero xalxuquieꞌ
    chukul rakan ri Jesús chi xucꞌutuj favor cha chi talasaj-el ri itziel espíritu
    riqꞌuin ri ral.
  uvh-uvh: '@see-verse:MRK.007.025'
  ino-ino: Ani ana Isaleli nofi a o'mai'niki Kali'ki ake ne'aiya ana Finisia nofi
    a'mo'a Silia koteka anakeno a'mafa'ne'amo aipafi mai'nea Sata afe alino atalese
    huno'ae ke huno afike afike nehe.
  gnn-gnn: '@see-verse:MRK.007.025'
  yal-yal: Girɛki kaan nan yi na ɲaxanla ra, a bari Siriya-Fenisa yamanan nin. A yi
    Yesu mafan, a xa yinnan kedi a dii tɛmɛn fɔxɔ ra.
  cnt-NT: '''Éi₂ jme₁lɨ́n₄ jan₂ ''io₅₄ griega, i₂chan₂ Sirofenicia. Jaun₂ ca₂mɨ₃ ca₂tsɨ́''₃
    ''éi₂ a₂dsɨ₃dsein₂₃ je₂na''₅₄ quió''₅ chi''₂ quiáin₅.'
  tif-tif: '@see-verse:MRK.007.025'
  nlx-nlx: ती बायकु बिगेर यहुदि एती, एने सीरीयान फीनीके माय पायदा ईयेल एती। ती यीशुह
    विन्ता केरी काय मार सोरी माय रेन बुतड़ाह निकाल दे।
  apw-NT: Isdzánhíí Greek k’ehgo yałti’ihi, Syropheníciadí’ gólíni; áń nábokąąh, Ch’iidn
    shizhaazhé biyi’ golíni biyi’dí’ hanyóód, biłṉiigo.
  gum-gum: Tru ishuube griega Sirofenicia pirausriig købig køn. Truibe arrua, nui
    nimbasrweinukkurri kwaimandzigwan wegutcha chib, Jesúswan miab megaben,
  not-NT: 'Iroro cagaro jorío, opaniaca cara Sirojenisiaquë. Pamanopëri Jesos: —Inancaro
    nasinto camagari. Pigátajinero.'
  plu-plu: 'Eg tino eg grésiyano. Eg amadga wayk ayhté Siru‐fenísiyamnaw. Eg danuh
    atere, eg amnihswe ta git. Eg awna: ―Kiyapwiye, uyá amnihun. Pekkisnaba ner wapitye
    ayteke gupititak nukamkayh.'
  iou-iou: '@see-verse:MRK.007.025'
  ntp-NT: Daidʌ ʌooqui ñioocaitadai giliego ñiooquidʌ daidʌ ʌrSiropeniisiʌrʌ oidacamicatadai.
    Divia ʌgai dai daañimi ʌSuusi sai vusaidana ʌDiaavora tʌaañicarudʌ maradʌaiñdʌrʌ.
  rai-rai: A tabuan maa a tabuan Ponikaa taanga u ra papaar Siria, wakir ia a tabuan
    Iudaia. I aaring Iesu kupi in lu irok wa a tabaraan kon natunalik.
  haw-1868: He wahine Helene ia, no ka aina o Poinikia ma Suria mai; a nonoi ae la
    oia ia ia, e mahiki aku i ka daimonio, mailoko aku o kana kaikamahine.
  ffm-ffm: Oon debbo wanaa Yahuudiyanke, o leɲol Sirifenisi'en. O ɲaagii Iisaa itta
    ladde ndee e ɓiyiiko oo.
  arb-NAV: وَكَانَتِ الْمَرْأَةُ كَنْعَانِيَّةً، مِنْ أَصْلٍ سُورِيٍّ فِينِيقِيٍّ،
    وَتَوَسَّلَتْ إِلَيْهِ أَنْ يَطْرُدَ الشَّيْطَانَ مِنِ ابْنَتِهَا.
  cop-CNT: ϯ⳿ⲥϩⲓⲙⲓ ⲇⲉ ⲛⲉ Ⲟⲩⲉⲓⲛⲓⲛ ⲧⲉ ⳿ⲛⲧⲉ Ⲧ̇ⲥⲩⲣⲓ⳿ⲁ ⲡⲉⲥⲅⲉⲛⲟⲥ ⲟⲩ ⳿ⲉⲃⲟⲗϧⲉⲛ ϯⲪⲟⲓⲛⲓⲕⲏ ⲡⲉ
    ⲟⲩⲟϩ ⲛⲁⲥϯϩⲟ ⳿ⲉⲣⲟϥ ⲡⲉ ϩⲓⲛⲁ ⳿ⲛⲧⲉϥϩⲓ ⲡⲓⲇⲉⲙⲱⲛ ⳿ⲉⲃⲟⲗ ϧⲉⲛ ⲧⲉⲥϣⲉⲣⲓ.
  sri-sri: 'Igo judío masako ããrĩbeo ããrĩyupo. Igo deyoadea makã Sirofenicia wãĩkʉri
    makã ããrĩyuro. Jesús pʉro ñadʉkʉpuri merã ejamejãja, ĩgʉ̃rẽ sẽrẽyupo: —Wãtĩrẽ
    béowiuka yʉ magõrẽ! ãrĩyupo.'
  nal-nal: A ravin angkanaan, naan a ravin in Grik, ma di luk naan la non laba Fonisia
    la provins Siria. Naan ka maainung Iesu xuna xana mof pizin a zapalaau ina xa
    ragul natifna.
  kyq-kyq: '@see-verse:MRK.007.025'
  kwd-kwd: Ma nga noni lo'oori, ngaia nga noni fa'asia 'i Fonisia 'ubulana ririfua
    'i Siria, ma ngaia nga noni na 'ame Jiu, ma nga laari'i aana nga adalo 'e bo'ea.
    Ngai lo'oo, ngaia 'e soea la Jisas 'ani belote'enia nga adalo lo'oori fa'asia
    nga laari'i aana.
  ded-ded: '@see-verse:MRK.007.025'
  ewe-ewe: heɖe kuku nɛ be wòanya gbɔgbɔ vɔ̃ la do goe le ye vi la me. Nyɔnu la nye
    Sirofoiniketɔ.
  nuy-nuy: Ngarraagi-yung ngarra-maṉinyung waari angi-Jew-magaa. Anubani ana-lhal
    wu-mayina Phonecia, wubani-rruj a-Syria-yinyung. Ngarraagi-yung ngunu-yandhawiwandi,
    “Bawu-barawudang wubani a-man.gurrg ngarrubagi-yung ngarra-marig-jinyung,” ngi-yamayn.
  cop-BHC: ϮⲤϨⲒⲘⲒ ⲆⲈ ⲚⲈⲞⲨⲈⲒⲚⲒⲚ ⲚⲦⲈⲚ ⲤⲨⲢⲒⲀ ⲠⲈⲤⲄⲈⲚⲞⲤ ⲞⲨⲈⲂⲞⲖ ϦⲈⲚϮⲪⲞⲒⲚⲒⲔⲎ ⲠⲈ ⲞⲨⲞϨ ⲚⲀⲤϮϨⲞ
    ⲈⲢⲞϤ ϨⲒⲚⲀ ⲚⲦⲈϤϨⲒ ⲆⲈⲘⲰⲚ ⲈⲂⲞⲖ ⲚⲦⲈⲤϢⲈⲢⲒ
  buk-buk: '@see-verse:MRK.007.025'
  pri-NT: '@see-verse:MRK.007.025'
  zpq-NT: No'olen' goque' beṉe' zito', no'ole Sirofenicia. Gwyeje' gwṉabde' Jesúsen'
    yebeje' da' x̱igüe' yo'o nyaz bi' no'ol c̱hen'.
  por-TFT: Esta mulher, cujos antepassados vieram do país da Grécia, nasceu na região
    da cidade de Fenícia, no distrito da Síria, e não era judia. Foi ela que pediu
    para Jesus expulsar o espírito mau da sua filha.
  gwi-NT: Jii tr'injaa, Jews nilii kwaa, nahkat gwachoo Syria gwizhit nahkat gwatsal
    goo'aii Phoenicia goozhii gwizhit vagoodlit. Ąįį Jesus ts'ą' ch'oodiikwat, “Shigii
    nich'it vizhit ch'anky'aa iizųų dhidii cheehahchįį,” yahnyąą.
  gvn-gvn: Jew-warra wawu kari bamanka walu-yinduynku. Jana yalamal, “Jana bama yala
    kaya.” Yinya jalbu Jew kari, nyulu Gentile, nyungu bubu yubaku townbu jambulbu
    Tyre, and Sidon, nyungu kuku Greek. Jalbungku Jesusanda babajin, “Yundu ngaykundumun
    kangkalandamun dukurrmun dubu kangangarr?”
  nna-nna: '@see-verse:MRK.007.025'
  nhy-NT: Yin tenan mach judía, yej oyeka griega, otlakatke Sirofenicia. Okitlatlawtij
    in Jesús ma kikixtili in ichpoch in ejekatl mach kuale.
  asm-FB: সেই তিৰোতা গৰাকী গ্ৰীক আছিল আৰু জাতিত চৰফৈনীকীয়া। তাইৰ জীয়েকৰ পৰা ভূত
    খেদাবলৈ তাই তেওঁক অনুৰোধ কৰিলে।
  okv-okv: Iesu ta utu ta beto gombuto Iesu na iae ta jo ta ahihi sapura avo kurumbaja
    penunu enu,
  mxt-NT: Ñaha cuan, ñaha inga ñuu cuví ña, ñaha ñuu Sirofenicia cuví ña. Quichi̱
    ña ta chacú ndahvi ña nuu ra Jesús na tava ra tatyi ña vaha cha yɨhɨ́ añima sehe
    ña.
  tzo-NT: Ma'uc jchi'il ti antse, ja' yanlum ants. Sirofenicia sbi ti slumale. Manchuc
    mi mu xtun ono'ox chquiltutic scotol ti yanlum crixchanoetique ho'ontutic ti judiountutique,
    ti antse laj yalbe vocol ti Jesuse ti ac'o loq'uesbatuc pucuj ti yo'nton ti stsebe.
  ind-AGS: Ibu itu bukan orang Yahudi. Dia berasal dari daerah Fenisia di provinsi
    Siria dan dia berbahasa Yunani. Dia memohon kepada Yesus untuk mengusir roh jahat
    dari anaknya.
  omw-omw: Mwi nraakyeva nai mpo mwatanaava hia Iutaa mwatanaava, mwiva Siria mwata
    Ponisiaqi mwatatova varura. Mwi nraakyeva Iesusirara po kye tiro tiqaro, Ni naamwunraqitaira
    vaana titairaro qatinani nritaraarive, tiro.
  yrb-yrb: I aweta Ju aweta me, dana Guriki aweta. Danu suna Sairofonisia. I aweta
    fareda arubi uite nui wei, i seitaninu mui siosa imumu nanu arumanu ubarero rewoe
    ibinua we beraro anibi wei.
  maa-NT: tsibítsi'ba‑la̱ nga ko̱chrjekàjiìn jè ini̱ma̱ ch'o xi tíjiìn ini̱ma̱‑la̱
    tsòti. Jè chjo̱ón, ya̱á i̱'nde‑la̱ ñánda 'mì Sirofenicia; 'én griego chja̱.
  mcq-mcq: Napara kajaho Jenitaru Sairopinisia ora. Hu jarima ijá ꞌwama Nuni ꞌapaja
    ꞌavena sisea ajiviꞌinakúne A ꞌavena sisea tasioma piꞌonamaha ꞌwamana.
  sus-A: يُوِقِ شَ مُ نُ يِ فِنّ رَ، عَ نُ بَرِشِ سِرِيَ قٍنِسِيَ نّ. عَ نَشَ عِسَ
    مَيَندِ، عَ شَ حِننّ كٍرِ عَ شَ دِ فِنّ قْشْ رَ.
  jpn-1965: この女はギリシヤ人で、スロ・フェニキヤの生まれであった。そして、自分の娘から悪霊を追い出してくださるようにイエスに願い続けた。
  fra-SBL: Cette femme était grecque, de race syrophénicienne. Elle le pria de chasser
    le démon de sa fille.
  yka-yka: Dumaˈin Yahudi dende miyaˈan saguwaˈ bangsa Penisiya iye, amban lahat Siriya.
    Na, manjari pabuyuˈ-buyuˈ iye pu si Isa pakipaluwasne seyitanin amban anaknen.
  mle-mle: Li niki tipa taakwa. Liki tip Panisiya, Siriya tamiyaam. A taakw nimadib
    bas silid Jisasak di liki takwa nyan liki mawulaar yidi wudib kwurin yakidikik.
  shp-NTPO: Ja ainbora iká iki judíoma, Sirofeniciainoa. Janra Jesús yokákin jeneyamaa
    iki, jawen bake meranoa yoshin pikoxonon ixon.
  aom-aom: 'Röhu ë magonahoho hu bogo Jew rajo magonahehu jioromo bogo Jew rajo jöehu
    jövaje magonahehu jioꞌi aꞌi hesi saꞌa börömoho Syria jioꞌi hesi saꞌa biseꞌoho
    Phoenicia jiadeje. Hu bogo Jew rajoho jiëꞌe Iesu ëninamiromo uavadeje: Ajemiromo
    a sisë nasi aboji hesirire jiajoho rarovöꞌöjego vaꞌirajo.'
  geb-geb: Mba mbik Sairofonisia fhaiŋ mbik ma, ana Grik kamara nzuai. Ana khaŋ tɨgav
    wo kambiga tɨn mba ŋina mbatɨga vharvhara zav Zisas ga nzuai.
  eng-WYCLIFFE: And the womman was hethen, of the generacioun of Sirofenyce. And sche
    preiede hym, that he wolde caste out a deuel fro hir douyter.
  bsj-bsj: Nawiye kino biten cirka, twe luweceu kino foniciya. ken Yecu a cokum yowako
    bwirko mor bwiye bi bwece
  cak-cak: Ri ixok ri' man israelita ta, xa vinak aj-Sirofenicia, y nuc'utuj ruquemelal
    che chi trelesaj ri itzel espíritu riq'uin ri ral.
  chf-NT: Ni ixic jiniba ixpäpä'cab une, ya' päncäbi tä Sirofenicia. C'oti u c'atben
    aj Jesús que u pa'säben tzuc pixan tuyac'o jixic ch'oc.
  tlf-tlf: '@see-verse:MRK.007.025'
  piu-2006: '@see-verse:MRK.007.025'
  poh-NT: 'Reꞌ ixok wili ar asjanak cho pan tinamit Peni̱sya ribihnal reꞌ wilic pa
    riyukꞌul i Si̱ro eh reꞌ take rima̱m ratiꞌt aj criye̱co take. Jeꞌ reꞌ ajic to̱b
    ta reꞌreꞌ maꞌ reꞌ ta ra̱ꞌ riꞌsil cho i maꞌ Israhel, jeꞌ wili xipahkaj reh Jesus
    naxponic ru̱cꞌ: «Ha̱w chacuy chawesaj lok wi̱n i maꞌ tob laj uxlabal wilic ru̱cꞌ
    i wixkꞌu̱n, nqui reh.'
  tue-tue: 'Coo judíoayo mee niiyigo. Sirofenicia ditapʉ bauárigo niiyigo. Jesuré
    sãĩyígo: —Wãtĩrẽ cõãwionecoya yʉʉ macõrẽ, jĩĩyigo.'
  bjp-bjp: Fifin ae biil i fafnan Iudaia, i fafnan Fonisia tina nanal na Siria. Ka
    sising Iesu le in tel ufu tanwa laulau koseng keleflik kia.
  xon-xon: '@see-verse:MRK.007.025'
  tzo-ZNT: Ti antse maꞌuc la jchiꞌilticotic ta israelal, tey noꞌox la liquem ta Sirofenícia.
    ―Abulajan, loqꞌuesbon pucuj ta yoꞌon li jtsebe ―xut la ti Jesuse.
  mpm-NT: Ti ansu ñaꞌan ñuu Israel kuu ña, chi ñaꞌan ñuu Sirofenicia kuu ña, chi yukan
    ni kaku ña. Ti jikantaꞌu ña nuu Jesús ja na kenchaa ya tachi xaan jnaꞌan ɨɨn seꞌe
    sɨꞌɨ ña.
  ots-NT: Car bbɛjña̱‑ca̱ jí̱ múr israelita. Múr mi̱ngu̱ car jöy Fenicia. Guegue bi
    guati car Jesús cja̱ bi dyöjpi tzʉ di fonguibi car ttzonda̱ji̱ ca xquí zʉh cár
    tti̱xu̱.
  hoy-hoy: ई आर्त गैरयहूदी ईरोर अदिक सीरिया अन्द फिनीकी दा पैदा आगीदुर. आक यीशु से
    विनती माळदुर कि नान पोर इन दा टु दुष्टआत्मा तेगुकोळ.
  amo-amo: Uwani une ushono hẹllen iyawa ri unuzu surofinikiya, a fuu ye acara anutun
    agbergene nanyan shune me.
  pjt-pjt: Minyma nyara paluṟu Jew wiya ngura ini Panitjiyalanguṟu. Munu minyma paluṟu
    Jesula puḻkaṟa ngatjiningi palumpa uṉṯalpanguṟu mamu paintjaku.
  cwe-cwe: Mwanamke iyo kakala Muyunani, yalekigwe mudibululu da Silofoinike uko Siliya.
    Kampula Yesu yamulave mndele wake chinyamkela.
  daa-NT: '@see-verse:MRK.007.025'
  mlp-mlp: Aw na in Juda aw a haiqta. In Grik nan bilaqyaqta teq in ago uliq diq Fonisiya
    saw Siriya-ibta. In lehim Yesus anogib abakbakan ulum laquwim turad tubulonyaq,
    Ni ya imiy aholib bugaw meqinta usaqta na muzid lehan haqyaq.
  ape-C: Okwudok armatok okwok douk kupaiburi waburik, okwok madae Juda uwe. Okwok
    kwanaki abrudok wabur Fonisia, douk bape shokugi nahobig Siria iri. Aria okwok
    douk kweyagwreh Grikin baraen. Douk okwok kwanak aria kwakrip Jisas abom um nihiyahuk
    enyudok yoweinyi sagab douk nyape okwokwik nugawik iri nyutogur nyuruwok.
  bgs-bgs: Ánnà sikandin Judio, su Griego tô mga kamónaan din, asta Fenicia na sakup
    ka probinsya ka Siria tô igpamasusuwan kandin. Igpédu-édu sikandin ébô paluwaán
    i Jesus tô madat espiritu tikud tun ta batà din.
  faa-faa: '@see-verse:MRK.007.025'
  kik-kik: Mũtumia ũcio aarĩ Mũyunani, waciarĩirwo Foinike ya Suriata. Nake agĩthaitha
    Jesũ aingate ngoma ĩyo thũku yume thĩinĩ wa kairĩtu gake.
  cap-NT: 'Sirofenicia cjita yokchiz z̈ontac̈ha naaqui. Grecia cjita taku chiyiñtac̈ha.
    Jaziqui naa z̈onqui Jesusa rocchinc̈ha: —Wejt uzaquiztan zajra chjatkatz̈inalla,
    —cjican.'
  ksr-ksr: Emba ii Juudaga qaagoto, Griik qaa jeŋ laligoro. Nemuŋ maŋa ii Fonisiaga
    Siria prowins kanoŋa. Iinoŋ borataa uutanoŋga ome konjombaatiwaajoŋ welema muro.
  eng-TNT: The woman was a Greke oute of Syrophenicia and she besought him that he
    wolde caste out the devyll oute of her doughter.
  sbs-sbs: Cwale mwanakazi avali Mugerike, waluzuvo lwa Zirofenia. Namukumbila kuhindika
    idimona ku mwana'kwe wa mukazana.
  sue-sue: Ota bama awa nu Yudako. Zebu nusora zazo Sirofonisia. Are nu Yesure begomo
    sero nu mai nusora bi tunaise senu
  fra-NCL: Cette femme était païenne, syro-phénicienne de nation ; elle le pria de
    chasser le démon hors de sa fille.
  bhg-bhg: '@see-verse:MRK.007.025'
  snn-NT: Judía baingo beogo. Tin baingo, Sirofenicia baingo ba'igona, bago zin hua'gobi
    gu'a huati cacasi'co baco'ë. Ja'nca ba'igona, pë'cagobi Jesusna rani, bago gu'a
    huati etoni saoye senco'ë.
  atb-NT: yhang zô chyáng mai nat gang lé hkat htoq pyám byi râ matú, Yhang lé dûng
    tôngbán ri. Myiwe haû gi, Suru-Hpiniki mau mâ é Grik byuhú nghut ri.
  wro-wro: Woŋaiin' njiŋge Greek njinina, Syrophoenician njąŋga madeja. Burkai kaiąbuna
    agula ibąnąŋgąnja wai iŋgaiąbunąŋga wunja.
  cek-AK: to nongpata loe Syrophonicia prae ah kaom Grik kami ah oh; a canu ih takoh
    thung hoiah taqawk haek pae hanah, anih khaeah tahmenhaih a hnik.
  bkd-bkd: Su bahi Griego ha etaw ha imbatà diyà ta Fenice ha sakup ta Siria. Pinagayukan
    din si Jesus ha bugawen taena su busaw duun ku laga-laga.
  ctu-76: Ch'oyol ti yambʌ pañimil Sirofenicia bʌ i c'aba'. Ti tyʌli i c'ajtiben Jesús
    cha'an i choc loq'uel jini xiba' am bʌ ti' pusic'al yalobil.
  lac-NT: A xquico' griego u t'ʌn, chen raji' ti' naj cʌja'an tu ru'umin sirofeniciajo'.
    Caj u chich c'ataj ti' ca' joc'sac a quisino' ti' u chan parar xquic.
  xla-xla: '@see-verse:MRK.007.025'
  xav-NT: '@see-verse:MRK.007.025'
  cuk-cuk: A-ome Judío-dulesulid, Sirofeniciaʼginedid. Geb ome Jesúsʼgi wilenaigusad,
    e-bunologi-nia-maid ega onoye.
  tbf-tbf: Ine mi vevien eie mi Kibang, kap va mi Iuda, gi nga kava i Ponisia i aron
    mi enamon leong i Siria. A nga no masitinoiv se Iesu va ta nga kareir rivie mi
    tsaka moromoruo se natuon vevien.
  uig-CYR: (аял Юнанлиқ болуп, Сурийә өлкисидики Фәникий миллитидин еди). У униңдин
    қизидин җинни һайдиветишни өтүнди.
  ikw-NT: Nwerinya wam bụ́o nye Ju, be mụrnu a nụ Sirofinisa. Ọ rịasno a ma ọ chịhala
    rẹnwu ọjo wam n'ẹhni nnwọ a rinya.
  khs-khs: '@see-verse:MRK.007.025'
  dwr-ENT: ሄ ሚሺራታ ኣዪሁዳ ኣሳ ጊዱኩ፤ ኣ ዬሌቴዳዌካ ሶሪያ ጊያ ጋዲያና፤ ኣ ባሬ ናቲፔ ፃላሂያ ኬሳና ማላ፥ ዬሱሳ ዎሳዱ።
  pma-pma: Ahin enek rovitei Siu tai, avasi en out Siria-Fonisia. Ka kei mai peah
    Iesu keke vahile lat ninin tisa ran natnahin.
  atd-NT: Nigbuyuan din si Hisus ko ogdogilon din ka busow duon to lawa to anak din.
    Ka soi boi, kono no Hudiu sikandin. Taga Siroponisia ka amoy rin di Ginarik ka
    kinagian din.
  tel-2017: ఈ స్త్రీ సిరియాకు చెందిన ఫెనికయా ప్రాంతంలో పుట్టిన గ్రీసు దేశస్తురాలు.
    తన కూతురులో నుండి ఆ దయ్యాన్ని వదిలించమని యేసును బతిమలాడింది.
  hat-BSA: Alò, fanm sila a te yon moun etranje nan ras Siwofonisyèn. E li te kontinye
    mande L pou chase move lespri a sou pitit li a.
  bxh-bxh: In mate Giliki Waihinina Fonika Nuꞌuna yai ya tubu, Siliya ganahewana yai.
    Yesu ya anꞌetai bena yaluwa heyaheyayana natuna ganahewana yai ya liba dui.
  top-NT: tuncán lákmilh, y acxni lákchilh tatzokostánilh ixlacatí̱n y huánilh xlacata
    cama̱ksá̱ni̱lh istzuma̱t.
  msk-msk: '@see-verse:MRK.007.025'
  gyr-NT: 'Ahe rumo ndahei judía, sirofenícia ɨguar ité. Ahe aipo ehi Jesús upe: “Enose
    che membrɨ sui caruguar” ehi.'
  kmh-kmh: '@see-verse:MRK.007.025'
  ukr-ONPU: Жінка була гречанкою, родом із Сирійської Фінікії. Вона благала Ісуса
    вигнати демона з її доньки.
  emi-emi: Vause ateva karika aJiu ia, me ghe lutula ePoenisia elome tale patunganua
    ateva eSiria, ghe kookolomi esarasarakana Iesu tani tiu velu raroai eteva ta natuna
    aliki vause ateva.
  zpv-NT: ya gunnaꞌh chi ayi naa ba bwiinn Israel sino que naa ba tuhbi bwiinn sirofenicia,
    per loh nin gunaaba ba tin gabweꞌhe Jesuhs bwiinndxaaba chi stoꞌ lliiꞌndxaꞌpa
    ba,
  gux-gux: o pua yeni dentie gileka fenisa yua.
  kos-kos: Mutan sac el sie mutan pegan su isusla in acn Phoenicia in facl Syria.
    El kwafe sin Jesus elan sisla demon uh liki acn natul.
  ibo-ibo: Nwanyị a bụ onye Griik a mụrụ nʼakụkụ Sairo-Fonisia. Ọ rịọrọ ya ka ọ chụpụrụ
    ya mmụọ ọjọọ ahụ bi nʼime nwa ya nwanyị.
  yml-yml: Vavinenidi kebu vavine Isileliga taunidi i tubuga ꞌatamana Finisia, ꞌawalawa
    Silia nageneye, siwe Iesu i veluꞌuieni nuanuaotogidi natudi i na ꞌiveꞌatumaia.
  ory-ory: ସେ ସୁରଫୈନୀକୀୟା ଜାତିର ଜଣେ ଗ୍ରୀକ୍‍ ସ୍ତ୍ରୀଲୋକ ଥିଲା। ତାହାର ଝିଅଠାରୁ ଭୂତ ଛଡ଼ାଇବା
    ନିମନ୍ତେ ସେ ତାହାଙ୍କୁ ଅନୁରୋଧ କରିବାକୁ ଲାଗିଲା।
  bzj-bzj: Bot shee da neva wahn Joo. Shee mi baan da Foneesha eena Siriya. Wel, shee
    kohn bayg Jeezas fi jraiv owt di deeman owta ih lee gyal.
  chk-chk: Ei fefin eman fin lükün Israel, a uputiu lon ewe fanü Fonisia lon Siria.
    Neminei a tüngormau ngeni Jesus pwe epwe atowu ewe ngününgau seni nöün we nengin.
  ssd-ssd: Pino ta kasomok pino. Nu Finisianu Siria ma mbolok pino ande. Buklaŋge
    kulim nuŋe tina ta Yesusŋge pitaiwa ŋga nu sarsarmba minna le
  acr-TNT: Ecꞌu rixok na cuqꞌuil ta ri aj judiꞌab yey alaxel pa ri luwar re Sirofenicia.
    Xelaj cꞌu che chaꞌ caresaj bi ri itzel uxlabixel che ri ralit.
  rop-rop: '@see-verse:MRK.007.025'
  mee-mee: Na avale laeala ka sana i a Iura te. Ke sa. Ka i a agau ora naname toapisigia
    ngae Siria Ponisia. Ba i ke tanikalkale Iesus ta i taongamalagange kannu laeala
    e soali nga tuna piau.
  mwf-2018: '@see-verse:MRK.007.025'
  dif-dif: Nani widla Griecha widla nganana wonti, Syro Phönizia mitani dankanala,
    ja nani nunkangu ngatjina wonti, Nulu kutji murumuru nankani ngatanandru dunkalkananto.
  gam-gam: '@see-verse:MRK.007.025'
  nou-nou: Edo evetu emone aumo ra Phoenicia ainda bugusira. Edo baingo dederi edo
    Iesu da tei da atise evetu emimi Iesu da yei uso gagara da joda asisi bebegae
    awa ondari bugudo mambarase benunu sisira.
  mqb-NT: Uwar ata nà, winen Sirofiniki ahay, a ja 'am sə Gərek. A jan anà Yesu,
    â razl anan setene à dəna anahan ata wa, apasay a sə vawan nga ata awan.
  ape-B: Okudak almatok okwok douk kipaibuli wabulik, okwok wo Juda e. Okwok kwanaki
    abuldak wabul Finisia, douk blape provins Siria uli. Ali okwok douk kweyagwleh
    tokples Grik. Douk okwok kwanak ali kwanubu kwaklipu Jisas umu nuhiyahuk enyudak
    sagabu douk nyape okwokwik nugawik uli nyutoglu nyulhwas.
  grc-F35: Ἦν δὲ ἡ γυνὴ Ἑλληνίς, Συρα-Φοινίκισσα τῷ γένει, καὶ ἠρώτα αὐτὸν ἵνα τὸ
    δαιμόνιον ἐκβάλῃ ἐκ τῆς θυγατρὸς αὐτῆς.
  cav-NT: 'Tumeque epunatu israelita ama jucuare. Sirofenicia yahuaju ecuinanaque
    patu jucuare. Jesúsja yacuaju nuyutsutu canerecaticuare: —Ique Cuatsashaquique,
    nerecabacue ique. Ijehuecuinacue ijahua cuana ecue ebacujuna juque, —jadyatu epunara
    aticuare Jesús.'
  kgp-NT: Hã ra fi vĩ vỹ tỹ Grego nĩ, ũ tỹ Siro-Fenício krẽ vỹ tỹ fi nĩ. Kỹ fi tóg
    to vĩ mãn', to vĩ mãn', he mũ, ti tỹ fi kósin fi jagrẽ kórég ẽn kutẽm jé.
  bvd-bvd: Ma wela keni nai, nia na ai 'i sara lau gwana faasia bali lolofaa 'i Fonisia
    laona maefera 'i Siria, ma nia nao lau wela keni Diu, ma na saari nia na anoedoo
    ta'aa nia burosia. 'Uri nai, nia ka amasia sa Disas uri kai taria na anoedoo ta'aa
    nai faasia na saari nia.
  ukr-1871: Була ж жінка Грекиня, родом Сирофиникиянка; й благала Його, щоб вигнав
    біса з дочки її.
  apz-apz: Olo aꞌmu losi kako Juta aꞌmuꞌmaho. Oꞌo, kakoe aꞌamu Founisiya, hwaho Siliya
    ntaꞌangiyoho. Kako Jisasɨmo jomo ulɨmento, Towahuno wonyo nje mumo humasolo wae
    ntohofiyo.
  yon-yon: Yu kuu Yuudan yi wonongban kambong Taiya diambed wooneen yu wonong. Yumbed
    Yesu yaa eekmeen kuu yu dana yu niindem aom awad arewa kankorarok andud.
  poi-NT: Tu̱m griegopɨc yo̱mo, d́a je de Israel. Tsucum jém naxyucmɨ Sirofenicia.
    Jesɨc jém yo̱mo icunucsáy Jesús iga it́obáyiñ jém mal espíritu jém iyo̱mma̱nɨc
    ia̱namaŋjo̱m.
  dhg-dhg: '@see-verse:MRK.007.025'
  wuv-wuv: Mei pifine, hia Greece. Waniniana Syrian Phoenicia. Namina i'igifawe'i
    a'a Jesus ba neipo'o fawala'anaa fei pigea a'a mei na'una.
  quf-NT: '@see-verse:MRK.007.025'
  yuw-yuw: '@see-verse:MRK.007.025'
  mph-mph: '@see-verse:MRK.007.025'
  hus-NT-1971: Pel i uxum axi yab i Israel, cum in xits’al ti tal pel i sirofenicia.
    In conchi a Jesús ca canchin an at’ax teneclab tin ts’ic’achil.
  med-med: Amp ei, Grik amp ei, wote Siriya Ponisiya kona ila metʉng. Amp ei ndi,
    Jisas waldpa nimba mel, elim nga mbuⱡam ambuⱡa ei nga kur kit morum ei, tʉpa mundangga
    nitim.
  bch-bch: Be taine toa oa Iuda aea mao. Ei tibur Ponisia aea ngan tibur kapei Siria.
    Be ila ta ibeta matua ei ngan serenga iriau paeamao ngan inat taine.
  cco-NT: Jo̱ i̱ niquiáꞌˆ i̱ sɨmɨ́ˆ do seeiñˋ fɨˊ lɨ˜ huí̱i̱ˆ, fɨˊ co̱o̱ˋ fɨɨˋ jiéꞌˋ
    laco̱ꞌ góoˋ Jesús, fɨˊ co̱o̱ˋ lɨ˜ siiˋ Sirofenicia. Jo̱ mɨ˜ cangoquiéeiñˊ fɨˊ
    lɨ˜ singꞌˊ Jesús, jo̱ camɨꞌrˊ dseaˋ do faꞌ niguíñˉ i̱ ꞌlɨngꞌˆ i̱ iuungˉ dsíiˊ
    i̱ sɨmɨ́ˆ quiáꞌrˉ do.
  deu-1951: die Frau war aber eine Griechin, aus Syrophönizien gebürtig; und sie bat
    ihn, er möge den Dämon von ihrer Tochter austreiben.
  alq-ALGNT: Ka8in Coda8innik8e8isiban aa ik8e, Pinicia (Phénicie) ki iji nta8igiban
    8edi Siria (Syrie) akikag. Ogi pagoseniman dac Jesosan kidji sagidjinija8andjin
    madji manidon odanisikag.
  ixl-NNT: As jit tiaal Israel u ixoj. Pet aꞌ jejlikkat u ixoj tu u tenam Sirofenicia
    uvaꞌ atik ok tiqꞌabꞌ u Siria. As ijaj ixoj bꞌaꞌnil te Aak tiꞌ uvaꞌ la teesa el
    Aak u subꞌuleꞌ tiꞌ vixvaak u ixojeꞌ.
  boa-NT: Aalléhjáa mɨ́móuuvévá dííbyé lliiñévú Tsiropeníítsiá iiñújɨ múnáalle tsíjtye
    múnáalléré íjcyárolle. Áánemáhjáa Jetsóoke neelle dibye iwáágóo naavéneke ɨ́dsɨ́
    pañétu.
  etr-etr: Udia ameada Giligi ado adolo. Eda Silia Fonisia fii udia. Ea Yesuma gelola
    sähalea, Nïe nidiwi holöböma mugabe fedai sebe amo dia nesila digamäia helësësamelëla
    säla ï.
  quh-NT: '@see-verse:MRK.007.025'
  kwi-kwi: 'Usne mamaz suras ara. Usne Judío awaras chi. Griego pit kwinta kit kit
    Sirofenicia suras ara. Usne ussa paikwat: —Kwail salizne ap pashura pizta. Ussa
    puzninti, kizta.'
  agm-agm: Iyataatɨ saatɨ apopaatɨ Judaahiyaamɨ dawaapɨpɨhapɨhiyaamɨhaatɨ amɨ isɨhiya
    Pinisiyaahiya Romɨhandamɨ Pɨropinjɨhandɨ Siriyaahanda bimohiyɨhiyaamɨhaate. Isɨ
    kaatɨ Jisaasihoai gousetɨ kaatamɨ maataatamɨhetɨ itɨpɨho maipɨho bimisɨhoai nematɨ
    tahamanausoaasɨtandɨ nunjenataise.
  ubr-ubr: On jever toumanin on Phoenicia emon inat Syria tafanam amonai on nan irat.
    On jever on Iesu ifefeyanai natun jeverei tefanai dau imama on itfaitan itgat
    mes.
  tsw-NT: Kaꞌa gba Meheleni ma ɗa, uba̱ta̱ u na wu uta̱i gba Basurofiniki ɗa. A̱vu
    u pati Yesu uta̱a̱ otoni a̱ lima̱ a na a uwai a̱tsuma̱ a mawun ma̱ yi.
  cax-NT: Arrümanu paürrü auqui quiatarrü nacíon, nürirri Sirofenecia. Nurarrü griegorrü.
    Ñanquitio pünanaquiti Jesús nauqui aiquiaüburutiti choborese auqui nichechese.
  aia-aia: '@see-verse:MRK.007.025'
  srp-1865: A žena ta bijaše Grkinja rodom Sirofinièanka, i moljaše ga da istjera
    ðavola iz kæeri njezine.
  agt-agt: Bakkan ta Hudyo ya babbayen, te Giregu nga taga Funisya, a ya uhohug na
    te Hesus a “Ikallak nak, Afu, te patugutam mina ya anitu na anak ken nga babbay,”
    kunna.
  lug-lug: Omukazi teyali Muyudaaya, yali Musulofoyiniiki, n’amwegayirira agobe dayimooni
    ku mwana we.
  yby-yby: Aya menaya Juda mena minamiye, hetoka menaya Poinikiya ebaya Siliya mikauka
    soto pibo menalimoya oluwada ukauti maya oloha lahelamibo mako neboya kohako oli
    hitane loko loetaiyoko,
  heb-heb: והאשה יונית וארץ מולדתה כנען אשר לסוריא ותבקש ממנו לגרש אר השד מבתה׃
  mpp-mpp: '@see-verse:MRK.007.025'
  apb-apb: A hu'ena, ingeie nga hu'e ni Jiu ha'ike, ta'e e hute aana po'o ni henue
    i Ponisia i laona aalahanga i Siria. Na e lae mai ngarasie a Jisas hunie ke ta'aasie
    li'oa aaela mwaanie kele pule ingeie.
  san-TEL: స్వకన్యాతో భూతం నిరాకర్త్తాం తస్మిన్ వినయం కృతవతీ|
  ben-IRV: মহিলাটি গ্রীক, জাতিতে সুর ফৈনীকী। সে তাঁকে কাকুতি মিনতি করতে লাগল, যেন
    তিনি তার মেয়ের ভিতর থেকে ভূত তাড়িয়ে দেন।
  ntu-ntu: '@see-verse:MRK.007.025'
  pan-pan: ਉਹ ਔਰਤ ਯੂਨਾਨੀ ਅਤੇ ਜਨਮ ਦੀ ਸੂਰੁਫੈਨੀ ਸੀ। ਉਸ ਨੇ ਉਹ ਦੇ ਅੱਗੇ ਅਰਜ਼ ਕੀਤੀ ਜੋ ਤੁਸੀਂ
    ਮੇਰੀ ਬੇਟੀ ਵਿੱਚੋਂ ਭੂਤ ਕੱਢ ਦਿਓ।
  gvc-gvc: Ticoro Sirofenicia wama tiri yahpa macaricoro jiha. —Watĩnore cohã wiosiniga
    yʉ macore —ni siniha ticoro Jesure.
  mwp-mwp: Na senabi yoepkaz, Isoereylaw mabayg lawnga, na Goerikaw yoepkaz, a nanu
    geth lag Siriya Ponesiyanu. Na kasa koeyma yoewdhaydhin Yesulpa kedha, nuydh kay
    senabi wati mari adhapa woeyaypa nanu kazingu.
  ksj-ksj: Aniꞌe |iGuriki|r* roḡaeḡa, TuroFenise habaꞌano bororaro. Ani Iesu uminiro,
    vine sauꞌa aboḡa mazaonoꞌo hegone bunoga veize.
  sbk-sbk: Ushi uyo Muyunani, wikambela ilwa Kifoeniki. Alambile umwene anyizhwe ipo
    afume wa lyindu wakwe.
  mya-JVB: မိမိ သမီး ထဲက နတ်ဆိုး ကို နှင်ထုတ် တော်မူမည်အကြောင်း တောင်းပန် လေ၏။ ထို
    မိန်းမ ကား ၊ ဟေလသ အမျိုး ၊ ရှုရိဖိနိတ် ပြည်သူဖြစ် သတည်း။
  kgf-kgf: Embac imi Girik embac, Sirofoinikia ic ionac sac kiticgina. Waŋu bérara
    uŋa biria nesimimac niŋac welecmiyec.
  awb-awb: We mitaqté náhnsó ínínéna Káríki ehwéh iro iní míre. Wega Sísansabé, Nániyahu
    subiqmaq subiqmari owáínáwá segasuo teawuwe.
  gdn-gdn: Keyai berokoi mosi ridi ki e petei rabineya tondawa ki pokere ridi ki karako
    garugaru mena bauwena Iyesu yabareya kwarisiwena e ramatai kawareya ubupu manako
    Iyesu genepupu da e uburana keyai berokoi e petei rabineya tondawa ki siwakeke-pana
    ki nana.
  hvn-hvn: '@see-verse:MRK.007.025'
  nko-NT: Griikiyintse ɔtsɩ ánfɩ gyí. Bɔkwɩɩ́ mʋ Siro Foenike ɔsʋlʋ́sʋ. Olokokóli
    Yesu ɔbɛ́ɛ, ogyáa ɔŋɛ laláhɛ amʋ lɛ mʋ bi ámʋtɔ.
  bsn-NT: '@see-verse:MRK.007.025'
  pib-NT: Wa suxni Kriyko, Sirogwenisanemole. Tagjitlu ruknokyaplu maleka kamchi tshichoya.
  wiv-wiv: Na tavine kua e bukuni Grik, ki valohua ni Fonisia ni Siria. Ia ki hule
    haroinia matoto a Iesus kete pele kakava na vule zaha na tuna tavine.
  reg-reg: Omugasi Oyo aliga Muyunani, wo luganda lwe kifoeniki. Amwilembejishe omwene
    abhilimye lisambwa okusoka mu muyansha wae.
  mlh-mlh: Ŋigo oi Judaone matayoŋ, Grik buŋo miku goya. Maŋgo mamaine oi Fonisiare
    Siria prowins oone. Iŋoji oduinere maŋgone gemo yobeiŋgo karieru ojiya.
  gof-ENT: ኢያ ኣይሁዴ ማጫሲ ጊዱኩ፤ ኢያ ዬሌቲዳይ ሲሮፊንቄ ጊያ ቢታና። ኢያ፥ ባ ናዔፔ ቱና ኣያና ኬሳና ሜላ ዬሱሳ ዎሳሱ።
  aau-aau: Sa sokukwe uwrkayn irweyk ko. Hekekwe kipay Fonisia, Siria mon ma lwak
    mon liwak. Hokwe Jisas se lonseyn, niohney piap-araw hoko ney ko owh mon ma lwak
    se me-su ha e.
  tvk-tvk: Atou ak tave Siu ti, xi be ate‑Siria tei te provins te hal Fonesia. Xi
    dakes Iesu tengan vahol rat ninin tesa vahe reling atuli nan.
  prf-NT: Iyud a bábbi ay Griego a taga-Sirofenicia. Nákkekagbi siya kánni Jesus a
    palakadán en dimonyo a summáddáp ten anak na.
  auy-auy: wemá ímba Yúndaa-inimba póna Síriyaa-marafaꞌa Fínísiyaa-naopaken-ininko
    Ísumpaꞌa iyéna maraꞌá kífaena óraaka séna kesiyáámúnkon-arumpinkemba sáwí-amutamba
    maiyauwaaó súwana
  tbg-tbg: Vi nahentiva kia Iutaa vatanaa nahenti vairaitiro, viva Siria vataini Fonisia
    vatukaqi vatato nahentiva vaura. Viva Ihurara tiharo, Mpo, ti raavuraqihaira vaana
    atitairaro qaqini aitaraarire, tiro.
  hub-NT: '@see-verse:MRK.007.025'
  hmo-hmo: Inai hahine be Iuda lasi hahinena, iena bese be Suro Penise. Ia noinoi
    Iesu dekenai, natuna lalonai noho lauma dikana ia lulua oho.
  big-big: Yongokmolo Yudamele ono, pi Kirik ngago yeikta kaimele keya pi ngabelak
    Siriya meibekkamele logo ngai Pinisiya meimekkamele kapura pulogo Taya keya Sairong
    yolumele. Pugu kanda Yisuyegi kerewa yenge pigi yangomelegi yungke yolubek welagela
    wezamelibene nguk meiya.
  gux-G: Li pua bo ñani Fenesi Siiri dogu nni. o bo mia ke Yesu n beli ki ñani t tagibiidi
    o bisalo nni.
  cnl-NT: Dsa³ jia'³ hua² mɨ́³ 'í³. Sirofenicia xen³. Ca²³ŋɨ́ɨ³ mɨ²'áa² quie'² Jesús
    'e³ rɨ²³dxin³ espíritu quien³² mɨ²³sɨ²³quiʉ'² 'i³ quie̱n³ jo̱o̱³¹.
  zar-NT: Nigula ni bitiʼ nácanu judío, pero nabábanu bönachi Sirofenicia. Gútaʼyunu
    lahuëʼ Jesús ubéajëʼ böʼ xihuiʼ naʼ yuʼu-biʼ biʼi nigúladoʼ queë́nu.
  kde-kde: Mmahe aneyo nanga panavele Nnyahudi, henga ávele mwenedi wa ku Foinike,
    chilambo cha ku Siliya. Nkunnyuwa Yesu ammuse nanndenga mmwanawe.
  ata-ata: La milingau pekiaꞌu sou lexe Anu ukusau uleenu masua e uxoxolu noxie ꞌilie
    ne. Ane sema ne, sema Xiliki. Mivoꞌone no xalee lia tila ne Ponisia no tuala tila
    ne Silia.
  qvw-NT: Pay manam Israel caśhtachu cala, sinu'a Sirofenicia nishan malcäpïtam. Paymi
    Jesusta ruygacula wamlanta sänaycachinanpä.
  nfa-nfa: '@see-verse:MRK.007.025'
  tnp-tnp: '@see-verse:MRK.007.025'
  urd-urd: ये 'औरत यूनानी थी और क़ौम की सूरूफ़ेनेकी। उसने उससे दरख़्वास्त की कि बदरूह
    को उसकी बेटी में से निकाले।
  hot-hot: Yani ma avi Glik te ba talêbô havathu hêk Ponisia hamô Silia kapô. Ba hanaŋ
    hik Yisu liŋ lôk kapô malaiŋ nena nêm ŋgôk atu ba hamô haviŋ nalavi vê.
  mqj-NT: '@see-verse:MRK.007.025'
  rus-SYN: а женщина та была язычница, родом сирофиникиянка; и просила Его, чтобы
    изгнал беса из ее дочери.
  mbh-mbh: Aveto seng aken ini seng Juda avele ini seng Grik, nge rem ako a Ponisia
    nge epee a Siria, na i nong a Jisas nge ve aro i wistetpot tamata kerenga aken
    a itun nge.
  bdd-bdd: '@see-verse:MRK.007.025'
  cbt-NTPO: '@see-verse:MRK.007.025'
  srn-NT: A frow disi no ben de wan Dyusma. A ben gebore na ini Fenisia di ben de
    wan pisi fu Siriakondre. A begi Yesus fu puru a takruyeye na tapu en umapikin.
  cta-NT: ngüijña maꞌ chaꞌ clyu tiꞌ jiꞌi̱ yu, chaꞌ culo yu cuiꞌi̱ cuxi nu ntsuꞌu jiꞌi̱
    sñiꞌ, ntiꞌ maꞌ. Chaꞌcña jiꞌi̱ nguꞌ griego nchcuiꞌ nu cunaꞌa̱ biꞌ, chaꞌ nguꞌ xaꞌ
    tsuꞌ laca maꞌ, nguꞌ sirofenicia.
  bqc-SIM: Nↄɛpiá buipãleɛ, wà aà ì Silifinisi bùsuuɛ. À wabikɛ̀ Yesuwa aà
    tã́a goɛ a nɛ́wa.
  tcz-CHONGTHU: Achanu a kon'a lhagaoboh anodohpeh dingin ahung taovin ahi. Amanu
    chu Syrian Phoenicia tolkon, Gentile-ho ahijeh chun,
  mar-mar: ती स्त्री ग्रीक होती व सिरीयातील फिनीशिया येथे जन्मली होती. तिने येशूला
    आपल्या मुलीतून भूत काढण्याची विनंती केली.
  snp-snp: Kiyana umola fiyami wenawa ya ailo feka wena minoto Fonisia ebalo Silia
    mikalo oloto piyami wena yakafo eti loumami, Olunefo Satani kimiwela siya-mulunau
    mino edami ya olu fulo edeto ilifi melo, loto wako loumaiye.
  isl-isl: og grátbað hann að losa dótturina við illa andann. (Konan var frá sýrlensku
    Fönikíu og því heiðingi í augum Gyðinga.)
  spy-NT: '@see-verse:MRK.007.025'
  xnn-xnn: Baken Judio san in-ina tay id Fenisia id Siria nan ilina ngem ninseg-ang
    kayet ken Jesus ta pagawisena nan anakna.
  mwe-mwe: Bhene bhakongwebho pubhaaliji Bhagiliki bha ku Poinike shilambo sha Shilia.
    Bhai, gubhaajujile a Yeshu bhanshoye mwali jwabho lioka jula.
  tte-tte: Na bwaite sinene nige sine Yudiya na iya sikabi yanuwa Pinisiya koina Siliya
    ana dedei mena. Kabo ikawanoi Yeisu koina yakato tem yaluyaluwa bikine natuna
    koina itao-yawatagilan.
  tcs-tcs: Da oman em i Nozuwis bat em bin bon de wea Ponisia, de wea kantri blo Siria.
    Em spik sorewan po Zizas, ‘Zizas, plizgar! Yu ken tekemaut dis nugudspirit prom
    smolgel blo mi?’
  hlt-THB: Cawhkaw nu cetaw Syria Phonicia awh ak thang Greek nu na awm hy. A canu
    ak kawkhui awhkawng qaai hqek peek aham Jesu a venawh qeenaak thoeh hy.
  soq-soq: “Ne menanedia anona bedewe aleu kadiwa wandia tanawo nosepie nambelepi.”
  qub-qub: Chay warmiga caran griego rimayta rimaj Sirofenicia particho yurejmi. Jesusta
    ruwacuran warmi-wamranpita dyabluta gargunanpaj.
  att-att: Á ari Kudio yù babay, ta Sirupinisia yù ikáttole na. Á inikomá na kâ Apu
    Kesu ta palawanan na yù anitu sù anâ na.
  bki-bki: '@see-verse:MRK.007.025'
  bqp-bqp: Nↄgbɛ̃ pì sↄ̃ Giriki gbɛ̃mɛ ò a ì Siria Fenisia bùsun. À wɛ́ kɛ̀ Yesua
    de à tãna goarɛ a nɛ́a.
  mcp-mcp: Mudá wɔɔŋgʉ́ nyə á bə shilə Ogʉrɛ̂k, nyə a byɛ̂l lɔɔm á Fenisî, shí á Sirî.
    Nyə á ka zə jəgʉla nə Yésus nə́ a yílʉ́g shilə yé jamb.
  hat-hat: '(Fanm sa a pa t'' jwif, se moun peyi Siri, nan yon seksyon yo rele Fenisi.)
    Li te fè Jezi demann sa a: -Tanpri souple, chase move lespri ki sou pitit fi m''
    lan.'
  npl-NT: Nin siwatl de Grecia iwa itajwah owalewatokah de sirofenicia. Okitlatlaujtiko
    n Jesús makikixtili n espíritu amokuali non ichpoch okipiaya.
  bgg-bgg: Jipha hò-amuii ne Jew asi ro, ai ne Phoenikhia du-ùa Syria pha thiig hà
    giak pha bimi ro. Ai è Isu shii wad khung ne yao, “Gu dimi shii ibuii ragung è
    jiang pha ji ne na ne khia maphi bo.”
  eng-TCENT: (This woman was a Greek, a Syrophoenician by birth.) She asked Jesus
    to cast the demon out of her daughter.
  eng-BSB: Now she was a Greek woman of Syrophoenician origin, and she kept asking
    Jesus to drive the demon out of her daughter.
  cpu-NT: 'Kaari judío iroka tsinane, opoñaatya iroori pashineki nampitsi opaita Sirofenicia.
    Okantapaakeri: “Jesús, povashinchagainaro nishinto, jaakatziiro peyari.”'
  san-ASM: স্ৱকন্যাতো ভূতং নিৰাকৰ্ত্তাং তস্মিন্ ৱিনযং কৃতৱতী|
  tac-NT: Alué mukí iwé eyélaka tabilé ralámuli israelita nile, se'nú ra'íchame nile,
    pe griego ra'íchame nile.
  eng-WEBPB: Now the woman was a Greek, a Syrophoenician by race. She begged him that
    he would cast the demon out of her daughter.
  gfk-H: Ga ianga marmaris tane Iesu bia na hasur sei no sakana tanua nong ga sasahai
    tano nuna nat na hinasik. Ma iakano hahina, pai Iudeia ia. Di ga kaha ia tano
    hanua Ponisia tano tamat na hanua Siria.
  viv-viv: Badi kwamayoku ma hawahawala keke vinemiYuda, melala ana egana Finisiya,
    Siliya ana fafali againe hitubuga. Ada Yesu hihawayafeyafena be yafune natudi
    giluvaiyena-ma ginawavina.
  yao-yao: Jwankongwe jo ŵaliji Mgiliki ni nganaŵa Myahudi, juŵapagwile musi wa ku
    Silofonike ku chilambo cha ku Silia. Ŵaachondelele Che Yesu akankoposye mwali
    jwao lisoka.
  tgp-tgp: Har̃ai atu enia har̃ai r̃or̃oha matea mara Syria Phonecia. Ale mo usia
    r̃ilangi vara i titiu nar̃ihi tanume sasati atu isan venatuna.
  auc-NT: Itota ëñëmi. Wënæ botö wengä tönö në quëwengä ingante wido cæquïmi, angantapa.
    Mänïï onquiyængä Tidopënitiabæ në ëñagaingä inte guidiego tededö në tedecä ïnongä.
  kbc-NT: '@see-verse:MRK.007.025'
  bmh-bmh: Air go Zuda air tam. Go Grik air, gonugau uzan Ponisia, Siria agaig ebuan.
    Go Kanan air tub. Gonug Yesus guzenai gusig aureun, “Wes eg izal alegwai nugau
    ougab oug dareu, nagen oi hen.”
  ctu-BL: Jini x'ixic griega, ch'oyol ti Sirofenicia. Tsi' c'ajtibe wocol t'an cha'an
    mi' choc loq'uel xiba ti' yalobil.
  meq-meq: '@see-verse:MRK.007.025'
  noa-H: Mag hʌʌi deeum durr Sirofenicia hanʌm durram hajim hanaabá. Hich mag hʌʌirau
    Jesús haar mawia chaigpaimajim hanʌm, hich chaai mor heem t'õt'õrrsöm bën höbeerpʌ̈imk'ĩir.
  alp-NT: kai ikotie leke Yesuse Isirie ro tiare bei eni nanae binare. Bina mere tamata
    Yunani, ruelei me otoi Siro-Fenisia.
  san-VEL: svakanyaato bhuuta.m niraakarttaa.m tasmin vinaya.m k.rtavatii|
  kbq-kbq: ana ara Sairofonesia kumateti Griki megi'a vahepinti a'kino, Jisasinkura
    muse hugantoanki havi avamura ome hunto huno asami'ne.
  kbh-kbh: Chë shembása ndoñe yonjamna judiá, sinó Sirofenicia luarocá. Tojánabo y
    Jesúsbioye tbojanimpadá chabe bembetémbents̈ana bacna bayëja chabuatábocnama.
  ron-LSB: Femeia era o greacă, siro-feniciană de rasă. Ea l-a implorat să alunge
    demonul din fiica ei.
  pon-pon: Li en Krik amen, kijan jap en Jiro-Penijia, potoan on, poekipoeki re a,
    en kauja jan na jerepein tewil o.
  nhe-BL: Pero nopa sihuatl ax eliyaya se israelita. Yajaya camatqui griego huan ehua
    se lugar tlen itoca Fenicia ipan tlali Siria. Huan nopa sihuatl hualajqui huan
    quitlajtlani Jesús ma quiquixti nopa ajacatl tlen quipixtoya isihuapil.
  sps-sps: A moun to aya na moun te agiir Finisia a muiny Grik tan gum fan tsian iny
    Siria kat fuainy ror tana taa Jiu. Ana ayei sing maamaa to Jisas ma buur ravainy
    Yan masarau tana guei moun tsunia.
  wnc-wnc: Maya waapa Grik wamu ayakaing amikatnana tapatu. Ita Finisia kep komu Siria
    kep komune yuaune nana tapatu. Ita muna puke Jesue waung waita yapana takuunin
    inikwasiwikge inimatakut.
  bus-bus: Nↄgbɛ̃ pì sↄ̃ Giriki gbɛ̃mɛ wà à ì Siria Fenisia bùsun. À wɛ́ɛ kɛ̀ Yesua
    lɛ à zĩn goare a nɛ́a.
  gub-BL: A'e kuzà Zutew 'ym romo hekon a'e. Peni ywy rehe har Xiro tawhu pe uzexak
    ma'e kwer romo hekon a'e. — Emuhem kar tekwe ikatu 'ym ma'e hememyr wi nehe 'y,
    i'i izupe, imuhem kar haw henoz pà izupe.
  imo-imo: Aku ambomu yu Juda imbomanga tukundo ambore molo. Yu ambo pupu Grikimu.
    Yu meko Siria Fonisia nimbe kombu tenga tukundo meringi. Aku ambomu yuni Jisasindo
    konge tepalie nimbei, “Nu paa ongo, nanga balomunga kuro kerimu makoroko munduwi,”
    nimu.
  boj-boj: Uŋa di a Grik qaji. A Juda uŋa sai. A Siria sawaq di ŋambabej. A Fonisia
    qure qaji. A Yesus aqa areq di siŋga pulutosiq a waiŋyoqnsiqa minjoqnej, “Ni na
    mondor uge di wiyimqa a ijo aŋgro uratosim ulaŋqas.”
  ulk-ulk: '@see-verse:MRK.007.025'
  eng-DRA: For the woman was a Gentile, a Syrophenician born. And she besought him
    that he would cast forth the devil out of her daughter.
  knf-knf: Ñaaţ mënţ aanwo nayuday, awo nafiniŧeŋ i uŧaak wi Ŧiri. Akooţ Yeŧu aji
    na a adook unŧaayi, upën ţi abukul.
  san-KHM: ស្វកន្យាតោ ភូតំ និរាកត៌្តាំ តស្មិន៑ វិនយំ ក្ឫតវតី។
  arn-NT: Feychi domo ta katripanche ürke, Sirofenisia mew tuwlu. Fey puwi ñi llellipuafiel
    ta Jesus ñi wemünentulelafiel ti weküfü kisu ñi domo püñeñ mew.
  zas-NT: Ad najtaman bén Israel, najman bén Sirofenicia. Dxel guzajcaman liaadx loj
    Jesús din yabëëman xindxab guin luxdoo bindoo guin.
  ken-NT: Ngɔrɛ́ wu apú nyaka mmu Israɛl. Bábhe yi chi atú Síria ndǔ nnɛrɛ́kɛt
    agho anɛ́ bábhɨ̀ŋɨ bɛ Fonísia. Anɨk Yesu mmʉɛt bɛ ambok ɛfóŋó ɛbʉ́bʉ yɔ ɛ́mfu
    mɔ́ywi amʉɛt.
